INSERT INTO `mail_config` VALUES (1,'forgot_password','New Password','New Password','<p>Dear {{NAME}}</p>\r\n<p>If you\'ve forgotten your password no worries, simply copy and paste your temporary password to this link below then create your unique password under \"My Account.\"</p>\r\n<p>New passowrd: {{PASSWORD}}</p>\r\n<p>For your convenience, you can change your password by visiting the \"My Account\" section of our website.</p>\r\n<p>Please email or call customer service if you have any questions.</p>\r\n<p>Regards,</p>\r\n<p>New Century Labs</p>\r\n<p><strong><u>HIPAA Notice</u></strong></p>\r\n<p>The contents of this message, together with any attachments, are intended only for the use of the person(s) to which they are addressed and may contain confidential and/or privileged information. Further, any medical information herein is confidential and protected by law. It is unlawful for unauthorized persons to use, review, copy, disclose, or disseminate confidential medical information. If you are not the intended recipient, immediately advise the sender and delete this message and any attachments. Any distribution, or copying of this message, or any attachment, is prohibited.</p>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>',NULL,'2021-03-24 16:17:11'),(2,'new_customer','New Customer','Welcome','<table>\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\">\r\n<p>Hi {{NAME}}!</p>\r\n<p>Please change your password by clicking the following link.</p>\r\n<p><a class=\"btn\" style=\"border-radius: 4px; background-color: #39c; color: #fff; display: inline-block; padding: 5px 10px; text-decoration: none;\" href=\"{{LINK}}\">Click here</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Respectfully yours,<br />New Century Labs</p>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>',NULL,'2021-03-24 16:17:17'),(3,'order_confirmation','Your Order is being processed.','Your Order is being processed #{{ORDER_ID}}','<p>Dear {{NAME}},</p>\r\n<p>Thank you for order! Your order number is #{{ORDER_ID}}.</p>\r\n< <br>\r\n<p>Your lab req has been added to our queue, please standby for us to review and approve your order.</p>\r\n<p>Your lab req will be available between 30 minutes to 1 hour.</p>\r\n<hr>\r\n<p><strong>What\'s next?</strong></p>\r\n<p style=\"margin-bottom: 5px\">Once our staff approve your order we will send you another email with a link to your Requisition Order which you must deliver to your medical provider.</p>\r\n<p style=\"margin-bottom: 5px\">They will draw your blood and deliver it to the testing company. When they have completed yours test(s), they will upload your results and you will\r\n	receive another email from us notifying you it\'s available for download.\r\n</p>\r\n<br>\r\n<p><strong>Specimen Collection:</strong></p>\r\n<p style=\"margin-bottom: 5px\">Once you have downloaded your req, take it with you to your local Quest PSC, make sure you present  Identification such as a drivers licenses and your lab req. Appointments are not needed, and walk-ins are always welcome. </p>\r\n<p>Find a Quest location nearest you:</p>\r\n<p><a href=\"https://appointment.questdiagnostics.com/patient/confirmation\" style=\"font-weight: bold\">MyQuest (questdiagnostics.com)</a></p>\r\n<br>\r\n<p><strong>Accessing Your Results:</strong></p>\r\n<p>Normally test results are available 72 hours from the time of your draw. Depending on some tests, results can take slightly longer. Your results will be located under your “My Account” My Orders tab in your portal. </p>\r\n<br>\r\n{{ORDERINFO}}\r\n<p>Regards,</p>\r\n<p>New Century Labs</p>',NULL,'2021-03-24 16:17:25'),(4,'registration','Registration','Verify Email Address','<table>\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\">\r\n<p>Hi {{NAME}}!</p>\r\n<p>Please confirm your email address by clicking the following link.</p>\r\n<p><a class=\"btn\" style=\"border-radius: 4px; background-color: #39c; color: #fff; display: inline-block; padding: 5px 10px; text-decoration: none;\" href=\"{{LINK_VERIFY}}\" target=\"_blank\" rel=\"noopener\">Click here</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Respectfully yours,<br />New Century Labs</p>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>',NULL,'2021-03-24 16:17:30'),(5,'notice_pwh_result','Notice Pwh Result for Customer','Your Test Results are now available','<table>\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\">\r\n<p>Hi {{NAME}}!</p>\r\n<p>Your Test Results are now available. Click here to securely login and view them.</p>\r\n<p><a class=\"btn\" style=\"border-radius: 4px; background-color: #39c; color: #fff; display: inline-block; padding: 5px 10px; text-decoration: none;\" href=\"{{LINK_LOGIN}}\" target=\"_blank\" rel=\"noopener\">Click here</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Respectfully yours,<br />New Century Labs</p>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>',NULL,'2021-03-24 16:17:35');
