INSERT INTO `pages` VALUES (1,1,'Home','home','{\"title_banner\":\"The most <strong>affordable<\\/strong>&nbsp;blood tests online\",\"desc_banner\":\"We offer over 200 blood tests online from single tests to advanced compressive panels you can order from the comfort of your home.\",\"title_section1\":\"IT\\u2019S EASY TO GET STARTED\",\"desc_section1\":\"Place your order on your desk top or any mobile device.<br> Get your lab order straight to your email.\",\"link_video_section1\":\"https:\\/\\/www.youtube.com\\/watch?v=TlNw-ybTo-w\",\"title_icon_1_section1\":\"View labs & order test\",\"desc_icon_1_section1\":\"Your lab order will be emailed to you securely\",\"title_icon_2_section1\":\"Print your lab order\",\"desc_icon_2_section1\":\"Your lab order can be easily printed from your home PC\",\"title_icon_3_section1\":\"Visit one of or our locations\",\"desc_icon_3_section1\":\"Visit one of our 2,300 friendly affiliated Quest Diagnostics patient service centers with your lab order, no appointment needed!\",\"title_section2\":\"THE MOST AFFORDABLE BLOOD TESTS ONLINE\",\"desc_section2\":\"Wouldn\\u2019t you like to know what\\u2019s going on in your body without paying an arm and a leg? We make getting a blood tests affordable and easy to access the way it should be. You can now order any blood tests on your terms, on demand 24 hour a day 7 days per week from your desktop or any mobile device.\",\"price_section2\":\"45.00\",\"sale_price_section2\":\"14.00\",\"title_section3\":\"Empower <span>yourself<\\/span> get to know the real \\u201cYOU\\u201d Take <span>control<\\/span>of your health!\",\"desc_section3\":\"Did you know that 70-80% of all clinical decisions come from blood tests and disease happens\\r\\n                        before you get a symptom. Don\'t neglect yourself, empower yourself and take charge.\",\"title_section4\":\"My blood tests are so affordable and I\\u2019m now able to have a more meaningful conversation with my doctor.\",\"banner\":\"page_static\\/home\\/banner.jpg\",\"img_icon_1_section1\":\"page_static\\/home\\/img_icon_1_section1.png\",\"img_icon_2_section1\":\"page_static\\/home\\/img_icon_2_section1.png\",\"img_icon_3_section1\":\"page_static\\/home\\/img_icon_3_section1.png\",\"image_section3\":\"page_static\\/home\\/image_section3.jpg\",\"image_section4\":\"page_static\\/home\\/image_section4.jpg\"}',NULL,'/','Yar Meta Description','Keyword1, Keyword2','ACTIVE',NULL,'2021-02-01 01:43:41','home'),(2,1,'Faq','faq','{\"content_page\":\"<h3 style=\\\"box-sizing: border-box; font-family: Raleway, Arial, sans-serif; font-weight: 500; line-height: 1.1; color: #333333; margin-top: 20px; margin-bottom: 10px; font-size: 24px; transition: all 0.3s ease 0s !important;\\\">Still have questions?<\\/h3>\\r\\n<p style=\\\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: Raleway, Arial, sans-serif; transition: all 0.3s ease 0s !important;\\\">Here are some of the commonly asked questions people have about lab testing<\\/p>\\r\\n<div id=\\\"eJOY__extension_root\\\" class=\\\"eJOY__extension_root_class\\\" style=\\\"all: unset;\\\">&nbsp;<\\/div>\",\"detail\":[{\"left_title\":\"Can I take my lab test results to my doctor?\",\"left_content\":\"Absolutely! We encourage you to take your lab test results to your doctor if you need to.\",\"right_title\":\"Can I rebill my insurance provider for my lab tests?\",\"right_content\":\"We would be more than happy to send you an itemized receipt for you to submit to your insurance provider. There is no guarantee they will pay for your lab test.\"},{\"left_title\":\"When do I get my results?\",\"left_content\":\"It depends on the test most tests take 24-72 hours to complete, however some test may take longer, please click on the test you are interested in to find out more information on timing.\",\"right_title\":\"Do you take HSA\\/FSA cards for lab tests?\",\"right_content\":\"Absolutely, we take Health Savings cards in addition to Visa, MasterCard, Discover, and American Express.\"},{\"left_title\":\"Can I order a lab test not offered on your website?\",\"left_content\":\"Yes, all you have to do is email customer service with the test code(s) and name of the test(s) we will make sure you get it.\",\"right_title\":\"Can you give any medical advice?\",\"right_content\":\"NCL does not provide any medical advice or promote any vitamin supplements, please discuss your lab test results with your doctor.\"},{\"left_title\":\"Do I need to fast before I go to the draw center?\",\"left_content\":\"It depends on the test, some tests do not require fasting, please read the description under patient prep to find out if fasting is required.\",\"right_title\":\"How do I contact customer service?\",\"right_content\":\"You can call 1-800-519-2997 and email customer service at customerservice@newcenturylabs.com\"}]}',NULL,'/faq',NULL,NULL,'ACTIVE',NULL,'2021-01-26 08:46:26','faq'),(3,1,'How To Order','how-to-order','{\"title_banner\":\"DON\\u2019T JUST THINK YOU\\u2019RE HEALTHY, <span>KNOW YOU\\u2019RE HEALTHY<\\/span>\",\"desc_banner\":\"Ordering blood tests when you need to know made easy\",\"detail\":[{\"title_step\":\"STEP 1\",\"content_step\":\"Find your blood test(s) of choice. <br>\\r\\nCheck out with your credit card.<br>\\r\\nYour Lab order will be located in your secure portal after checkout.<br>\",\"image_step\":\"page_static\\/how-to-order\\/image_step0.png\"},{\"title_step\":\"STEP 2\",\"content_step\":\"Print your lab order and take it with you to one of our 2,300 Patient Service Center locations. Walk-ins are always welcome!\",\"image_step\":\"page_static\\/how-to-order\\/image_step1.png\"},{\"title_step\":\"STEP 3\",\"content_step\":\"Test results on average take 72 hours and will be emailed to you as soon as results are complete. You may print your lab results and take it with you to discuss with your doctor if needed.\",\"image_step\":\"page_static\\/how-to-order\\/image_step2.png\"},{\"title_step\":\"Convenient Ordering\",\"content_step\":\"Order blood tests and view results from your desk top or any mobile device.\",\"image_step\":\"page_static\\/how-to-order\\/image_step3.png\"}],\"banner\":\"page_static\\/how-to-order\\/banner.jpg\"}',NULL,'/how-to-order',NULL,NULL,'ACTIVE',NULL,'2021-04-07 15:49:27','how-to-order'),(4,1,'About Us','about-us','{\"desc_banner\":\"The very center of healthcare starts at the core<br>\\r\\nfundamentals of diagnostic blood testing.\",\"desc_section1\":\"<p>When information about your body matters most to you, our goal is to help you access it so you can make informed decisions about your health. Our main goal is to help empower individuals with easy access to blood tests custom tailored to each and everybody&rsquo;s individual needs. Our mission is to help individuals take better control of their healthcare, ultimately to prevent and treat potential diseases early.<\\/p>\\r\\n<p>We believe health and wellness starts by getting to know the real &ldquo;you&rdquo; from inside out.<\\/p>\\r\\n<div id=\\\"eJOY__extension_root\\\" class=\\\"eJOY__extension_root_class\\\" style=\\\"all: unset;\\\">&nbsp;<\\/div>\",\"title_icon_1_section1\":\"World class service from start to finish\",\"desc_icon_1_section1\":\"We treat everybody here like a member, but without any membership fees. We strive to be the lowest cost providers in the United States online with the highest quality service and fast result delivery times.\",\"title_icon_2_section1\":\"Security and privacy\",\"desc_icon_2_section1\":\"Your information from ordering tests to receiving results are kept confidential and secure. We follow extremely strict HIPAA guidelines and your information will never be sold or made public.\",\"title_icon_3_section1\":\"Locations\",\"desc_icon_3_section1\":\"We have over 2,300 patient service centers throughout the United States for you to take your lab orders to. Feel free to just show up with your lab order, no appointment necessary.\",\"link_section2\":\"\\/shop\",\"desc_section2\":\"New Century Labs is powered by Quest Diagnostics, the<br>\\r\\nworld\\u2019s most credible and advanced Lab.\",\"banner\":\"page_static\\/about-us\\/banner.jpg\",\"img_icon_1_section1\":\"page_static\\/about-us\\/img_icon_1_section1.png\",\"img_icon_2_section1\":\"page_static\\/about-us\\/img_icon_2_section1.png\",\"img_icon_3_section1\":\"page_static\\/about-us\\/img_icon_3_section1.png\",\"image_section2\":\"page_static\\/about-us\\/image_section2.jpg\"}',NULL,'/about-us',NULL,NULL,'ACTIVE',NULL,'2021-01-26 08:46:41','about-us'),(5,1,'PRIVACY POLICY','privacy','<p dir=\"ltr\" style=\"line-height: 1.2; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 24pt 0pt;\"><span style=\"font-size: 12.499999999999998pt; font-family: Arial; color: #333333; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Patient Notification Regarding State-Mandated Reportable Conditions Certain infectious diseases and conditions and the identity of those who test positive for them, are required, by federal and/or state law, to be reported to local or state health authorities by your health care providers, including New Century Lab&rsquo;s Ordering physicians, </span><span style=\"font-size: 12.499999999999998pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Quest Diagnostics</span><span style=\"font-size: 12.499999999999998pt; font-family: Arial; color: #333333; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">, its physicians, staff, and the laboratories that run the medical tests, in addition to third party facilitators contracted with New Century Labs, LLC. The time frames and reporting requirements vary according to the disease or condition. These local and state health authorities are considered Public Health Authorities according to the federal Health Insurance Portability and Accountability Act of 1996 (&ldquo;HIPAA&rdquo;) which means that they are legally authorized to receive your Protected Health Information (&ldquo;PHI&rdquo;). However, both New Century Labs, LLC and these health authorities will not otherwise share or release any confidential information, unless mandated by law or authorized by you in writing.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 24pt 0pt;\"><span style=\"font-size: 12.499999999999998pt; font-family: Arial; color: #333333; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">You understand that if you test positive for any infectious disease or condition on the state&rsquo;s list of reportable conditions, your test result and your identifying information will be reported to the applicable local or state health authority. Reporting this information does not require your permission or consent. Additionally, you understand that if you test positive for any infectious disease or condition, neither New Century Labs, LLC, nor its staff, </span><span style=\"font-size: 12.499999999999998pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Quest Diagnostics</span><span style=\"font-size: 12.499999999999998pt; font-family: Arial; color: #333333; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">, its physicians, staff, or the laboratories that run the medical tests, will treat, prescribe medications, or refer you for medical treatment. It is your sole responsibility to seek and comply with necessary treatment and all required follow-up with your physician or local public health department. I authorize my health care providers, including, its physicians and its staff and the laboratories that run medical tests for me to use and/or disclose certain protected health information about me to New Century Labs, LLC for the purposes state below.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 24pt 0pt;\"><span style=\"font-size: 12.499999999999998pt; font-family: Arial; color: #333333; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">This authorization applies to the following protected health information about me: the laboratory requisition submitted by New Century Labs, LLC and the laboratory test values which are the result of the laboratory test(s) requested in the requisition. For avoidance of doubt, I specifically authorize the transfer of this information between and among me and the following Participants, organizations and their representatives: i) New Century Labs, LLC ii) </span><span style=\"font-size: 12.499999999999998pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Quest Diagnostics</span><span style=\"font-size: 12.499999999999998pt; font-family: Arial; color: #333333; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\"> staff and physician of record, and iii) the reference laboratory of record. I understand that </span><span style=\"font-size: 12.499999999999998pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">PWNHealth </span><span style=\"font-size: 12.499999999999998pt; font-family: Arial; color: #333333; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">physician of record may be required to receive my lab test results before I do, and that this physician&rsquo;s authorization to release those results to New Century Labs, LLC may also be required before I receive my results.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 24pt 0pt;\"><span style=\"font-size: 12.499999999999998pt; font-family: Arial; color: #333333; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">The protected health information will be used or disclosed for the sole purpose of complying with the state and federal laws which may require a physician or their agent to: 1) review and approve a laboratory requisition; and 2) review the laboratory test results. This review may be conducted for any reason, including in the event laboratory values, which are outside of normal ranges, require the physician or its agent to contact me. The purposes outlined above are provided so that I can make an informed decision whether to allow release of the information to the parties referenced in this authorization. This authorization will expire one year after the date of this authorization. I understand that I have a right to receive a copy of this authorization. I understand that the sole purpose of the laboratory test is to generate the results of the tests that I and New Century Labs, LLC have requested, and the laboratory tests will not be requisitioned unless I sign this authorization. I have the right to refuse to agree to this authorization. When my information is used or disclosed pursuant to this authorization, it may be subject to re-disclosure by the recipient and may no longer be protected by the federal HIPAA Privacy Rule. I have the right to revoke this authorization in writing at any time, except that the revocation will not apply to any information already disclosed by the parties referenced in this authorization have acted in reliance upon this authorization. My written revocation must be submitted to the NCL privacy officer. Patient Authorization for Use and Disclosure of Protected Health Information</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 24pt 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 24pt 0pt;\">&nbsp;</p>\r\n<hr />\r\n<p>&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 24pt 0pt;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; text-align: center; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">PWNHealth</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; text-align: center; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Notice of Privacy Practices Regarding Health Information</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 24pt 0pt;\"><strong id=\"docs-internal-guid-2fc057ea-7fff-4600-f3b9-7beba7669f76\" style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">This notice describes how medical information about you may be used and disclosed, and how you can get access to this information. Please review it carefully.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 24pt 0pt;\"><strong style=\"font-weight: normal;\">&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: underline; -webkit-text-decoration-skip: none; text-decoration-skip-ink: none; vertical-align: baseline-wrap;\">How We May Use and Disclose Your Health Information</span><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">. </span><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">PWN Remote Care Services, P.A., PWN Remote Care Services, P.C., PW Medical Professional and certain other affiliated professional entities and PWNHealth, LLC (the administrative services provider of the professional entities (collectively, &ldquo;PWNHealth&rdquo;, &ldquo;we&rdquo; or &ldquo;us&rdquo;)</span><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\"> may use your health information and disclose it to appropriate persons, authorities and agencies, as allowed by federal and state law. Please be aware that state and federal law may have more requirements on how we use and disclose your health information. If there are specific, more restrictive requirements, even for some of the purposes listed above, we may not disclose your health information without your written permission as required by such laws. We may also be required by law to obtain your written permission to use and disclose your information related to treatment for a mental illness, developmental disability, or alcohol or drug abuse. We may do this without your written permission for the following limited purposes:</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 24pt 0pt;\"><strong style=\"font-weight: normal;\"><br /><br /></strong></p>\r\n<ol style=\"margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\">\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; margin-left: 18pt;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Treatment.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; margin-left: 18pt;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Payment.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; margin-left: 18pt;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Required by Law.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; margin-left: 18pt;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Public Health.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; margin-left: 18pt;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Reporting Victims of Abuse or Neglect.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; margin-left: 18pt;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Health Care Oversight.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; margin-left: 18pt;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Legal Proceedings &amp; Law Enforcement.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; margin-left: 18pt;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Death.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; margin-left: 18pt;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Serious Threats to Health or Safety.</span></p>\r\n</li>\r\n</ol>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 24pt 0pt;\"><strong style=\"font-weight: normal;\"><br /><br /></strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.295; margin-top: 0pt; margin-bottom: 8pt;\"><span style=\"font-size: 11pt; font-family: Calibri,sans-serif; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">We may also disclose any information that you provide to use or that is provided on your behalf.&nbsp; You have the right to request a restriction or limitation on the disclosure of such information as set forth below.&nbsp;</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; background-color: #ffffff; margin-top: 0pt; margin-bottom: 0pt; padding: 0pt 0pt 24pt 0pt;\"><strong style=\"font-weight: normal;\"><br /><br /></strong></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Your Health Information Rights. </span><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">You have the right to:</span></p>\r\n<ol style=\"margin-top: 0; margin-bottom: 0; padding-inline-start: 48px;\">\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; margin-left: 18pt;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\" role=\"presentation\"><span style=\"font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline-wrap;\">Read and copy your health information.</span></p>\r\n</li>\r\n<li dir=\"ltr\" style=\"list-style-type: decimal; font-size: 11pt; font-family: \'Times New Roman\'; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; margin-left: 18pt;\" aria-level=\"1\">\r\n<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 0pt;\" 