uest Diagnostics and or SpectraCell Laboratories or DDC. Newcenturylabs.com will only release health information to comply with legal requirements as set forth by the Health Insurance Portability and Accountability Act (HIPAA) and other applicable state and federal laws. State laws require laboratories and physicians to report certain infectious disease-related test results to their local health departments.</li>\r\n<li>Your personal information will not be sold to third parties we will only collect your information to order labs and for statistical purposes only.</li>\r\n<li>Orders from NY,NJ,RI,MD,HI will be refunded. Orders from the listed states are not eligible, per state law, to order Direct-to-consumer.</li>\r\n</ol>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>',NULL,'/terms',NULL,NULL,'ACTIVE',NULL,'2021-01-26 08:46:49','terms'),(7,1,'Site Credits','site credits','<p>This website was designed and developed by <a href=\"https://www.theportlandcompany.com/\"><strong>The Portland Company, a digital marketing agency.</strong></a></p>\r\n<p>It is also managed and hosted by <strong>The Portland Company</strong>.</p>\r\n<p>The Portland Company offers:</p>\r\n<ul>\r\n<li><a href=\"https://www.theportlandcompany.com/product-category/search-engine-optimization/\">Search Engine Optimization (SEO)</a></li>\r\n<li><a href=\"https://www.theportlandcompany.com/product-category/paid-advertising/\">Advertising Management (Google Ads, Facebook Ads and more...)</a></li>\r\n<li><a href=\"https://www.theportlandcompany.com/product-category/website-development/\">Website Design &amp; Website Development</a></li>\r\n<li><a href=\"https://www.theportlandcompany.com/product-category/photography/\">Product &amp; Profesional Photography</a></li>\r\n<li><a href=\"https://www.theportlandcompany.com/product-category/video-production/\">Video Production</a></li>\r\n<li><a href=\"https://www.theportlandcompany.com/services/\"> 