INSERT INTO `posts` VALUES (3,2,6,'Portland, Oregon a TOXIC AIR MESS','Portland is ranked as one of the top most toxic and polluted cities in America, yet also  ranked as the top eco friendly city in America.','Portland is ranked as one of the top most toxic and polluted cities in America, yet also  ranked as the top eco friendly city in America.','<h2><a href=\"http://koin.com/2016/02/24/heavy-metals-in-your-body-theres-a-test-for-that/\">Click This Link To See Video Clip</a></h2>\r\n<h2>It&rsquo;s their dirty little secret!</h2>\r\n<p>Portland is ranked as one of the top most toxic and polluted cities in America, yet also &nbsp;ranked as the top eco friendly city in America. We can&rsquo;t seem to wrap our fingers around that one. Seems so oxymoronic wouldn&rsquo;t you say? Don&rsquo;t let the pretty green trees and over 92,000 acres of green space for hiking, the overly abundant bicycle riders in every direction, and endless city transit fool you. Portland is also ranked to be one of the most toxic and polluted cities in America with over 2,300 permits filed by industrial facilities such as huge mills and major manufacturing to release heavy metal toxicity into the air for people to breath, and it&rsquo;s all LEGAL. We&rsquo;re talking about hundreds of tons of toxic compounds into the air. Did I mention, Oregon&rsquo;s water ways are also one of the worst in the nation too. This is due to 645 tons of toxic chemicals dumped into waterways each year. To put this into perspective that amount of waste is equivalent to 430 Toyota Prius, please excuse the humor Portland.</p>\r\n<p>In our air we breathe these toxins which contain Arsenic, Cadmium, Cobalt, and Nickel, among other toxic heavy metals, and there&rsquo;s a lot. The toxic air is of course entered in our lungs and into our blood stream slowly destroying our DNA and future off springs DNA as well. This toxic air is significantly linked to major neurological disorders and cancers, yet the law allows it. &nbsp;And it just so happens to be that the nation&rsquo;s top industrial air polluters are right here in the Portland Metro area, hmm&hellip; go figure. If you&rsquo;re from the Portland metro area, you&rsquo;ve probably heard of Portland&rsquo;s&nbsp;<strong>Precision Cast Parts</strong>, makers of aircraft and engine parts, and&nbsp;<strong>Bulls Eye Glass&nbsp;</strong>manufactures located in SE Portland, to title a few, releasing Cadmium, Arsenic, Cobalt, and roughly 30 other toxic substances but has recently added some better filters according to the Oregonian, yet New Century Labs is still getting back very high levels of Arsenic test results from individuals purchasing our&nbsp; comprehensive&nbsp; heavy metals tests on our website, by collecting random urine tests. This has us very concerned.</p>\r\n<p>Pointing the finger at just one or two companies &nbsp;is a great start to take action and to start demanding cleaner air for Portland and surrounding areas. Although the media has the SE glass company on its Bulls Eye (No Pun) &nbsp;the exposure to people&nbsp;living around OTHER manufacturing companies, factories, and mills, are just as exposed to the same toxicities &nbsp;for those who live around them, and the Portland Metro area has a lot of industrial &nbsp;manufacturing.</p>\r\n<p>Testing positive for heavy metals is a major issue, but the question is where should one go who&rsquo;s tested positive for heavy metal exposure, and where do you go for treatment? How about what is the treatment?</p>\r\n<p>We asked our customers who ordered these tests, who then took their results back to their Medical Doctors, some of which showed their doctors in Kaiser hospital, they said they didn&rsquo;t know exactly what the protocol was for treatment, &nbsp;how to interpret the tests, &nbsp;and said they may want to go see a Naturopathic doctor. We spoke to several Naturopathic doctors and they had loads of information on what to do when there&rsquo;s positive exposure to heavy metals. Apparently heavy metals is a core subject taught in the school of Naturopathic medicine, most MD&rsquo;s who are involved in heavy metal treatment are specialists.</p>\r\n<p>How about the individual who hasn&rsquo;t tested for heavy metals who should they talk to and where do they go? Although &nbsp;NCL will never&nbsp;&nbsp;give medical advice you should always discuss healthcare issues &nbsp;with your doctor first. &nbsp;However access to lab tests at&nbsp;New Century Labs and getting heavy metal testing has been made easy to access, online, on demand, on your terms.</p>\r\n<p>We decided to do some digging and &nbsp;called the Oregon Health Authority at 1-800-273-0557 they told us to call the EPA. The EPA, what&hellip; why?? We asked them specific questions about how one can get a test and what the cost would be, even asked who the diagnostic companies were offering testing. Of course they had no answer, and no protocol in place, yet they get several calls per day regarding this question.</p>\r\n<p>Although I was disappointed with their answers we found more resources&ndash;I&rsquo;m on to something! Multnomah County Health Department, they should know! We asked them the same questions were asked, although we got better answers, access to obtaining Heavy metal tests sounded daunting, yet they also didn&rsquo;t know who the diagnostic testing providers were, and couldn&rsquo;t answer how much it would cost, the tests weren&rsquo;t free even if you worked in Bulls Eye Glass and were exposed every day!</p>\r\n<p>Its seems that the main focus with city, county, and government officials has not &nbsp;been so focused on&nbsp;&nbsp;peoples questions and concerns about getting tests, especially people who cannot afford them, and what to do when you test positive for heavy metals.&nbsp;When we called the Oregon Health Authority we were put on hold for 30 min, and 20 minutes with the county health clinic, and that&rsquo;s just on the phone. Now you have to drive there, sit in the waiting room, pay your co-pay and then see the doctor for 5 min who may or may not give you a lab order for a metals test.</p>\r\n<p>As much as government officials have tried to provide resources, we believe the resources are simply not enough and very frustrating for many.</p>\r\n<p>New Century Labs is a private company located in the heart of Lake Oswego, our business is digital, automated, and extremely efficient. Folks concerned about heavy metal tests can order labs from our website, or by simply calling us at 1-800-519-2997 to place an order. If you cannot afford a test we will work with you to make sure you get your tests done ASAP.</p>\r\n<p>NCL is far more efficient, we can create a lab order and email it to you fast, sometimes within minutes, and you can visit one of our affiliated patient service centers to get your labs done without making an appointment. Your results are emailed back to you in 5 business days or less. You can then take your lab test results and start having a meaningful conversation with your doctor.</p>\r\n<p>Our goal at NCL is to break apart from the traditional system of obtaining lab tests. This means giving people access to labs on demand when they want it, lowering the price up to 90% off and showing transparency with no surprise bill, all while performing these tests at the highest diagnostics quality, we choose to work with Quest Diagnostics. You have resources now, we&rsquo;re looking forward to serving you at NCL as your preferred source&nbsp;for lab testing.</p>\r\n<p>&nbsp;</p>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\XhoshZJEkahM5r2EsMH5.jpg','portland-oregon-a-toxic-air-mess','New Century provides low cost medical lab tests online across the United States.','order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,','PUBLISHED',0,'2016-12-09 01:16:02','2021-01-20 06:30:46'),(4,2,6,'Heavy Metals Making Air Toxic to Health in Portland, Oregon','When the state of Oregon advises residents not to eat the food from their backyard gardens, people tend to take notice.','When the state of Oregon advises residents not to eat the food from their backyard gardens, people tend to take notice.','<p>When the state of Oregon advises residents not to eat the food from their backyard gardens, people tend to take notice. And for good reason. Results of tests for Arsenic, Cadmium and Nickel in the air near glass manufacturing plants in Southeast Portland were so high that the businesses voluntarily stopped using some of the chemicals to make glass that are toxic, and have pledged to continue to work with the Oregon Department of Environmental Equality. Arsenic levels in the air were at 159 times the state&rsquo;s air safety benchmark. The city has hosted several community meetings for the public, but at the end of the day residents are left to wonder, &ldquo;Has my family been exposed?&rdquo;&nbsp;Not to mention &ldquo;where do I go to get tested?&rdquo;</p>\r\n<p>Human exposure to arsenic by inhalation has been shown to be strongly associated with lung cancer. Chronic exposure even at small amounts has been attributed to Diabetes. And no wonder the state is telling us not to eat the vegetables from our gardens because of possible soil toxicity: ingestion of inorganic Arsenic by humans has been linked to a form a skin cancer and also to bladder, liver and lung cancer. The EPA has classified inorganic arsenic as a human carcinogen. Nickel is also toxic, resulting in slight skin irritations to more serious issues such as gastrointestinal distress as well as neurological effects.&nbsp; Chronic exposure to nickel can cause issues such as respiratory failure, heart disorders, asthma and chronic bronchitis, plus an increased risk of cancer of the lung, larynx, nose and prostate.</p>\r\n<p>Exposure to heavy metals can have very serious consequences, especially when children are exposed. For example, young children are more susceptible to the effects of lead exposure because they absorb several times the percent ingested compared with adults and because their brains are more plastic and even brief exposures may influence developmental processes. You and your children could be exposed without even knowing it. The only way to detect this is through a urine test, called a Comprehensive Heavy Metals Panel, which shows past exposure over the course of a day or two. Although more expensive, a hair strand test will show exposure over 6 to 12 months. Oregon health officials, in a show of how serious this is, have offered to pay for testing residents&rsquo; urine for heavy metals if they cannot afford it themselves. Through a doctor&rsquo;s office, insurance will sometimes pay for testing. However, if there are no symptoms, they may deny the claim and pay nothing. Thankfully there is another, less expensive option, through New Century Labs.</p>\r\n<p>Our Comprehensive&nbsp;<a href=\"https://newcenturylabs.com/product/heavy-metals-comprehensive-panel-u\">Heavy Metals Panel&nbsp;</a>covers 7 metals, including&nbsp;<strong>Cadmium, Arsenic, Lead, Mercury, Thallium, Creatinine, and Cobalt</strong>&nbsp;among others listed individually, for just $299 with an additional discount for the month of March by entering coupon code TOX2016. Find out if you or your loved ones have been exposed and check out our full line of<a href=\"https://newcenturylabs.com/shop?sa_product_cat=128\">&nbsp;heavy metal tests.</a></p>\r\n<p>The moral of our store is what you can&rsquo;t see CAN hurt you!</p>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\I8wMnBgnWJtvhlQhILCL.jpg','heavy-metals-making-air-toxic-to-health-in-portland-Oregon','New Century provides low cost medical lab tests online across the United States.','order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,','PUBLISHED',0,'2016-12-09 02:34:10','2021-01-20 06:30:19'),(5,2,6,'The key to health is hormone balance','Did you know your personality, your mood, your outlook in life, what we aspire to be, everything that sets that spark to motivation, our ability to combat unwanted','Did you know your personality, your mood, your outlook in life, what we aspire to be, everything that sets that spark to motivation, our ability to combat unwanted','<p>Did you know your personality, your mood, your outlook in life, what we aspire to be, everything that sets that spark to motivation, our ability to combat unwanted diseases all&nbsp;stem from&nbsp;hormones&ndash; hormones,&nbsp;ideally, regulate who we can optimally be.&nbsp; If your hormones are off balance it can dramatically have an effect on your work performance, relationship, mental health and it can set the stage for&nbsp;disease.</p>\r\n<p>The commonly known glands that regulate our hormone system are the thyroid glands, the ovaries in women, the testicles in men, the adrenal glands in the belly, in addition to the pituitary in the head. Hormones act as messengers that move through the blood into tissues, where they act to regulate every process in the body, including emotions. Put simply, they regulate your general health and overall well-being.</p>\r\n<p>Hormones have individual effects on the body. They also interact with each other to produce dramatic effects in the body. Due to these interactions, they can trigger drastic reactions in multiple body systems.</p>\r\n<p>Hormones should work in harmony with each other as they affect every day health and well-being. Body systems are stable when hormone balance exists. When balance is lost, hormone deficiencies and excesses cause serious disorders and increased risk of diseases.</p>\r\n<p><strong>Female Hormones</strong></p>\r\n<p>Besides their role in reproduction,&nbsp;<strong><a href=\"https://newcenturylabs.com/product/estrogen-total-serum/\">estrogens&nbsp;</a></strong>are important in maintaining healthy reproductive tissues, breasts, skin, and the brain. Progesterone is often described as &ldquo;the hormone balancer&rdquo;, particularly of the estrogens in your body. Progesterone enhances the known benefits of estrogen, while preventing problems related to having too much estrogen.</p>\r\n<p><strong>Male Hormones</strong></p>\r\n<p>Testosterone is the major male hormone produced in the testicles. Excess production of estrones (an estrogen) relative to testosterone is known to contribute to the development of prostate problems. Most scientists now agree that estrogen dominance is the cause of both prostate and breast cancers.</p>\r\n<p><strong>The Adrenal Glands</strong></p>\r\n<p>The adrenal glands produce three types of steroid hormones: glucocorticoids (cortisol), mineralocorticoids (aldosterone), and androgens.</p>\r\n<p><strong>Glucocorticoids</strong>&nbsp;enable the body to respond and adapt to daily life stresses like emotional distress, exercise, trauma, illness and starvation. Cortisol, for example, plays a vital immune function role, to defend the body against bacterial or viral infections. However, continuous excessive levels of cortisol suppress the immune system leading to frequent infections.</p>\r\n<p>Aldosterone maintains the body&rsquo;s salt and water levels.</p>\r\n<p>Androgens, such as&nbsp;<a href=\"https://newcenturylabs.com/product/dhea-dehydroepiandrosterone-unconjugated/\"><strong>DHEA</strong></a>, testosterone and androstenedione, play an important role in the regeneration of body tissue, especially in the skin, bones and muscles. DHEA levels decline gradually as a person ages.</p>\r\n<p>For women, the adrenal glands are the major source of testosterone. Testosterone plays a role in the maintenance of lean body mass, bone density, skin elasticity, sex drive and cardiovascular health for both men and women.</p>\r\n<p>Adrenal imbalance can contribute to nervous and immune system dysfunction, weight problems, blood sugar irregularities, and high androgen levels.</p>\r\n<p><strong>Female Hormone Imbalance</strong></p>\r\n<p>Follicle-stimulating hormone (FSH) is a gonadotropin hormone secreted by the pituitary glands in the brain. FSH regulates the development, growth, and maturation of the female body. FSH and luteinizing hormone (LH), also secreted by the pituitary glands, work together in regulating the reproductive process.</p>\r\n<p>The ovaries produce many hormones. The most influential hormones are the estrogens (many hormones in this range) and progesterone, which interact to coordinate a woman&rsquo;s menstrual cycle during her reproductive years, along with testosterone. FSH and LH trigger hormone production in the ovaries.</p>\r\n<p>When any of the above hormones are imbalanced, symptoms may occur. Imbalances are most common during puberty and menopause, but can occur at any age. Imbalances can have far-ranging effects on the body, producing a variety of physical, emotional and cognitive changes. These changes cause symptoms like:</p>\r\n<ul>\r\n<li>Irregular and or painful periods.</li>\r\n<li>Periods that are longer, shorter, heavier or lighter than normal.</li>\r\n<li>Hot flashes and night sweats.</li>\r\n<li>Insomnia and other sleep disturbances.</li>\r\n<li>Diminished sex drive.</li>\r\n<li>Decreased fertility.</li>\r\n<li>Vaginal dryness.</li>\r\n<li>Irritability and mood swings.</li>\r\n<li>Depression and/or anxiety.</li>\r\n<li>Difficulty with concentration and/or memory, a symptom often described as &ldquo;brain fog.&rdquo;</li>\r\n<li>Fatigue.</li>\r\n<li>Unexplained weight gain, especially in the abdominal area, hips and thighs.</li>\r\n<li>Skin changes, such as acne, thinning, dryness, oiliness and wrinkling.</li>\r\n<li>Dry, brittle hair or loss of hair.</li>\r\n<li>Loss of bone mass and muscle mass.</li>\r\n<li>Bloating.</li>\r\n<li>Excess facial and body hair.</li>\r\n<li>Tender or fibrocystic breasts.</li>\r\n<li>Urinary incontinence.</li>\r\n</ul>\r\n<p>If left untreated, female hormone imbalances can increase a woman&rsquo;s risk of developing diseases like heart disease and osteoporosis.</p>\r\n<p><strong>Male Hormone Imbalance</strong></p>\r\n<p><strong>Low testosterone and high estrogen</strong>&nbsp;is more and more found in men who go through hormone tests. Common symptoms are:</p>\r\n<ul>\r\n<li>Excess weight, especially around the breasts, hips and abdomen.</li>\r\n<li>Low libido, infertility and erectile dysfunction.</li>\r\n</ul>\r\n<p>If left untreated, this imbalance increases the risk of stroke and heart attack because of an increased risk of clotting. It also increases the risk of prostate cancer.</p>\r\n<p><strong>Low Testosterone</strong>&nbsp;causes:</p>\r\n<ul>\r\n<li>Muscle weakness and poor recovery from exercise.</li>\r\n<li>Fatigue and lack of energy.</li>\r\n<li>Mood changes and depression.</li>\r\n<li>Weak bones and osteoporosis as one ages.</li>\r\n</ul>\r\n<p><strong>Your Health Problems May be Caused by Hormone Imbalance</strong></p>\r\n<p>As you can now understand, hormones play a critical role in how we act, feel, and think. You also understand that many of today&rsquo;s health problems can be attributed to&nbsp;<em>hormone imbalance</em>. Whether you&rsquo;re trying to lose weight, avoid illness, or enhance cognitive focus, imbalanced hormones may be the first area you check. Your aim is to recreate hormone balances.</p>\r\n<p><strong>How a Hormone Test Can Help You</strong></p>\r\n<p>Many people have benefited from thyroid tests which have indicated an imbalance which has caused difficulty in weight loss. A simple blood test will help you too to discover if you have an imbalance somewhere. This will help your doctor to diagnose the cause of many of the health problems you may be having. As a result, you&rsquo;ll have a strong basis for correcting the imbalance through the use of diet, exercise or hormone supplementing.</p>\r\n<p>Take control of your health today. A simple blood test is the important initial step in determining if you are out of balance. You can take full advantage of the hormone tests that New Century Labs offer. New Century Labs offer direct-to-consumer tests, giving you full control of your health.</p>\r\n<p>Should the results indicate imbalance, you can take your test results to a doctor who can then prescribe a course of treatment. After you have begun your treatment program, a subsequent test can help you determine how effective your treatment is.</p>\r\n<p>You do not need to see your doctor first in order to have a test. If you have any of the symptoms listed above, you can order a test on our website. No need to wait in the queue and pay doctor&rsquo;s fees. You also avoid rejection of your claims by your insurance.</p>\r\n<p><strong>Our Tests are Affordable!</strong></p>\r\n<p>Our tests cost far less than you would pay if you went via your doctor&rsquo;s office. Our prices are highly discounted between 50% and 85%! The cost is so low&nbsp;and fully transparent&ndash;no surprise billing and now health insurance required.</p>\r\n<p><strong>Order a Test Today!</strong></p>\r\n<p>You can order your Hormone panels at the link below and get your results in 72 hours! No doctors order, no Co-pay and no germy clinics.</p>\r\n<h2><strong><a href=\"https://newcenturylabs.com/product-category/comprehensive-health-panels/\">Comprehensive Hormone Panels</a></strong></h2>\r\n<p><strong>Easy to Order too!</strong></p>\r\n<p>Click on the link below to see&nbsp;what Kim had to say about her experience:</p>\r\n<h2><strong><a href=\"https://www.youtube.com/watch?v=TlNw-ybTo-w\">Kims Experience</a></strong></h2>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\wxnqLt8X9V9lg4dkYfm5.jpg','the-key-to-health-is-hormone-balance','New Century provides low cost medical lab tests online across the United States.','order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,','PUBLISHED',0,'2016-12-09 03:41:37','2021-01-20 06:29:27'),(6,2,6,'Creating a more meaningful relationship with your provider','Your physician should provide you with necessary resources to enhance your health.','Your physician should provide you with necessary resources to enhance your health.','<h2>Your physician should provide you with necessary resources to enhance your health.</h2>\r\n<p>Let&rsquo;s face its 2016, you don&rsquo;t need to drive to a local video store to rent a movie, you can sit on your couch and order one. You can pull out your cell phone and order an UBER within minutes anywhere you want. If you want to buy retail products, you can do so online from Amazon and have it delivered to you the very next day&mdash;this type of demand service is what we are now accustomed to. We can go on and on with companies who have identified problems in the market place who has found better quicker solutions for the consumer. But what about healthcare, and how has healthcare adapted to our current expectations, and how is healthcare system as a whole been identifying ways to help patient&rsquo;s rid disease? Identifying patient&rsquo;s frustrations and finding solutions has been improving, yet not at the same pace to modern times.</p>\r\n<p>There were over 52,000 applicants who applied for med school in 2015, up over 6% from the prior year, According to the Association of American Medical Colleges. The average time to be a practicing MD independently, after residency, is typically another 4 years. If you&rsquo;re one of those who got accepted in Med school in 2016, chances are by the year 2024 Healthcare technology will be more innovative and technologically advanced. The question is how do we measure success rates for innovative technology in the world of healthcare, is it less heart attacks, less cancer, less diabetes, less obesity, or better disease management? We believe the focus will continue to be better disease management and life saving devices to aid a heart attack and stroke victims, respiratory difficulties, and other lifesaving technologies for acute trauma.</p>\r\n<p>The reality is people are living longer, but living with a chronic disease. Rather than dying from your disease, you can just live with it. pharmaceutical technology has scientifically created the ability to keep you living as long as possible, but with other potential side effects&mdash;you could need other pharmaceutical drugs to manage your symptoms from side effects.</p>\r\n<p>Example let&rsquo;s talk about the number #1 type of drug in the market known to lower cholesterol and prescribed by your doctor. According to the&nbsp;<a href=\"http://www.cdc.gov/cholesterol/treating_cholesterol.htm\">CDC&nbsp;</a>if you previously had a heart attack or stroke, a Statin drug is given to you if your LDL cholesterol (Bad Cholesterol) level is 190 mg/dL or higher. You are 40&ndash;75 years old with diabetes and LDL cholesterol of 70 mg/dL or higher. You are 40&ndash;75 years old with a high risk for developing heart disease or stroke and LDL cholesterol of 70 mg/dL or higher. These cholesterol lowering drugs are known as statins do come with potentially harming side effects side effects to your health.</p>\r\n<p>Although we see many of these technological advancements as necessary tools to aid physicians not only to practice medicine but to manage chronic disease, at the end of the day YOU are the ultimate decision maker as to how you want to live your life. Are your comfortable popping drugs every day, or do you want to take charge of your life be 100% committed to your healthcare and avoid the possibility of being a pill popper. You have the choice to either empower yourself and become more involved with your healthcare by making healthy choices, or you can put yourself at risk of falling prey to potential disease. Think of disease as a robber, a home invader. If you leave the door unlocked, you are opening up the possibility of a criminal entering your home. Likewise, with disease, if you do the very best by maintaining a healthy proactive life style it makes disease very difficult to invade your body. We believe that most diseases start by lacking self-awareness, and education. Sometimes education isn&rsquo;t that easy to access, so we&rsquo;re here to provide you some knowledge as to how one may start.</p>\r\n<p>We think that providing patients with as many resources as possible can be the best advancement in healthcare and it starts with &ldquo;you&rdquo; and your physician. Both of you need to have a vested interested in your health. The average time a patient spends with their doctor is less than 15 minutes and patients are rushed out the door. What makes matters worse, patients are not offered the correct medical laboratory tests because health insurance companies are reluctant to cover claims. Even though 70-80% of all clinical decisions stem from lab testing, and disease strikes before a symptom appears. One of the only times your health insurance company will cover your lab tests are when you&rsquo;re symptomatic, or during your annual physical with a limited number of labs.</p>\r\n<p>We believe that the core fundamentals of our healthcare system is dependent on lab testing. Physicians absolutely cannot make a guaranteed diagnosis without the aid of a lab test result, in addition to keeping up to date with new and proven scientific research. Take your normal lipid panel that calculates your total cholesterol, LDL, HDL and Triglycerides. This basic test was invented over 40 years ago and is the gold standard for detecting cardiovascular disease. Even though statistic show that 50% of patients who end up in the ER for heart attacks had normal cholesterol results, yet there are more advanced cholesterol tests like&nbsp;<a href=\"https://newcenturylabs.com/product/cardio-iq-advanced-lipid-panel\">Cardio IQ Advanced Lipid Profile Test&nbsp;</a>that measures your Cholesterol particle size, however this test is not ordered by physicians and insurance doesn&rsquo;t normally cover it. Even though this test has much more clinical utility than the standard lipid test and helps aid the practitioner in the right direction, it&rsquo;s not ordered as often as it should.</p>\r\n<p>How about physicians not ordering thyroid panels for their patients where medical scientific research has proven that abnormal thyroid results could be the reason of very high cholesterol. The reality is when your doctor orders you the wrong tests, or tests they think you don&rsquo;t need, they may be putting you at risk. Perhaps you really didn&rsquo;t need that statin drug after all, maybe it was just your thyroid that need to be worked on.</p>\r\n<p>Institutionally physicians do not have a very good platform to match lab tests to symptoms, and lab testing isn&rsquo;t taught heavily in Med School, also insurance companies have so much weight on access and cost, and big Pharma has major influence as well too. How do you get out of this muck. The answer is simple, READ! Use the internet to your advantage, 70% of google searches have to do with healthcare related topics, ask your doctor why the ordered those tests and have them explain in detail how they are determining diagnosis and prognosis&mdash;at the end of the day it&rsquo;s your body, not theirs!</p>\r\n<p>The power is in your hands, leverage all the creditable resources out there to your advantage, if insurance and your doctor are denying you lab tests you think you need, seek all other alternatives, never take &ldquo;NO&rdquo; for a final answer, it can mean the difference between life or death.</p>\r\n<h2>NCL has a solution for you and your Doctor</h2>\r\n<p>Although the intention for the last hundred years has been to rid disease completely, this is just not the reality. As doctors have the advanced tools&nbsp;at their disposal, so do you. You can now order your own lab tests any day, any time, 24 hours a day, 7 days per week from your PC, or your cell phone, &nbsp;passing all the hurdles it takes to living a proactive lifestyle, and bypassing your insurance company denying you lab test claims. NCL has contracted with major diagnostic laboratories nationally allowing you access to over 8,000 lab tests from 50-90% off, on demand, on your terms! Your physician already knows this and needs to communicate this to you. Most people don&rsquo;t know you can order a lab test online. Communication with your doctor is key to better health, and ordering your own lab tests can be a tool for your doctor if insurance is out of the picture.</p>\r\n<p>New Century Labs has also contracted with physicians throughout the United States offering a unique platform for physicians to order blood work for their patients who either have no insurance, a high deductible,&nbsp;and when health&nbsp;insurance does not cover. We have found that at least a third of the patient need to pay cash for their lab tests and offering such services at extremely discounted prices has been seen as a useful tool for doctor and patient relationships. We have received calls from both physicians and patients who have expressed how much easier it is to be treated for health issues when access is available and pricing is low.</p>\r\n<p>When you want a lab test, you won&rsquo;t need to call your doctor&rsquo;s office and make an appointment, which could take weeks, wait in the waiting room with other sick patients, pay your co pay and doctors fee. You can have full control to order lab tests and become more proactive, taking charge of your health. This should be one of the answers to solving our healthcare crisis and identifying solutions to get patients more in control of their health. Allowing you the freedom and access to critical information about your body is critical so that communication with your doctor can become more meaningful. At the end of the day your doctor has the final say as to the right diagnosis, medication and prognosis by using lab test results as an aiding tool, so isn&rsquo;t it better to have the necessary tools at your disposal? NCL does several thousand lab tests per month from individuals who want answers about their body and we believe that proactive healthcare starts at the core fundamentals of diagnostic testing.</p>\r\n<p>Let us serve you with information that matters most to you!</p>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\5l71Qms2VtLvUyXaDHiB.jpg','creating-a-more-meaningful-relationship-with-your-provider','New Century provides low cost medical lab tests online across the United States.','order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,','PUBLISHED',0,'2016-12-09 03:55:19','2021-01-20 06:28:50'),(7,2,6,'Why You Should Stop Getting Standard Lipid Tests','Did you know that 50% of patients who wind up in the ER for heart attacks all had normal cholesterol results?','Did you know that 50% of patients who wind up in the ER for heart attacks all had normal cholesterol results?','<h2>Did you know that 50% of patients who wind up in the ER for heart attacks all had normal cholesterol results?</h2>\r\n<p>But I thought a normal cholesterol test meant I have a healthy heart, after all the results came back normal, right?</p>\r\n<p>Here&rsquo;s some hard facts, the standard lipid test was invented over 40 years ago, yet it&rsquo;s still used today as the gold standard to determine heart health, yet heart disease continues to be the leading cause of Death in America, causing 1 in every 3 deaths in the United States.<br />One in every American Dies of cardio vascular Disease every 40 seconds, 635,000 Americans will have a heart attack every year, 280,000 Americans per year will have a recurrent heart attack, thus resulting in a massive spending influx on heart related issues.</p>\r\n<p>When results that come back with higher than normal cholesterol levels the standard protocol is to give a patient one of six prescription drugs potentially used to lower cholesterol levels, such as Lipitor or Crestor, so why the increase in our overwhelming population of heart attacks?<br />However, many doctors are still scratching their heads and still prescribing patients to take the standard cholesterol test, which won&rsquo;t detect which drug is the best for therapy, unless however, a more advanced lipid profile test is utilized such as The Cardio IQ created by Quest Diagnostics or the advanced LLP Plus test by SpectraCell. Both of which can actually hone in on how, why, where, and what treatment plan is needed to help save your heart from disease.</p>\r\n<p>What Advanced lipid profile tests measure are The LDL particle number, Small, Medium, large, and the LDL pattern (A or B), in addition to your LDL peak size, Apoliprotein B and Lipoprotein (a). This information could potentially save your life and can help you get back to a better state of heart health by picking the right pharmaceutical therapy prescribed by your doctor.</p>\r\n<p>The reality is disease happens to everybody before symptoms first appear; just because you&rsquo;re not symptomatic doesn&rsquo;t mean your clear of health related issues. NCL wants you to take charge of your health early, not after the fact where solutions become scarce.&nbsp;<a href=\"http://newcenturylabs.com/product/cardio-iq-advanced-lipid-panel\">Advanced lipid profile tests&nbsp;</a>today have made it easier than ever to catch potential heart disease early helping you take immediate action with your doctor.</p>\r\n<p>We believe if more doctors offered advanced lipid profile tests to patients, and insurance companies paid for them more frequently, Americans facing heart related risks would have a higher probability of avoiding heart attacks.</p>\r\n<p><strong>So what&rsquo;s been the set back? Pricing, accessibility, INSURANCE COMPANIES.</strong></p>\r\n<ul>\r\n<li>Did you know even if you have insurance and met your deductibles your lab test may not be covered?</li>\r\n<li>This is why Americans are constantly let down when the thought of being proactive about healthcare comes to play&ndash; we get slammed with a big denial when we&rsquo;re not symptomatic. Sounds a bit odd.</li>\r\n<li>Wouldn&rsquo;t health insurance companies want you to request advanced testing to avoid a major healthcare payout?</li>\r\n</ul>\r\n<p>As puzzled as we are,&nbsp;<a href=\"http://www.newcenturylabs.com/\" target=\"_blank\" rel=\"noopener\">www.newcenturylabs.com</a>&nbsp;eliminates all the middlemen, making access to&nbsp;<a href=\"http://newcenturylabs.com/product/llp-plus\">life saving tests</a>more affordable and accessible, saving patents health, money and eliminating&nbsp;the feeling of uncertainty.</p>\r\n<p>When you&rsquo;re given the freedom to access vital information; when answers are no longer scares, healthy actions immediately follow. Become proactive and order lab tests on demand, on your terms!</p>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\UnytXEfnGObSfafxjyrN.jpg','why-you-should-stop-getting-standard-lipid-tests','New Century provides low cost medical lab tests online across the United States.','order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,','PUBLISHED',0,'2016-12-09 04:18:17','2021-01-20 06:28:31'),(8,2,6,'Metabolic Syndrome','Metabolic Syndrome is the title for a group of risk factors that raises your risk for Heart Disease, Diabetes, stroke and other diseases, known in America as the leading causes of Death.','Metabolic Syndrome is the name for a group of risk factors that raises your risk for Heart Disease, Diabetes, stroke and other diseases, known in America as the leading causes of Death.','<h1>The leading pathways to Death</h1>\r\n<h2>And simple examples to combat these killer illnesses.</h2>\r\n<p><a href=\"http://www.medicinenet.com/metabolic_syndrome/article.htm\">Metabolic Syndrome</a>&nbsp;is the title for a group of risk factors that raises your risk for<a href=\"http://www.heart.org/HEARTORG/Conditions/More/MyHeartandStrokeNews/Coronary-Artery-Disease---Coronary-Heart-Disease_UCM_436416_Article.jsp#.V4GeC4-cGhc\">&nbsp;Heart Disease</a>,&nbsp;<a href=\"http://www.diabetes.org/diabetes-basics/type-2/?loc=db-slabnav\">Diabetes</a>, stroke&nbsp;and other diseases, known in America as the leading causes of Death.</p>\r\n<p>The term &ldquo;Metabolic&rdquo; refers to all the processes in your body working together to create the energy that keeps you going. Now, let&rsquo;s link in your metabolism. Your metabolism is the rate at which your body&rsquo;s many processes function, and it can be low, high, or somewhere in the middle. When you&rsquo;re younger and more active, your metabolism can be high, making it easy to lose weight, but as you get older your metabolism slows down and you might put on a few extra pounds. Exercising will speed up your metabolism, and so does a good diet! Many factors come into play for high and low metabolism in people, so let&rsquo;s break this down even further. Compare a person who has a lot of fat under their skin vs someone who has a lot of muscle under their skin, those who have more muscle actually increase the number of calories they burn; &nbsp;on average it comes&nbsp;to&nbsp;6-10 calories per pound of muscle you gain, while one pound of fat burns about two calories per day at rest. Fat is not a great physical state to be in, and we&rsquo;re not just talking looks. Being overweight actually makes it harder to be healthier which means you will have to work 10x harder than someone with less body fat.</p>\r\n<p>Before we start selling you on exercise we want to circle back to &ldquo;<a href=\"http://www.medicinenet.com/metabolic_syndrome/article.htm\">metabolic syndrome</a>&rdquo; to demonstrate two life styles which&nbsp;act as a&nbsp;magnet to&nbsp;<a href=\"http://www.medicinenet.com/metabolic_syndrome/article.htm\">metabolic syndrome&nbsp;</a>and a deterrent to Metabolic syndrome, so let&rsquo;s talk about Bob and Jack:</p>\r\n<p>Jack is not a healthy diet extremist, but he maintains a healthy balanced diet, avoiding as much dairy out of his diet, eats his fruits and veggies with lean grass fed beef and chicken and gets his vitamins and minerals from supplements. He has a 9-5 job, but takes walks during his lunch break. Takes the stairs avoiding&nbsp;elevators&nbsp;to burn those calories, and doesn&rsquo;t let the daily stress of work, family life, and driving in traffic stress him out. He&rsquo;s proactive with his health care and checks in with his Doctor for routine and preventative checkups. Gym time is his time to unwind and release stress, he doesn&rsquo;t have a $200 a month gym membership its got everything he needs and Jack follows a stringent exercise routine from a great<a href=\"http://jcarlosfitlab.com/\">&nbsp;exercise program</a>&mdash; water and whey protein are by his side. Jack also focuses on exercising his brain by simply reading and learning new things, laughing with friends and is always up for a good hike in the mountains. Jack loves his life and life around him.</p>\r\n<p>Bob is also a go get&rsquo;em type of guy, he&rsquo;s known as a take charge guy at work and loves his job. He has a 9-5 job like Jack with a family and also has his daily routine. Bob claims he prefers to live for the &ldquo;now&rdquo; so he doesn&rsquo;t have to stress about the future. At lunch Bob can easily eat cheese burgers and pizza every day with no regrets. Bob admits he can be a workaholic and prefers to eat at his desk. No time for the gym he says and weekends are just a stay at home event watching sports. Bobs wife is concerned for his health but Bob claims he will see his doctor when he has time. Bob stands 5ft&nbsp;11&Prime;&nbsp;tall and weighs over 285 pounds. He says his energy and concentration is best utilized while he is sitting and feels out of breath when he goes on walks, let alone the stairs.</p>\r\n<p>The reality is you have a choice in life you can be like Bob, or like Jack. You can live for the moment, or prepare for the future. You can be proactive, or reactive and hope for the best. You can leverage the internet for knowledge about ways to make healthy life style changes or you can sit on the couch and watch sports for 8 hours a day.</p>\r\n<p>The common denominator with Bob is behavioral avoidance with the most common excuse &ldquo;I don&rsquo;t have time, I&rsquo;m too tired, &ldquo;eating unhealthy is too easy to access&rdquo;, sitting at a desk is easier than taking a walk. Unlike Bob, Jack makes it a habit to show up and persevere with daily activities; in a nut shell this motivates Jack to continue to make healthier life style changes.</p>\r\n<p>Jacks metabolism is working at a much higher rate making weight gain difficult to enter. He pumps his heart at the gym and moves blood flow through his arteries. His diet is low on sugar and high on fiber, forgiving his pancreas from over working and reducing the risk of diabetes. His stress levels are low reducing a spike in cortisol levels, combating high blood pressure. His doctor orders lab tests and Jack likes to track his lab test results to prior lab tests, &nbsp;making sure his blood chemistry levels are optimal.</p>\r\n<p>The path that Bob has chosen&nbsp;will one-day surprise himself and his family with disease, as Bob likes to live for the now and not the future, even though Bobs Doctor advised him that disease strikes before symptoms appear.&nbsp; Bobs diet is causing mini cholesterol particles to hit his arterial wall, potentially leading to a heart attack and stroke. His choice to be inactive is also causing limited blood flow throughout the body, making it easier to kill off his ability to fight off&nbsp;health risks and welcome disease.</p>\r\n<p>Bob is now entering the deadly path of&nbsp;<a href=\"https://www.heart.org/HEARTORG/Conditions/More/MetabolicSyndrome/Prevention-and-Treatment-of-Metabolic-Syndrome_UCM_301927_Article.jsp\">Metabolic Syndrome</a>. NCL wants to be very clear with our readers that neglecting your health is no different than walking through a war zone and expecting nothing will happen to you. When you neglect your health, you welcome every opportunity for disease to strike, and its not just you who suffers. Your family and friends, your health insurance premiums, in addition or health insurance premiums across the board. The four leading causes of death in America&nbsp;are&nbsp;Heart disease, Diabetes, Stroke and Cancer. All of which can be eliminated by simply making an immediate behavioral change. Become more proactive minded and less reactive minded.</p>\r\n<p>It&rsquo;s never too late to make healthier choices, so work on getting that higher metabolism, change your mind set, check your blood chemistry levels often, get to know the real you from inside out and be positive with yourself and others and make it a habit!</p>\r\n<p>We always strive to be the best quality Lab Service for&nbsp;all your lab testing needs, so&nbsp;let us&nbsp;make this experience comforting and empowering.</p>\r\n<p>New Century Labs believes&nbsp;proactive healthcare is the best health care and it starts&nbsp;at the core fundamentals of diagnostic testing.</p>\r\n<p>Order your&nbsp;<a href=\"https://newcenturylabs.com/product/diabetes-risk-panel-with-score\">Diabetes Risk Panel which comes with an 8 year risk of developing diabetes for only $29.00</a></p>\r\n<p>Test Includes:</p>\r\n<ol>\r\n<li>Cardio IQ&reg; Glucose</li>\r\n<li>Cardio IQ&reg; Hemoglobin A1c</li>\r\n<li>Cardio IQ&reg; Cholesterol, Total</li>\r\n<li>Cardio IQ&reg; HDL Cholesterol</li>\r\n<li>Cardio IQ&reg; Triglycerides</li>\r\n<li>Cardio IQ&reg; Non-HDL</li>\r\n<li>Calculated Components</li>\r\n<li>Cardio IQ&reg;&nbsp;<strong>8 Year Diabetes Risk!</strong></li>\r\n</ol>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\AMssGhccgvbHaqluu688.jpg','metabolic-syndrome','New Century provides low cost medical lab tests online across the United States.','order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,','PUBLISHED',0,'2016-12-09 04:49:05','2021-01-20 06:28:00'),(9,2,6,'Your Thyroid can throw you off Balance','Thyroid gland is the most important gland in the body, after the pituitary gland. It helps in retaining the energy that each cell has.','Thyroid gland is the most important gland in the body, after the pituitary gland. It helps in retaining the energy that each cell has.','<p>Thyroid gland is the most important gland in the body, after the pituitary gland. It helps in retaining the energy that each cell has. A deficiency or dysfunction of the thyroid gland results in adverse effects for both men and women. There are two ways in which this happens- hypothyroidism and hyperthyroidism. The former is the most common ailment.</p>\r\n<p>Have you ever felt so tired that you couldn&rsquo;t make it through the day? Have you been noticing unnecessary and sudden weight gain? Are you experiencing hair fall? These are all some of the symptoms that indicate a thyroid problem.</p>\r\n<p><strong>Signs &amp; Symptoms:</strong></p>\r\n<p>Women are more prone to thyroid but men are equally at risk too. The thyroid awareness has increased tremendously lately that many women are rushing to their doctors to find out if they have the condition too.</p>\r\n<p>When some of them are lucky enough to have caught it early, there are others who get unlucky. Most of the individuals are always borderline hypothyroid. Taking this as a sign from the tests conducted, doctors prescribe pills and medicine that fight the condition. This in turn makes you a victim for the condition, when you did not have it in the first place.</p>\r\n<p>Here are some of the signs that men and women can watch out for:</p>\r\n<ul>\r\n<li>Sudden weight gain/loss.</li>\r\n<li>Unable to go through regular workout.</li>\r\n<li>Extreme fatigue.</li>\r\n<li>Mood swings.</li>\r\n<li>Poor memory retention.</li>\r\n<li>Constipation</li>\r\n<li>Depression</li>\r\n<li>Poor skin, nails and hair.</li>\r\n<li>Sore muscles.</li>\r\n<li>Trouble in concentrating.</li>\r\n<li>Irregular menstrual cycle.</li>\r\n</ul>\r\n<p><strong>Blood tests&nbsp;</strong>and&nbsp;<strong>hormone tests&nbsp;</strong>are mostly the best way to conclude if you suffer from hypothyroidism. Consult your doctor to know more. Once you consult your doctor, you can&nbsp;<strong>order your lab tests online</strong>.</p>\r\n<p><strong>Fighting Hypothyroidism:</strong></p>\r\n<p>Regular&nbsp;<strong>wellness check</strong>&nbsp;is something you can do to be more proactive about your health. You can run yourself through&nbsp;<strong>blood tests and hormone tests&nbsp;</strong>every once in a while to make sure you haven&rsquo;t missed any symptoms (just in case).&nbsp;<strong>Proactive healthcare&nbsp;</strong>is more beneficial compared to diagnosing at a much later stage. Fighting thyroid is not impossible. With time, you can ward off your conditions easily and continue to live a healthy life.</p>\r\n<p>When a&nbsp;<strong>hormone test&nbsp;</strong>is run to check for thyroid related problems, men and women are tested for more than one hormone. This gives doctors a complete understanding of your symptoms. Men with thyroid issues are prone to Erectile Dysfunction and other infertility problems. To know more about the tests and ordering one online,&nbsp;<a href=\"https://newcenturylabs.com/product/basic-male-health-check\">click here.</a></p>\r\n<p>Women with thyroid issues face problems with their menstrual cycle and other fertility disorders. To stay on the safe side,&nbsp;<a href=\"https://newcenturylabs.com/product/basic-female-hormone-panel\">click here to know more about tests.</a></p>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\hOBnBU9cgcV0fHgNXnoO.jpg','your-thyroid-can-throw-you-off-balance','New Century provides low cost medical lab tests online across the United States.','order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,','PUBLISHED',0,'2016-12-09 04:54:37','2021-01-20 06:27:56'),(10,2,6,'Dangers of Vitamin D Deficiency','As winter approaches, you want to have the right levels of Vitamin D in your blood! Here is why vitamin D is important for your health.','As winter approaches, you want to have the right levels of Vitamin D in your blood! Here is why vitamin D is important for your health.','<h2><strong>Reasons You Should Be Tested For Vitamin D</strong></h2>\r\n<p>As winter approaches, you want to have the right levels of Vitamin D in your blood! Here is why vitamin D is important for your health.</p>\r\n<p><strong>Prevention of flu:</strong>&nbsp;Vitamin D deficiency can plummet your&nbsp;immune system increasing your risk of getting&nbsp;infections and inflammation during the fall-winter flu season. As your strategy should be to prevent&nbsp; the winter flu, you want to increase your intake of Vitamin D supplements if your D blood levels show below normal range. It is important to get your blood tested for vitamin D levels so you know if you need supplements.</p>\r\n<p><strong>Prevention of depression:</strong>&nbsp;Low levels of Vitamin D are associated with depression and can attack your sex hormone causing low estrogen in women and low testosterone in men, which can cause mood changes and potential depression, hence why some men tend to have increased libido in the summer time than the winters.</p>\r\n<p><strong>Reduction of muscle aches and pain:</strong>&nbsp;Vitamin D normalizes blood calcium which softens and relaxes tight shortened muscles. It is particularly useful for menstrual cramps.</p>\r\n<p><strong>Reduction of the risk of cancer:</strong>&nbsp;Vitamin D normalizes cell to cell communication, reduces uncontrolled cell growth and allows cells to develop into normal cells with a normal life cycle. Deficiency of Vitamin D may increase risks of many cancers. Several studies have shown that low levels of Vit D have a increased risks of developing bladder cancer, researchers have also found that cells lining the bladder activate and respond to vit D. When this key nutrient is taken the immune system response stimulates, where the immune system can destroy abnormal cells they develop into cancer.</p>\r\n<p><strong>Prevention of Cardiovascular diseases:</strong>&nbsp;Vitamin D has been shown to protect the lining of your blood vessels hence reducing risks of high blood pressure, heart diseases and stroke.</p>\r\n<p><strong>Reducing&nbsp;Diabetes&nbsp; risk:</strong>&nbsp;Research has invariably found low levels of Vit D&nbsp;could increase the chance of &nbsp;diabetics causing insulin resistance.</p>\r\n<p><strong>Prevention of Autoimmune Diseases:&nbsp;</strong><strong>Vit D reduces risk of getting autoimmune diseases like Lupus, Multiple Sclerosis, Rheumatoid Arthritis, and Hashimoto&rsquo;s Thyroiditis.</strong>&nbsp;Research found that Vit D reduces the risk of Multiple Sclerosis at optimal levels.</p>\r\n<p><strong>Strengthen bones:&nbsp;</strong><strong>Vit D reduces your risk of bone fractures, bone loss and osteoporosis</strong><strong>.</strong>&nbsp;Deficiency is associated with rickets, which is common among dark skinned people.</p>\r\n<p><strong>The body can make Vitamin D!</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Obviously&nbsp;this key nutrient &nbsp;is very important for health. The human body can make Vit D when the skin is exposed to sunlight. But a lot of people suffer from deficiency of vit D because:</p>\r\n<ul>\r\n<li>They spend more time indoors during working hours.</li>\r\n<li>When they go outdoors they apply sunscreen which blocks Vit D production in the skin.</li>\r\n<li>Dark skinned people make less Vit D than those with light skin.</li>\r\n<li>Aging skin makes 75 percent less Vit D&nbsp;than young skin.</li>\r\n<li>In the northern hemisphere, there is little or no sun exposure in winter.</li>\r\n</ul>\r\n<p>Blood levels of Vitamin D3 associated with OPTIMAL HEALTH are in the range of 70-120nmol/L.</p>\r\n<p>To prepare for the upcoming winter season when there is little or no sun, get your blood tested for vit D levels, know where you stand and be proactive.</p>\r\n<p><strong>Be Proactive. Order Your Blood Test Online!</strong></p>\r\n<p>Here is the good news! You can order your blood test online! New Century Labs provide this convenient service so you can order your test easily! You do not need to go through a doctor. You can order the test yourself! No sitting in a queue. No doctor&rsquo;s fees or Copay. It&rsquo;s quick. It&rsquo;s convenient. It&rsquo;s affordable.</p>\r\n<p>You can order your&nbsp;vit &nbsp;D test for only $29 by clicking on the link&nbsp;below easily and quickly. Your lab order will be delivered to you by email in less than 4 hours. Simply print the order and take it to the nearest outlet. You will receive your results confidentially in just 3 business days.</p>\r\n<p>Why pay $99 for the same test when you can get it here for a fraction of the price.</p>\r\n<h3><strong><a href=\"https://newcenturylabs.com/product/vitamin-d-blood-test/\">New Century Labs Vitamin D Test</a></strong></h3>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\hFsqcQf9OIHc3GA9mEjH.jpg','dangers-of-vitamin-d-deficiency','New Century provides low cost medical lab tests online across the United States.','order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,','PUBLISHED',0,'2016-12-09 05:05:28','2021-01-20 06:27:26'),(11,2,6,'Healthy Liver Healthy Life','Our blog is inspired by the movie “Sugar Coated” created by Michele Hozer. As the key discussion of this movie was sugar, and all of its toxic harms,','Our blog is inspired by the movie “Sugar Coated” created by Michele Hozer. As the key discussion of this movie was sugar, and all of its toxic harms,','<h1><strong>Take care of your liver</strong></h1>\r\n<h2><a href=\"https://vimeo.com/122387548\">Click to watch trailer </a></h2>\r\n<p>Our blog is inspired by the movie&nbsp;<strong>&ldquo;</strong><a href=\"http://sugarcoateddoc.com/\"><strong>Sugar Coated&rdquo;&nbsp;</strong></a>created by Michele Hozer. As the key discussion of this movie was sugar, and all of its toxic harms, we wanted to focus on the body&rsquo;s processing plant, the &nbsp;Liver, and how Neglecting your liver will bankrupt your life,&nbsp; and overall well-being. Your liver can be harmed&nbsp;overtime, with almost no warning signs and no symptoms. Often times people wait until a symptom starts appearing before they take action&ndash; often times it&rsquo;s too late. When we think of liver disease, we immediately think of alcohol abuse, but that&rsquo;s not always 100% the case. Your liver can get diseased from simply putting the wrong types of food in your mouth. When you eat a bad diet, cheese burgers, pizza, soda pop, sit around all day and lacking exercise, your liver can become fat making it much harder for your liver to filter out all the bad stuff.</p>\r\n<p><a href=\"http://www.liverfoundation.org/education/liverlowdown/ll1013/bigpicture/\">1 in 10 Americans have some form of liver disease every year</a>. Every year 19,500 die from liver cancer, 49,500 Die from Cirrhosis, (Cirrhosis occurs in response to damage to your liver.) In the world liver cancer deaths per year amounts to 745,000 and over 1,000,000 from Cirrhosis. Fatty liver disease from alcoholic and non alcoholic fatty liver disease on an upward trend:</p>\r\n<p>Alcohol consumption is the leading cause of FLD (Fatty liver Disease) (25%-35% of the general population and Non-alcoholic &nbsp;Fatty Liver Disease currently affects 25% of Americans and expected to reach 50% by 2030.</p>\r\n<p>This is a disease that has to do with what we put into our mouths, we call this&nbsp;<a href=\"https://www.atkins.com/how-it-works/library/articles/the-sad-consequences-of-the-standard-american-diet\">SAD (Sad American Diet.)</a>&nbsp;The choice is clear, neglect your liver and your liver will neglect you!</p>\r\n<p>The best way to attack &ldquo;neglect&rdquo; is to become more in tune with how your organs function, their purpose, how they gets effected and how they can add more years to your life!&nbsp; YES your liver should be treated like your own child, love, care, and respect and NCL has some pointers &nbsp;that will make you think about your liver on a more conscientious state.</p>\r\n<h2>Lets jump into your liver and take a look!</h2>\r\n<p>Your&nbsp;<strong><a href=\"http://www.liverfoundation.org/\">liver&nbsp;</a></strong>is one of the heaviest organs in the body weighing in at slightly over 3 pounds, yes 3 pounds, and it&rsquo;s in charge of&nbsp; many different processes and functions in the body. Think about your liver like a factory.&nbsp; A factory has a warehouse, manufacturing capabilities, and can process material into a finished product, sending off finished goods to the end user for utilization&ndash;this process is exactly how your liver functions.</p>\r\n<p>Everything you eat filters through your liver, it metabolizes nutrients and stores them,&nbsp;even detoxifies your system of harmful &nbsp;toxins from the blood. This is of course when your liver is healthy&ndash;everything you eat has to filter through your liver.</p>\r\n<p>If you build fat in your liver it won&rsquo;t be able to filter out toxins and break down essential vitamins and key nutrients.&nbsp;When you have a fatty liver,&nbsp;it&nbsp;cannot get normal blood supply, which can cause all kinds of damage to your body.</p>\r\n<h3><strong>Your liver is really your bodyguard.</strong></h3>\r\n<p>When you eat food your liver strips out important vitamins and nutrients, feeding your cells with those needed nutrients and then &nbsp;storing them up until your body is in need again. For example, with carbohydrates your body breaks it down and converts it to sugar for your&nbsp;body&rsquo;s energy use. When you have excess of what your body no longer needs, your liver will store them and use them for later use&ndash; sounds like a good neighbor! Your liver is actually a genius, it can detect toxins and immediately and rid them kidneys and into your intestines.</p>\r\n<p>Through the manufacturing side, your liver has a production component, everything from producing blood plasma protein, which transports fatty acids and helps form blood clouts, to cholesterol production which help your body to create hormones, not to mention vitamins and substances that help in the aid of digestion.</p>\r\n<p>The most vital product that your liver manufactures is that oozing green looking substance, it&rsquo;s called Bile. Like an Eco-friendly treatment plant your liver uses cells called Hepatocytes to convert toxic waste products, A&nbsp;hepatocyte&nbsp;is a cell of the main&nbsp;parenchymal&nbsp;tissue of the&nbsp;liver. Hepatocytes make up 70-85% of the liver&rsquo;s mass.</p>\r\n<p>Bile is then funneled into a small container below the liver called the Gallbladder before being dumping into the intestine which then break down fats, destroys microbes, and helps stomach acids. Bile also helps carry other toxins and unnecessary by products from the liver out of the body, again, what an amazing neighbor!</p>\r\n<p>Your liver really is a factory in charge of multiple functions, helping keep your body strong and healthy. However, such a complex system needs tender loving care, self awareness, and a proactive mind set. The ability to look at soda pop and make a rational judgment call is key. You are no longer in a state of neglect, you are in charge of the situation, the situation is not in charge of you.</p>\r\n<p>When liver damage strikes, its often too late for treatment, or too difficult for treatment. The reality is disease happens before any symptoms appear and the best way to check your liver is simply being more&nbsp;proactive with your health care. Getting to know the real you from inside out. Getting critical information about your body before it&rsquo;s late.</p>\r\n<p>70-80% of all clinical decisions come from lab testing and NCL supports those who are proactive with their healthcare, who are looking for ways to improve health and wellness.</p>\r\n<p>The best time to check your liver health is when you don&rsquo;t have signs and symptoms, this can be done through 1 simple blood draw. NCL makes getting a test affordable, convenient, and fast.&nbsp;You no longer need to call to make an appointment at your doctor&rsquo;s office, no long waiting rooms, no co-pays, no need to deal with pesky insurance companies. Simply order online, from your PC or your cell phone. Pick your lab tests and check out with your credit card. Your lab order will be emailed to you&ndash; you are now ready to&nbsp;get your blood drawn&ndash; we&rsquo;ll show you where to get your blood drawn nearest you. &nbsp;Your results then get emailed to you privately and securely. If you need to take your results to your doctor to have a meaningful conversation about your results&nbsp;please do so we recommend it.</p>\r\n<p>Remember all it took was you becoming more self aware&ndash;just 1 blood draw can change your life. Knowledge is power and when you get critical information about your body, you begin to make positive changes.</p>\r\n<h2>Appreciate what the liver does for you!</h2>\r\n<p><strong>Ordering these tests can help you and your doctor understand your liver health, so we made ordering your liver function test super easy and super affordable:</strong></p>\r\n<p><strong><a href=\"https://newcenturylabs.com/product/hepatic-function-panel\">Hepatic Function panel $15.00</a>&nbsp; &nbsp;&nbsp;</strong></p>\r\n<h3><strong>This test includes:</strong></h3>\r\n<p><strong>-Total Protein</strong></p>\r\n<p><strong>-Albumin</strong></p>\r\n<p><strong>-Globulin (calculated)</strong></p>\r\n<p><strong>-Albumin/Globulin Ratio (calculated)</strong></p>\r\n<p><strong>-Total Bilirubin</strong></p>\r\n<p><strong>-Direct Bilirubin</strong></p>\r\n<p><strong>-Indirect Bilirubin (calculated)</strong></p>\r\n<p><strong>-Alkaline Phosphatase</strong></p>\r\n<p><strong>-AST</strong></p>\r\n<p><strong>-ALT</strong></p>\r\n<p><strong><a href=\"https://newcenturylabs.com/product/cbc-includes-differential-and-platelets\">Complete blood count (CBC) $15.00</a></strong></p>\r\n<h3><strong>Test Includes:</strong></h3>\r\n<p><strong>Platelet count The number of red blood cells (RBC count)</strong></p>\r\n<p><strong>The number of white blood cells (WBC count)</strong></p>\r\n<p><strong>The total amount of hemoglobin in the blood The fraction of the blood composed of red blood cells (hematocrit)</strong></p>\r\n<p><strong>Average red blood cell size (MCV)</strong></p>\r\n<p><strong>Hemoglobin amount per red blood cell (MCH)</strong></p>\r\n<p><strong>The amount of hemoglobin relative to the size of the cell (hemoglobin concentration) per red blood cell (MCHC)</strong></p>\r\n<p><strong><a href=\"https://newcenturylabs.com/product/gamma-glutamyl-transferase-ggt\">GGT $15.00</a></strong></p>\r\n<p><strong>Elevated GGT is found in all forms of liver disease.</strong></p>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\0xpKUIsABe66NoaSsT2Z.jpg','healthy-liver-healthy-life','New Century provides low cost medical lab tests online across the United States.','order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests,','PUBLISHED',0,'2016-12-09 05:15:49','2021-01-20 06:27:09'),(12,2,6,'This Blood Test Can Help Prevent a Heart Attack','Knowing Your LDL Particle Size Can Help Prevent a Future Heart Attack','Knowing Your LDL Particle Size Can Help Prevent a Future Heart Attack','<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 25px 25px; line-height: 2; font-size: 15px; color: #333333; font-family: Raleway, Arial, sans-serif; transition: all 0.3s ease 0s !important;\"><span style=\"box-sizing: border-box; font-weight: bold; transition: all 0.3s ease 0s !important;\">Knowing Your LDL Particle Size Can Help Prevent a Future Heart Attack</span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 25px 25px; line-height: 2; font-size: 15px; color: #333333; font-family: Raleway, Arial, sans-serif; transition: all 0.3s ease 0s !important;\">When you measure your lipids annually you&rsquo;re just getting what is traditionally thought of as one of the many preventative blood tests, which measure Total Cholesterol, basic LDL (BAD) HDL (GOOD) and total Triglycerides. What the blood test isn&rsquo;t reporting is the actual particle sizes, such as your LDL particle size.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 25px 25px; line-height: 2; font-size: 15px; color: #333333; font-family: Raleway, Arial, sans-serif; transition: all 0.3s ease 0s !important;\">Knowing your LDL particle size can be a much stronger indictor of cardiovascular events, which is only found in advanced lipid profile tests.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 25px 25px; line-height: 2; font-size: 15px; color: #333333; font-family: Raleway, Arial, sans-serif; transition: all 0.3s ease 0s !important;\">Statists show that 50% of patients who ended up in the ER due to a heart attack event had normal lipid panels. Studies have shown the importance of&nbsp;LDL-particle size.&nbsp;Research have shown that folks with small LDL particles&nbsp;have a much greater risk of coronary heart disease, where as a large and fluffy type of LDL is thought of the most protective type of LDL size&mdash;information not found in standard lipid tests.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 25px 25px; line-height: 2; font-size: 15px; color: #333333; font-family: Raleway, Arial, sans-serif; transition: all 0.3s ease 0s !important;\"><span style=\"box-sizing: border-box; font-weight: bold; transition: all 0.3s ease 0s !important;\">LDL Particle size does matter</span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 25px 25px; line-height: 2; font-size: 15px; color: #333333; font-family: Raleway, Arial, sans-serif; transition: all 0.3s ease 0s !important;\">Our liver will produce anywhere from 1-2 grams of cholesterol per day! Cholesterol production comes from our diet, stress (high cortisol) and genetics.&nbsp; Production can decrease when we eat a healthy diet, stress less, and live in healthy environments.&nbsp; Cholesterol is necessary though to produce vitamin D, steroid hormones, memory function, and hormone balance. However, as small LDL particles flows through your arterial walls, it can begin to increase inflammation in your arteries causing stroke, causing plaque buildup, reducing blood flow to your heart.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 25px 25px; line-height: 2; font-size: 15px; color: #333333; font-family: Raleway, Arial, sans-serif; transition: all 0.3s ease 0s !important;\"><span style=\"box-sizing: border-box; font-weight: bold; transition: all 0.3s ease 0s !important;\">Hidden Cardiovascular Risk</span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 25px 25px; line-height: 2; font-size: 15px; color: #333333; font-family: Raleway, Arial, sans-serif; transition: all 0.3s ease 0s !important;\">With basic Cardiovascular testing, results can&rsquo;t come close to telling your doctor your risks to heart disease as advanced lipid tests. The question is why are physicians not offering advanced lipid profile testing to their patients? The answer is the high cost and extensive interpretation of results. Right now, when you ask your doctor for an advanced lipid profile test most likely your insurance company will not cover these tests, leaving you with a high bill in the hundreds. NewCenturyLabs.com has advanced lipid testing available for a fraction of the cost so that your doctor can help reclassify your risk to heart disease.</p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 25px 25px; line-height: 2; font-size: 15px; color: #333333; font-family: Raleway, Arial, sans-serif; transition: all 0.3s ease 0s !important;\"><span style=\"box-sizing: border-box; font-weight: bold; transition: all 0.3s ease 0s !important;\">The Cardio IQ Test Can Help Identify Your Cardiovascular Risks</span></p>\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px 25px 25px; line-height: 2; font-size: 15px; color: #333333; font-family: Raleway, Arial, sans-serif; transition: all 0.3s ease 0s !important;\">The&nbsp;<a style=\"box-sizing: border-box; background: 0px 0px; color: #428bca; text-decoration-line: none; cursor: pointer; outline: none !important; transition: all 0.3s ease 0s !important;\" href=\"https://www.newcenturylabs.com/product/42\"><span style=\"box-sizing: border-box; font-weight: bold; transition: all 0.3s ease 0s !important;\">Cardio IQ&reg; Advanced Lipid Profile Test&nbsp;</span></a>(92145) offered by New Century Labs and powered by Quest Diagnostics for just $99.00 is developed to help uncover the possible hidden risks to your cardiovascular health. Using the results of your test(s), your doctor will be able to develop a plan to set goals and treatment strategies to help reduce your overall cardiovascular risk.</p>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\lNfWIJz8avrYqQycCN63.jpg','this-blood-test-can-help-prevent-a-heart-attack','The Cardio IQ® Advanced Lipid Profile Test (92145) offered by New Century Labs and powered by Quest Diagnostics for just $99.00','LDL, Cardio IQ Advanced Lipid Profile Test, 92145, Quest Diagnostics, Vap Test, Blood Test,','PUBLISHED',0,'2017-03-24 20:27:12','2021-01-20 06:26:26'),(13,2,12,'2017 Tick and Lyme Disease Warning','Worried about Lyme Disease? There’s a cheap blood test for that.','Worried about Lyme Disease? There’s a cheap blood test for that.','<p><span style=\"font-family: roboto,helvetica neue,helvetica,arial,sans-serif;\"><span style=\"font-size: 18px;\"><span style=\"margin: 0px;\"><span style=\"color: #000000;\">Worried about Lyme Disease? There&rsquo;s a cheap blood test for that.</span></span></span></span></p>\r\n<p>The CDC, Center of Disease Control is warning about an influx of swarming Ticks throughout the United States, spreading Lyme Disease. But there&rsquo;s a double-shot of bad news that comes along with the influx.<br /><br />A new, and possibly fatal, tick-borne illness called Powassan, has arrived and this summer they are here, causing painful swelling in the brain killing 10% of people infected, or causing permanent brain damage. Powassan is much different than contracting Lyme Disease as Lyme disease can be treated if caught early, unlike Powassan.<br /><br />There is a report of 30,000 confirmed cases per year, but there are 10-15X more unconfirmed cases of Lyme disease in the United States according to the CDC in upwards of 300,000 to 500,000 annually.<br /><br /><strong>Influx in ticks in 2017 you ask?</strong><br />The mice population is increasing, which is helping Ticks spread their sinister love. Mice and some other small creatures carry around a little bacterium shape, that looks like paisley pasta under a scope.<br />The mice then pass it to the Tick, then the Tick passes it to a person when it bites. Ticks can easily jump from a tree as you pass by, or even a bush, making its way to your skin. Lyme causes fevers, arthritis, flu like symptoms, and in bad cases it damages the heart quickly.<br /><br />Going back in time to the 80&rsquo;s and early 90&rsquo;s Lyme disease was confined by just a few areas in the United States like Southern New England and Western Wisconsin, but now ticks have swarmed all over the country primarily in the eastern part of the US, but with heavy pockets in the Western part of the US too; up a whopping 400% increase than last year.<br /><br /><strong>Deep thought time.</strong><br />Often, we think catching Lyme disease happens only when you&rsquo;re out on a hike or camping in the woods, this in fact is <strong>NOT </strong>true. When you cut down trees for various types of commerce, such as a new housing development, to title one, you tend to disrupt the eco system. Take a forest or a farm that has been fragmented. When you have larger animals, who hunt for little mice those predators, who don&rsquo;t do much breeding, are dominant in this undisrupted landscape. Predators such as foxes, coyotes, large birds like owls and hawks, will find an easy catch like a mouse for a fast meal. But predators in developed land tend to vanish allowing mice to multiply and thrive, and especially in new suburban developments&mdash;they crank out babies like no body&rsquo;s business; mice are chronically infected with Lyme and covered in Ticks&mdash;hence creating a Lyme factory.<br />Therefore, if you think you&rsquo;re at risk just when you&rsquo;re camping, think again&mdash;you are at the same risk as you garden or even walking your dog in the neighborhood.<br />It&rsquo;s often hard to spot a Tick attached to you, as Ticks attach behind your ears, back of neck, armpits and even the growing area, however there is a way to pluck them off. The key is to not pull them off too fast as their heads can get stuck into your skin.<br /><br /><strong>And the good news is.....</strong><br />There is cure for Lyme disease, but it depends on how fast you get treated, the faster the better.<br />And knowing if you are infected with Lyme Disease is done through 1 single drop of blood. Access to getting your blood tests can be as simple as ordering blood test right here.<br />The test is called: <strong><a href=\"http://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=ea77e959d0&amp;e=7ebc60f9f5\" target=\"_blank\" rel=\"noopener\">Lyme Disease Antibody with Reflex&nbsp;to Blot (IgG, IgM)</a></strong> Sounds like a mouth full but it&rsquo;s very comprehensive and its dirt cheap, detecting positive/negative Lyme disease just after contact and as far out as many years if you think you have it.<br /><br />Often, Doctors miss the mark when diagnosing patients with Lyme disease because it can mimic many other more common chronic diseases, such as the common Flu, or even arthritis, and genetic heart disease. Hence why the CDC believes that cases in the US is more like 300,000-to 500,000 per year not the stated 30,000.<br />&nbsp;<br /><strong>Look for the Lyme test with Antibodies?</strong><br />Antibodies are simply proteins that your body makes when it responds to a foreign, or even harmful ingredients, called <strong>antigens</strong>. The most common antigens include: bacteria, viruses, fungi, and even chemicals. Your body will start to produce &ldquo;antibodies&rdquo; when you are infected Lyme (Borrelia burgdorferi) the bacterium that causes Lyme disease. These Lyme disease-specific antibodies will show in your blood test and you will be positive. Likewise, if you have never been exposed to&nbsp;Borrelia burgdorferi, (Lyme) you will not have any Lyme disease antibodies in your system; In this case, your test will be negative.<br /><br />If you feel you may have Lyme disease, get tested fast and get treatment ASAP, often times it&rsquo;s as simple as taking a specific type of heavy duty antibiotics, prescribed only by your treating Medical Doctor.<br />Since Lyme disease is difficult to diagnose and you&rsquo;re wondering why you&rsquo;re feeling tired, restless, have the flu, headaches, joint pain or generally unhealthy, Its super easy to rule out Lyme disease through a simple&nbsp;blood test, that way you can rule out this devastating disease.<br /><br /><strong>Remember health and wellness starts at the core fundamentals of getting to know the real&nbsp;\"you\" from inside out.&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />Join the movement&nbsp;at New Century Labs&nbsp;and experience the difference&nbsp;</strong><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;</strong><strong>Be a Proactive Warrior!</strong><br />&nbsp;<br />&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\wmTVazne4v8yo8XMtxWw.jpg','tick-lyme-disease-blood-test','If you feel you may have Lyme disease, get tested fast and get treatment ASAP, often times it’s as simple as taking a specific type of heavy duty antibiotics, prescribed only by your treating Medical Doctor.','tick,lyme disease,blood tests','PUBLISHED',0,'2017-07-23 23:02:30','2021-01-20 06:24:52'),(14,2,6,'The Dangers of Vitamins','Water soluble vs fat soluble and the dangers of vitamins','Water soluble vs fat soluble and the dangers of vitamins','<h1>The Dangers of taking too many vitamins and supplements</h1>\r\n<h2>Water soluble vs fat soluble&nbsp;</h2>\r\n<p>&nbsp;</p>\r\n<p>There&rsquo;s vitamin supplement stores in every city and every&nbsp;grocery aisle, you don&rsquo;t need a doctor&rsquo;s prescription to access them. You read taking Vitamin B-12 is great for nerves and you also read that taking Vitamin E is great for your skin. Do you really know what&rsquo;s truly happening to your body when you stare down that vitamin bottle and realize you&rsquo;re on your 25<sup>th</sup> pill?</p>\r\n<p>Often, we are googling, or reading in a magazine that taking certain supplements can be beneficial due to the lack of nutrients the average joe puts into his/her body. The information may also be tied to a good-looking model, almost thinking the youthful looks are just a few skips down the street to the grocery store towards the vitamin aisle.&nbsp;&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Let&rsquo;s get to it.</p>\r\n<h3><strong>In every Multi-vitamin, or individual vitamin, you should have a general idea how they are each processed in your body. Knowing how vitamins are processed is a step in helping you make the right choice when taking </strong><strong>Vitamins.</strong></h3>\r\n<p>Taking vitamins, A, D, E, and K for example are the fat-soluble vitamins. These types of vitamins dissolve in fat and stored in body tissues. When these vitamins are stored in your fat over time over time they can accumulate to dangerous levels and it can essentially lead to a serious condition called Hypervitaminosis, which means excess amounts of a vitamins in the body, when more than the recommended amount is taken.</p>\r\n<p>Here are the dangers: Too much Vitamin A, D, or K can lead to increased levels that are unhealthy and can cause health consequences, for example too much vitamin A can lead to birth defects, and too high levels of Vitamin E may increase the risk of hemorrhaging. Excess Vitamin K can lessen, and even at times, reverse the effects of Blood thinner meds and prevent normal Blood clotting, just to title a few.</p>\r\n<p>The missing link most folks fail to realize due to lack of access to direct-to-consumer blood testing is the importance is knowing your vitamin blood test levels before consuming vitamins. Knowing your vitamin levels can prove a lack, or abundance to various vitamins and minerals. Taking more than the necessary fat-soluble vitamin can cause unnecessary harm you could&rsquo;ve easily avoided.</p>\r\n<h3><strong>Too Much Can Cause Harm</strong></h3>\r\n<p>When your blood vitamin levels go above and beyond the safe limits, directed by your doctor, vitamins can act as harmful as some drugs. Excessive calcium intake, according to experts, &nbsp;more than 2,500 mg a day, can interfere with kidney function, cause kidney stones and constipation, and interfere with the absorption of iron and zinc. One 2,500 mg calcium supplement is like drinking eight glasses of milk, which goes beyond the reasonable food level.</p>\r\n<h3>&nbsp;</h3>\r\n<h3><strong>Fortified Foods Combined With Supplements</strong></h3>\r\n<p>Fortified foods can be just another way people can get additional nutrients. Fortified foods were the way many countries filled some nutrient complexities. Public health concerns years ago over nutrient deficiencies led the way to production practices like adding iodine to salt, grains enriched with B vitamins and iron, and milk fortified with vitamins A and D.</p>\r\n<p>But the combination of whole foods, supplements, and fortified foods raises safety concerns with experts. Eating fortified foods while also taking supplements can cause a person\'s diet to exceed safe upper levels and potentially lead to a toxic buildup.</p>\r\n<p>Did you know that simply consuming about six Brazil nuts, which weigh about 1 ounce, contain 544 micrograms of selenium&mdash;Yay selenium. That\'s a whopping 780% of the Daily Value of this trace mineral, which is only needed in small amounts.</p>\r\n<p><strong>Water Soluble</strong></p>\r\n<p>Because water-soluble vitamins and nutrients dissolve in water, the continuous supply your body needs calls for a steady daily intake, from the foods you eat, from the supplements you take, or from a combination of foods and supplements. Vitamins C, B12, thiamin, niacin, riboflavin, tryptophan, pantothenic acid, biotin, and folic acid are all classified in the water-soluble category.</p>\r\n<p>Water-soluble nutrients work best when you get them in the proper amounts. When you eat or take more than your body needs, the body adapts by absorbing just what it needs, and then it usually excretes the excess in your urine -- but not always. A study in the August 2010 <em>Journal of </em>nutrition <em>Science and Vitaminology</em> found that urinary excretion of certain vitamins and other nutrients was reduced when study participants fasted.</p>\r\n<p>The field of nutrition is ever-changing, and experts used to think that taking excess amounts of a water-soluble nutrient was harmless because the excesses would just be eliminated in urine. Today, we know that&rsquo;s not the case, and that some water-soluble vitamins and nutrients are handled differently by the body than others.</p>\r\n<p>Just because most water-soluble vitamins are not stored by the body, you can&rsquo;t assume that it is safe or effective to take more than the safe upper limit. In addition, you need to account for the vitamins and nutrients you get from the food you eat.</p>\r\n<p>For example, simply taking Vitamin B6 can cause nerve problems, too much Niacin can cause flushing, and excess Vitamin C can causeKidney Stones; in addition, excess folic acid may also mask a Vitamin B12 Deficiency , which is more common in people over age 50.</p>\r\n<p>Best ways to solve for X is by simply ordering your vitamin blood tests through NewCenturyLabs.com and get to know where your levels stand before putting your body at risk of danger.</p>\r\n<p><strong><a href=\"https://www.newcenturylabs.com/product/vitamin-d-25-hydroxy\">Know your Vitamin D levels for just $33.00!</a></strong></p>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\bmFcrbmQg3cf6bD6YGRJ.jpg','Vitamin-supplements-dangers','Taking vitamins, A, D, E, and K for example are the fat-soluble vitamins. These types of vitamins dissolve in fat and stored in body tissues. When these vitamins are stored in your fat over time over time they can accumulate to dangerous levels and it can','Vitamins, supplements, blood test','PUBLISHED',0,'2017-09-03 21:42:22','2021-01-20 06:24:32'),(15,2,6,'Top Ten Blood Tests','Ever wonder what the top 10 blood tests are for your health is?','Ever wonder what the top 10 blood tests are for your health is?','<table style=\"width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>&nbsp;</p>\r\n<table style=\"width: 100.0%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>Ever wonder what the top 10 blood tests are for your health is?</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<table style=\"width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<table style=\"width: 100.0%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>New Century Labs receives countless emails from folks asking what they need to do to be more proactive and stay healthy.</p>\r\n<p>Our first answer to this question is not diet, not exercise, its get to know the real &ldquo;you&rdquo; first from inside out. 70-80% of all clinical decisions are based off of 1 single drop of blood, and disease happens before you get a symptom. Our answer is get your blood tested first then you can come up with an action plan after you have spoken to your doctor.</p>\r\n<p>New Century Labs has come up with what we call our top 10 blood tests that goes far beyond your annual wellness visit. Not to say your annual visit isn&rsquo;t significant, we know that these annual visits are constricted by your health insurance provider, they pick what they are willing to pay for, which excludes searching for important disease markers. Excluding disease markers can ultimately lead to death.</p>\r\n<p>There are over 8,500 blood tests and out of this amount insurance providers won&rsquo;t pay for some of the most important ones. Lucky for you, New Century Labs has you covered with access and pricing from 80-90% off on demand, on your terms.</p>\r\n<p>So you want to live longer, fight cancer, heart disease, diabetes, and have optimal hormone balance, and how about optimal sex hormones, zero mental depression, and various other abnormalities? It starts with just 1 drop of blood, so here we go.</p>\r\n<p><br /><br /><strong><a href=\"https://newcenturylabs.com/product/comprehensive-metabolic-panel\" target=\"_blank\" rel=\"noopener\">1.&nbsp;</a><a href=\"https://newcenturylabs.com/product/comprehensive-metabolic-panel\" target=\"_blank\" rel=\"noopener\">Compressive Metabolic Panel (CMP) $14.00&nbsp;</a><br /><br /><a href=\"https://newcenturylabs.com/product/cbc-includes-differential-and-platelets\" target=\"_blank\" rel=\"noopener\">Complete Blood Count (CBC) $15.00&nbsp;</a></strong><br />&nbsp;<br />Both CBC and CMP panel are going to be your most basic tests, yet highly correlated to disease progression, and prevention&mdash;giving your physician a snap shot of your general wellness. For example the CBC blood test measures the quality of your overall blood health, looking at Red Blood Cells, White Blood Cells, Platelet count and other hematological abnormalities.<br />The CMP Panel provides blood glucose, which is important for screening out diabetes risk. In addition you&rsquo;ll find an assessment of critical values such as calcium, potassium, and Iron, all of which checks for electrolyte balance.<br />&nbsp;<br />&nbsp;<br />&nbsp;<a href=\"https://newcenturylabs.com/product/fibrinogen-activity\" target=\"_blank\" rel=\"noopener\"><strong>2. Fibrinogen $37.00</strong></a><br />This is really important to blood clotting, for example increased fibrinogen levels can increase tissue inflammation. If you look at heart disease in general it starts with inflammation of the tissue, which can help predict the risk of heart disease and stroke. High levels of Fibrinogen are also associated with other inflammatory issues like Rheumatoid Arthritis and Glomerulonephritis (inflammation of the Kidney.)<br />&nbsp;<br /><a href=\"https://newcenturylabs.com/product/hemoglobin-a1c\" target=\"_blank\" rel=\"noopener\"><strong>3. Hemoglobin A1C $23.00</strong></a><br />Circling back to diabetes risk and checking glucose levels to assess potential diabetes, the Hemoglobin A1C test is an assessment of the average glucose levels for the last two to three months, also predicting heart disease and other metabolic syndromes.<br />If you&nbsp;keep your A1C levels down, you decrease the risk of getting other disease. The amount of diabetes has significantly increased over the past decade where over 90M Americans are pre diabetic and don&rsquo;t even know it. This test &nbsp;will give you a definitive answer to the bigger picture. Patients who actively get their A1c and glucose levels checked are at better odds of combating risky blood sugar levels, as conscientious awareness can help design a healthy game plan and a healthier lifestyle.<br />&nbsp;<br />&nbsp;<br /><a href=\"https://newcenturylabs.com/product/dhea-dehydroepiandrosterone\" target=\"_blank\" rel=\"noopener\"><strong>4. DHEA $55.00</strong></a><br />Dehydroepiandrosterone (DHEA) is a hormone produced by the adrenal glands is related to the sex hormones estrogen and testosterone. DHEA blood levels tent to peak in your 20&rsquo;s and decline from there with age, about 20-30%. Want to know what&rsquo;s also considered the anti-aging hormone? You guessed it, DHEA!&nbsp; If you have libido issues, and mood problems DHEA blood test is significantly important to do.<br />However elevated DHEA may indicate adrenal hyperplasia, which is a group of various disorders that result from adrenal glands to produce glucocorticoids. Optimal DHEA levels can also help prevent diabetes, cancer, heart disease and depression.<br />&nbsp;<br />&nbsp;&nbsp;<br /><a href=\"https://newcenturylabs.com/product/psa-total\" target=\"_blank\" rel=\"noopener\"><strong>5. Prostate-Specific Antigen (PSA) (For Males Only) $26.00</strong></a><br />&nbsp;<br />Prostate-Specific Antigen (PSA) is a protein produced by the prostate gland in men. When you produce elevated levels, this could indicate various health concerns such as enlarged prostate, prostate inflammation, and Cancer. Studies suggest that eating a very healthy diet can significantly reduce and protect you from high PSA levels.<br />&nbsp;<br />&nbsp;&nbsp;<br /><a href=\"https://newcenturylabs.com/product/homocysteine\" target=\"_blank\" rel=\"noopener\"><strong>6. Homocysteine $30.00</strong></a><br />&nbsp;<br />&nbsp;<br />Homocysteine is an Amino Acid created in the body. High Homocysteine levels have been associated with an increased risk to heart attacks, bone problems, and poor cognitive function.<br />&nbsp;&nbsp;<br />&nbsp;<br /><a href=\"https://newcenturylabs.com/product/crp\" target=\"_blank\" rel=\"noopener\"><strong>7. C-Reactive Protein $24.00</strong></a><br />&nbsp;<br />Higher than normal C-Reactive Protein has been discovered as high inflammation in the body which can lead to life-threatening diseases, such as coronary heart disease, diabetes, macular degeneration, and over- all cognitive decline. When you measure your bodies inflammation levels through this blood test you can actually reduce this inflammation by proper diet and exercise&mdash;knowing is half the battel. The high sensitive CRP (HS-CRP) can detect inflammation in arterial walls, giving a closer look as to heart disease. It is common to combining a Lipid panel with this test to add more conformation.<br />&nbsp;<br /><a href=\"https://newcenturylabs.com/product/thyroid-stimulating-hormone-tsh\" target=\"_blank\" rel=\"noopener\"><strong>8. Thyroid Stimulating Hormone (TSH) $34.00</strong></a><br />&nbsp;<br />TSH is secreted by the Pituitary Gland. TSH controls thyroid hormone secretion in the thyroid. When your TSH levels go down this indicates hyperthyroidism activity, also known as thyrotoxicosis. When values are above normal this indicates low thyroid activity. Having optimal TSH levels can mean a better mood, more energy, and optimal weight.<br />&nbsp;<br /><a href=\"https://newcenturylabs.com/product/testosterone-total-males-adult\" target=\"_blank\" rel=\"noopener\"><strong>9. Testosterone Male $30.00 Female $33.00</strong></a><br />&nbsp;<br />Testosterone is produced, drum roll, in the male testes and in the ovaries in women, also in the adrenal glands in both men and women. If you are male or female taking a testosterone blood test is clinically significant. Testosterone plays many roles in the body for men and women, libido, muscle mass, fertility n women, obesity, heart function, and mood. As men age naturally testosterone levels will decline, approximately 55-65% by age 75. In addition low testosterones levels have pointed to increased risk of heart attacks in men.<br />&nbsp;<br /><a href=\"https://newcenturylabs.com/product/estradiol\" target=\"_blank\" rel=\"noopener\"><strong>10.&nbsp;</strong></a><strong><a href=\"https://newcenturylabs.com/product/estradiol\" target=\"_blank\" rel=\"noopener\">Estradiol&nbsp;</a></strong><a href=\"https://newcenturylabs.com/product/estradiol\"><strong>$31.00</strong></a><br />&nbsp;<br />Estradiol is primarily circulating from the estrogen in both men and women, is is an indicator of hypothalamic and pituitary function. Although men produce much smaller estradiol than women; in addition, most estradiol is produced from testosterone and adrenal steroid hormones, and a fraction is produced directly by the testes. In women, estradiol is produced in the ovaries, adrenal glands, and peripheral tissues. Levels of estradiol vary throughout the menstrual cycle, and drop to low but constant levels after menopause.<br />In women, blood estradiol levels help to evaluate menopausal status and sexual maturity. Increased levels in women may indicate an increased risk for breast or endometrial cancer. Estradiol plays a role in supporting healthy bone density in men and women. Low levels are associated with an increased risk of osteoporosis and bone fracture in men and women as well. Elevated levels of estradiol in men may accompany gynecomastia (breast enlargement), diminished sex drive, and difficulty with urination.<br /><strong>Women:</strong>&nbsp;Diminished levels of estradiol correlate with low levels of bone mineral density, which is a strong risk factor for osteoporosis.&nbsp;Optimizing estradiol levels in early menopausal women has been associated with relief from hot flashes, irritability, and insomnia.<br /><strong>Men:</strong>&nbsp;In older men, low levels of estradiol have been linked with an increased risk of vertebral fractures, conversely, estradiol levels are found to be positively associated with bone mineral density, suggesting an association between low serum levels and the development of osteoporosis.&nbsp;<br />Optimal estradiol levels may support healthy bone density, cardiovascular health, and well-being.</p>\r\n<p><strong>In Summary</strong></p>\r\n<p>You are ultimately in control of your health decisions, not your close circle, and not your Doctor. It is you who will decide which direction you want to take your health. In our modern era of abundant access and lower cost, we welcome you to take control of your health today and be a Proactive Warrior, fighting for a better you.<br />Blood testing is seriously a powerful tool to unlock data about your current health condition, combating unwanted disease and ultimately sudden death.<br />Many diseases are treatable if caught early and can help aid your doctor with a much more powerful clinical decision.</p>\r\n<p><strong>Let&rsquo;s thrive!</strong></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\SnHkC60FebVwS79jsswR.jpg','top-10-blood-tests','New Century Labs has come up with what we call our top 10 blood tests that goes far beyond your annual wellness visit.','Blood tests, lipid panel, Estradiol, Testosterone, TSH, C-Reactive Protein, Homocysteine, PSA, CBC, CMP, DHEA , A1C, Hemoglobin , Fibrinogen','PUBLISHED',0,'2017-11-04 13:25:11','2021-01-20 06:24:14'),(16,2,9,'This Blood Test Can Save Your Life','HS-CRP blood test is thought by some experts to be a useful test for determining risk of CVD','HS-CRP blood test is thought by some experts to be a useful test for determining risk of CVD','<table class=\"mcnTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n<h2 style=\"margin: 0px; padding: 0px; color: #222222; font-size: 28px; font-weight: bold; line-height: 42px;\">This Test Could Save Your Life</h2>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 27px; font-size: 18px !important;\">In 2016 the total US Population was 323M and 20% of this population died from a heart attack, that&rsquo;s 630,000 people, that&rsquo;s 1 in 4 people to put it into perspective, or every 40 seconds. Heart disease is the&nbsp;<strong>leading cause</strong>&nbsp;of death for people of most racial/ethnic groups in the United States, including African Americans, Hispanics, and whites costing the United States over 200 Billion Dollars per year. Heart disease however has various causes, our food, our lifestyle, for example how we handle stress, lack of exercise, and genetics just to title a few. &nbsp;<br />&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; table-layout: fixed !important; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n<tr>\r\n<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px 18px 0px;\">\r\n<table class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; table-layout: fixed !important; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n<tr>\r\n<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px;\">\r\n<table class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnCaptionBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnCaptionBlockOuter\">\r\n<tr>\r\n<td class=\"mcnCaptionBlockInner\" style=\"text-size-adjust: 100%; padding: 9px;\" valign=\"top\">\r\n<table class=\"mcnCaptionBottomContent\" style=\"border-collapse: collapse; text-size-adjust: 100%;\" border=\"0\" width=\"false\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnCaptionBottomImageContent\" style=\"text-size-adjust: 100%; padding: 0px 9px 9px;\" align=\"center\" valign=\"top\"><img class=\"mcnImage\" style=\"border: 0px; height: auto; outline: none; vertical-align: bottom; max-width: 3960px;\" src=\"https://gallery.mailchimp.com/c02fa6ffaafa52cd898c2c956/_compresseds/bd2717b5-98fd-4526-8d08-7337aaeb653f.jpg\" alt=\"\" width=\"564\" /></td>\r\n</tr>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 9px;\" valign=\"top\" width=\"564\">\r\n<h3 style=\"margin: 0px; padding: 0px; color: #444444; font-size: 22px; font-weight: bold; line-height: 33px;\">Common Heart Attack</h3>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">The most common type of heart disease is called Atherosclerosis, which is a form of plaque buildup from cholesterol and other substances inside the artery walls causing inflammation and decreased blood flow to the heart muscle. The symptoms are typically chest pain called Angina, to the point of heart failure ultimately causing death.<br />Your body however could give you a warning sign long before you are categorized as a major risk factor by your doctor. Did you know however if you&rsquo;re a male one of the strongest indicators (no pun intended) is a weak erection. A special Health Report from Harvard Medical School, atherosclerosis in arteries supplying the penis can prevent the increase in blood flow needed to start or sustain an erection.<br />In addition, blood vessel issues are the leading cause of erectile dysfunction. That&rsquo;s why Harvard&rsquo;s Dr. Michael P. O&rsquo;Leary,Harvods lead medical editor, says that erections &ldquo;serve as a indicator for your overall health,&rdquo; and that erectile dysfunction can be an early warning sign of trouble in the heart or elsewhere in the body. Many other early warnings signs of course are the same for both men and women, such as feeling tired, decreased memory, and shortness of breath are all symptoms.<br />The common denominator with all heart disease patients is however inflammation. This starts just like getting a splinter, a scrape, or a bee sting. The pulsating swelling of damaging tissue is inflammation; inflammation can be hidden in your arteries at very low levels simply from cholesterol hitting your arterial wall, eventually causing a heart attack.<br />&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; table-layout: fixed !important; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n<tr>\r\n<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px;\">\r\n<table class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnCaptionBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnCaptionBlockOuter\">\r\n<tr>\r\n<td class=\"mcnCaptionBlockInner\" style=\"text-size-adjust: 100%; padding: 9px;\" valign=\"top\">\r\n<table class=\"mcnCaptionBottomContent\" style=\"border-collapse: collapse; text-size-adjust: 100%;\" border=\"0\" width=\"false\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnCaptionBottomImageContent\" style=\"text-size-adjust: 100%; padding: 0px 9px 9px;\" align=\"center\" valign=\"top\"><img class=\"mcnImage\" style=\"border: 0px; height: auto; outline: none; vertical-align: bottom; max-width: 493px;\" src=\"https://gallery.mailchimp.com/c02fa6ffaafa52cd898c2c956/images/e8e84c9c-b576-4bdf-946b-d7b4b55f3ff8.jpg\" alt=\"\" width=\"493\" /></td>\r\n</tr>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 9px;\" valign=\"top\" width=\"564\">\r\n<h3 style=\"margin: 0px; padding: 0px; color: #444444; font-size: 22px; font-weight: bold; line-height: 33px;\">Is there a silver bullet blood test?</h3>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">The answer is &ldquo;yes&rdquo; and New Century Labs has that cheap blood test you may have never heard about.<br />HS-CRP (High Sensitivity C-Reactive Protein)<br />High-sensitivity CRP is thought by some experts to be a useful test for determining risk of CVD,&nbsp;heart attacks, and&nbsp;strokes and that hs-CRP can play a role in the evaluation process BEFORE &nbsp;a person develops one of these health problems. Some say that the best way to predict risk is to combine a good marker for inflammation, like hs-CRP, with the lipid profile. Several groups have recommended that this test be used for people who have a moderate risk of heart attack over the next 10 years.<br />Relatively high levels of hs-CRP in otherwise healthy individuals have been found to be predictive of an increased risk of a future&nbsp;heart attack,&nbsp;stroke, sudden cardiac death, and/or peripheral arterial disease, even when&nbsp;cholesterol levels&nbsp;are within an acceptable range.<br />People with higher hs-CRP values have the highest risk of&nbsp;cardiovascular disease&nbsp;and those with lower values have less risk. Specifically, individuals who have hs-CRP results at the high end of the normal range have 1.5 to 4 times the risk of having a heart attack as those with hs-CRP values at the low end of the normal range.<br />The American Heart Association and U.S. Centers for Disease Control and Prevention have defined risk groups as follows:</p>\r\n<ul>\r\n<li style=\"text-size-adjust: 100%;\">Low risk: less than 1.0 mg/L</li>\r\n<li style=\"text-size-adjust: 100%;\">Average risk: 1.0 to 3.0 mg/L</li>\r\n<li style=\"text-size-adjust: 100%;\">High risk: above 3.0 mg/L</li>\r\n</ul>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">These values are only a part of the total evaluation process for cardiovascular diseases. Additional risk factors to be considered are elevated levels of cholesterol,&nbsp;LDL-C,&nbsp;triglycerides, and&nbsp;glucose. In addition, smoking, high blood pressure hypertension&nbsp;and&nbsp;diabetes&nbsp;also increase the risk level.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; table-layout: fixed !important; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n<tr>\r\n<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px;\">\r\n<table class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnButtonBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnButtonBlockOuter\">\r\n<tr>\r\n<td class=\"mcnButtonBlockInner\" style=\"text-size-adjust: 100%; padding: 0px 18px 18px;\" align=\"center\" valign=\"top\">\r\n<table class=\"mcnButtonContentContainer\" style=\"text-size-adjust: 100%; border-radius: 3px; background-color: #00add8;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnButtonContent\" style=\"text-size-adjust: 100%; font-family: Helvetica; font-size: 18px; padding: 18px;\" align=\"center\" valign=\"middle\"><a class=\"mcnButton \" style=\"text-size-adjust: 100%; display: block; font-weight: bold; letter-spacing: -0.5px; line-height: 18px; text-decoration-line: none; color: #ffffff;\" title=\"HS-CRP Blood Test \" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=471cbe7091&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\">HS-CRP Blood Test</a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnCaptionBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnCaptionBlockOuter\">\r\n<tr>\r\n<td class=\"mcnCaptionBlockInner\" style=\"text-size-adjust: 100%; padding: 9px;\" valign=\"top\">\r\n<table class=\"mcnCaptionBottomContent\" style=\"border-collapse: collapse; text-size-adjust: 100%;\" border=\"0\" width=\"false\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnCaptionBottomImageContent\" style=\"text-size-adjust: 100%; padding: 0px 9px 9px;\" align=\"center\" valign=\"top\"><img class=\"mcnImage\" style=\"border: 0px; height: auto; outline: none; vertical-align: bottom; max-width: 849px;\" src=\"https://gallery.mailchimp.com/c02fa6ffaafa52cd898c2c956/images/fc7ae845-3479-4ce4-9df4-259d9035af4e.jpg\" alt=\"\" width=\"564\" /></td>\r\n</tr>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 9px;\" valign=\"top\" width=\"564\">\r\n<h3 style=\"margin: 0px; padding: 0px; color: #444444; font-size: 22px; font-weight: bold; line-height: 33px;\">Just a Click Away</h3>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">HS-CRP test can be easily ordered at New Century Labs, results are typically 48 hours and it can be a true life saver for a more awareness and control of your own health, creating a more proactive healthy lifestyle.<br />&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; table-layout: fixed !important; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n<tr>\r\n<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px;\">\r\n<table class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnBoxedTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnBoxedTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnBoxedTextBlockInner\" style=\"text-size-adjust: 100%;\" valign=\"top\">\r\n<table class=\"mcnBoxedTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%; padding: 9px 18px;\">\r\n<table class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; background-color: #f7f7f7; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; text-align: center; padding: 18px;\" valign=\"top\">\r\n<h3 style=\"margin: 0px; padding: 0px; color: #444444; font-size: 22px; font-weight: bold; line-height: 33px;\">We Look Forward to Serving You!</h3>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">24 Hours a day 7 Days Per Week</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\MizETJkvztcdu0vIhQyz.jpg','hs-crp-blood-test','High-sensitivity CRP is thought by some experts to be a useful test for determining risk of CVD, heart attacks, and strokes and that hs-CRP can play a role in the evaluation process BEFORE  a person develops one of these health problems. Some say that the','Cheap Blood Test, HS CRP, Direct-to-consumer, Lipid test','PUBLISHED',0,'2017-11-19 21:46:02','2021-01-20 06:23:58'),(17,2,6,'Omega-3 and -6 Fatty Acids','he omega-3s have anti-inflammatory benefits and help prevent heart disease, whereas omega-6s lower blood cholesterol and support the skin.','he omega-3s have anti-inflammatory benefits and help prevent heart disease, whereas omega-6s lower blood cholesterol and support the skin.','<h1>Omega 3 and 6 Fatty Acids can actually be the key to optimizing your health&nbsp;</h1>\r\n<p>Our bodies are capable of producing all the fatty acids it needs; however, except for the two we will mention: linoleic acid (LA), an&nbsp;omega-6&nbsp;fatty acid, in addition to alpha-linolenic acid (ALA), an&nbsp;omega-3 fatty acid. Both of these have to be consumed from the diet and they are called &ldquo;essential fatty acids.&rdquo;</p>\r\n<p>&nbsp;</p>\r\n<p>Both the omega-6 and omega-3 fatty acids belong to a large subclass of polyunsaturated fats this is where the word \'essential\' comes in because they are required for optimal health yet we cannot produce them in the body, as they must be obtained from diet. Their differences lie in their chemical structure and their roles in the body.</p>\r\n<p>As polyunsaturated fatty acids, both the omega-6 and the omega-3 families have more than one double bond in the carbon chain. All fatty acids in the omega-6 family contain their first double bond between the 6th and 7th carbon atoms (counted from the methyl (CH3) terminal carbon atom and the omega-3 family of fatty acids have their first double bond between the 3rd and 4th carbon atom.</p>\r\n<p>Both families of fatty acids are vital components of membranes and are used by the body in the production of eicosanoids, a vast range of highly bioactive substances (prostaglandins, leukotrienes, and lipoxins) but the activity of these metabolites varies. For example, the eicosanoids derived from omega-6 are in general more active (or reactive) than those produced from omega-3 and omega-6 is aggregatory whereas oega-6 is pro-aggregatory.</p>\r\n<p>In otherwords, the omega-3s have anti-inflammatory benefits and help prevent heart disease, whereas omega-6s lower blood cholesterol and support the skin.</p>\r\n<p>Like all fats, EFAs provide energy. Their calorific value is similar to other fats and oils but, unlike saturated fats, they have important health roles. In fact, as their title suggest, they are essential and must be consumed regularly as the body has limited storage for them.</p>\r\n<p>Both of the important EFA families - omega-6 and omega-3 - are components of nerve cells and cellular membranes. They are converted by the body into eicosanoids, leukotrienes and prostaglandins - all of which are needed on a second-by-second basis by most tissue activities in the body.</p>\r\n<div>\r\n<p><strong>Omega-3 and 6 Fatty Acids do have their purpose</strong></p>\r\n</div>\r\n<ul>\r\n<li>Regulating pressure in the eye, joints, and blood vessels, and mediating immune response</li>\r\n<li>Regulating bodily secretions and their viscosity</li>\r\n<li>Dilating or constricting blood vessels</li>\r\n<li>Regulating collateral circulation</li>\r\n<li>Directing endocrine hormones to their target cells</li>\r\n<li>Regulating smooth muscles and autonomic reflexes</li>\r\n<li>Being primary constituents of cell membranes</li>\r\n<li>Regulating the rate of cell division</li>\r\n<li>Maintaining the fluidity and rigidity of cellular membranes</li>\r\n<li>Regulating the inflow and outflow of substances to and from cells</li>\r\n<li>Transporting oxygen from red blood cells to the tissues</li>\r\n<li>Maintaining proper kidney function and fluid balance</li>\r\n<li>Keeping saturated fats mobile in the blood stream</li>\r\n<li>Preventing blood cells from clumping together (blood clots that can be a cause of heart attack and stroke)</li>\r\n<li>Mediating the release of inflammatory substances from cells that may trigger allergic conditions</li>\r\n<li>Regulating nerve transmission and communication</li>\r\n<li>If the diet is deficient in either omega-6 or omega-3 long-term degenerative illnesses will result.</li>\r\n</ul>\r\n<p><img src=\"https://i.ndtvimg.com/i/2016-09/fish-oil-625_625x350_71474879317.jpg\" alt=\"Image result for fish omega\" /></p>\r\n<p><strong>Where to get Omega 3 fats:</strong></p>\r\n<p>Cold water fish, tuna, cod liver, halibut, herring, mackerel, trout, salmon, sardines.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Where to get Omega 6 fats:</strong></p>\r\n<p>Sunflower seeds, seed oils, corn, pumpkin seeds, sesame seeds, nuts, meat, dairy products.</p>\r\n<p>&nbsp;</p>\r\n<p>Before running to the vitamin store we encourage you to test for Omega-3 and 6 fatty acids by doing a simple blood test. Once you know if you&rsquo;re deficient you can discuss the next steps with your doctor regarding supplementation if needed.</p>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\kmxQ1tJb8ofmqxRKiZQi.jpg','Omega-3-and-6-Fatty-Acids','Omega 3 and 6 Fatty Acids can actually be the key to optimizing your health reducing the risk of heart disease, cancers, and optimal brain function, and yes, we do have that blood test.','omega 3, omega 6, cheap blood test, order blood tests online, health, direct-to-consumer, cardio iq','PUBLISHED',0,'2017-12-18 23:47:54','2021-01-20 06:23:37'),(18,2,6,'Are Your Hormones Telling You How To Live Your Life','Blood Testing to check your hormones on the fly','Blood Testing to check your hormones on the fly','<table class=\"mcnTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n<h1 style=\"margin: 0px; padding: 0px; color: #222222; font-size: 40px; font-weight: bold; line-height: 60px; text-align: center;\"><img src=\"https://gallery.mailchimp.com/c02fa6ffaafa52cd898c2c956/images/48831d04-d11c-4aca-83d3-48506895e1ad.jpg\" /></h1>\r\n<h1 style=\"margin: 0px; padding: 0px; color: #222222; font-size: 40px; font-weight: bold; line-height: 60px; text-align: center;\"><span style=\"font-size: 24px;\">Your Hormones actually can</span></h1>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n<tr>\r\n<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px 18px 0px;\">\r\n<table class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnImageBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnImageBlockOuter\">\r\n<tr>\r\n<td class=\"mcnImageBlockInner\" style=\"text-size-adjust: 100%; padding: 9px;\" valign=\"top\">\r\n<table class=\"mcnImageContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnImageContent\" style=\"text-size-adjust: 100%; padding: 0px 9px; text-align: center;\" valign=\"top\"><img class=\"mcnImage\" style=\"border: 0px; height: auto; outline: none; vertical-align: bottom; max-width: 704px; padding-bottom: 0px; display: inline !important;\" src=\"https://gallery.mailchimp.com/c02fa6ffaafa52cd898c2c956/images/e503d9e6-3132-470d-baef-cb28c8bc9729.jpg\" alt=\"\" width=\"564\" align=\"center\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\"><strong>Your hormones can actually control your every function</strong><br />The&nbsp;endocrine system is a network of glands that produce and release hormones that help control many important body functions, including the body\'s ability to change calories into energy that powers cells and organs. &nbsp;The endocrine system influences how your heart&nbsp;beats how your bones and tissues grow, even your ability to make a baby. It plays a vital role in whether or not you develop diabetes thyroid&nbsp;disease, growth disorders, sexual dysfunction, and a host of other hormone-related disorders. In other words, your hormones control your life for better or worse!<br /><br />Major glands that make up the human endocrine system include:<br />&nbsp;<br /><strong>-Hypothalamus<br />-Pituitary gland<br />-Thyroid<br />-Parathyroid<br />-Pancreas<br />-Adrenal Glands<br />-Pineal body<br />-Reproductive glands (Ovaries and Testes) | Pancreas.</strong><br />&nbsp;<br />There are several hormones working in our body controlling almost every body function, ranging from the rate of chemical reactions, transporting substances through membranes, electrolyte balance, water balance, blood pressure, etc. Hormones are responsible for managing development, reproduction, growth, and behavior&mdash; and a change in hormones can even change our personalities.<br />Being hormonally imbalanced can cause weight gain, weight loss, depression, poor libido. Stopping at just that would give hormone imbalance little to worry about, but there\'s more. How about migraines, acne, menopause, heart problems, and increasing cancer risk. According to the National Cancer institute For instance, &ldquo;taking combined menopausal hormone therapy (estrogen plus progestin, which is a synthetic version of the female hormone progesterone) can increase a woman&rsquo;s risk of breast cancer.&nbsp;&ldquo; In addition to a slew of other cancers.<br /><br />Hormones have a lot of authority. They are the little chemicals that tell your body just right down to the cell what to do and how to do it.<br />And the reality is, there are many other hormones in our body, if not balanced, that can have an influence on your risk of various diseases throughout the body.<br />This is why its important to take action when you have any of the following symptoms below to get your blood tested:<br /><br />Tired, weight loss/gain, depression, anxiety, heart arrhythmia, poor libido, insomnia just to title a few.<br />Did you know that imbalanced hormones can spike your cholesterol levels putting you at risk of a heart attack.&nbsp;<br />&nbsp;<br /><strong>Looking in the mirror won&rsquo;t tell you what&rsquo;s going on inside</strong><br />Maintaining the health of your hormones should be of utmost importance to you. As you&rsquo;ve read, hormones control almost everything in our body; therefore, it is important to get to know if your hormones are optimal.<br />Most hormones can be detected in blood tests and even salivary tests and hormonal imbalance has capabilities of destroying your health if kept under the radar and being that 70-80% of all clinical decisions come from blood testing and disease produces first without symptoms, signs, or warnings, optimizing hormone balance will need to be done with an appropriate medical professional. After reviewing your blood tests your recommendation may just begin with a change in diet and environmental changes, medication and supplementation.<br />Relying on symptoms is not the best approach, as catching red flags can be caught early before disease is welcomed in the body. As you can see, optimal hormone balance is very important to achieving top health and a proper functioning of our body.<br />&nbsp;<br />Access to hormone balance blood tests can be done on the fly and we have them listed for easy checkout.<br />If you&rsquo;re concerned about hormone imbalance check out our list of blood tests below:<br /><br /><a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://www.newcenturylabs.com/product/thyroid-stimulating-hormone-tsh\" target=\"_blank\" rel=\"noopener\"><strong>TSH</strong></a><br />To screen for and help diagnose&nbsp;thyroid disorders; to monitor treatment of&nbsp;hypothyroidism&nbsp;and&nbsp;hyperthyroidism<br />Ordered when you have the following concerns:</p>\r\n<ul>\r\n<li style=\"text-size-adjust: 100%;\">Increased heart rate, Anxiety, Weight loss, Difficulty sleeping,</li>\r\n<li style=\"text-size-adjust: 100%;\">Tremors in the hands ,Weakness, Diarrhea (sometimes),</li>\r\n<li style=\"text-size-adjust: 100%;\">Light sensitivity, visual disturbances, The eyes may be affected: puffiness around the eyes, dryness, irritation, and, in some cases, bulging of the eyes</li>\r\n</ul>\r\n<div>Signs and symptoms of hypothyroidism may include: Weight gain, Dry skin, Constipation, Cold intolerance, Puffy skin, Hair loss, Fatigue, Menstrual irregularity in women.</div>\r\n<br /><a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://www.newcenturylabs.com/product/t3-free\" target=\"_blank\" rel=\"noopener\"><strong>T3 Free</strong></a><br /><a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://www.newcenturylabs.com/product/t3-total\" target=\"_blank\" rel=\"noopener\"><strong>T 3 Total</strong></a><br /><br />A free T3 or total T3 test may be ordered when someone has an abnormal&nbsp;TSH test result. It may be ordered as part of the investigative workup when a person has symptoms suggesting&nbsp;hyperthyroidism, especially if the&nbsp;free T4 level&nbsp;is not elevated.<br />Ordered when you have the following concerns:<br />Signs&nbsp;and&nbsp;symptoms&nbsp;may include:\r\n<ul>\r\n<li style=\"text-size-adjust: 100%;\">Increased heart rate, Anxiety, Weight loss, Difficulty sleeping, Tremors in the hands, weakness, Diarrhea (sometimes), Light sensitivity, visual disturbances</li>\r\n<li style=\"text-size-adjust: 100%;\">The eyes may be affected: puffiness around the eyes, dryness, irritation, and, in some cases, bulging of the eyes. Free or total T3 may sometimes be ordered at intervals to monitor a known&nbsp;thyroid condition&nbsp;and to help monitor the effectiveness of treatment for hyperthyroidism.</li>\r\n</ul>\r\n<ul>\r\n<li style=\"text-size-adjust: 100%;\">Increased heart rate, Anxiety, Weight loss, Difficulty sleeping,</li>\r\n<li style=\"text-size-adjust: 100%;\">Tremors in the hands, Weakness, Diarrhea (sometimes)</li>\r\n<li style=\"text-size-adjust: 100%;\">Light sensitivity, visual disturbances,</li>\r\n<li style=\"text-size-adjust: 100%;\">The eyes may be affected: puffiness around the eyes, dryness, irritation, and, in some cases, bulging of the eyes.</li>\r\n</ul>\r\nFree or total T3 may sometimes be ordered at intervals to monitor a known&nbsp;thyroid condition&nbsp;and to help monitor the effectiveness of treatment for hyperthyroidism.<br />&nbsp;<br /><a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://www.newcenturylabs.com/product/t4-free\" target=\"_blank\" rel=\"noopener\"><strong>T4 Free</strong></a><br />Thyroxine (T4) is one of two major&nbsp;hormones&nbsp;produced by the thyroid gland, a small butterfly-shaped organ that lies flat across the windpipe at the base of the throat. The other major thyroid hormone is called&nbsp;triiodothyronine (T3)&nbsp;and together they help control the rate at which the body uses energy. Almost all of the T4 (and T3) found in the blood is bound to protein. The rest is free (unbound) and is the biologically active form of the hormone. This test measures the amount of free T4 in the blood.<br />&nbsp;<br />Ordered when you have the following concerns:<br />Signs&nbsp;and&nbsp;symptoms&nbsp;may include:\r\n<ul>\r\n<li style=\"text-size-adjust: 100%;\">Increased heart rate, Anxiety, Weight loss, Difficulty sleeping, Tremors in the hands, Weakness, Diarrhea (sometimes), Light sensitivity, visual disturbances</li>\r\n<li style=\"text-size-adjust: 100%;\">The eyes may be affected: puffiness around the eyes, dryness, irritation, and, in some cases, bulging of the eyes.</li>\r\n</ul>\r\nSymptoms of hypothyroidism may include:\r\n<ul>\r\n<li style=\"text-size-adjust: 100%;\">Weight gain, Dry skin, Constipation, Cold intolerance, Puffy skin, Hair loss</li>\r\n<li style=\"text-size-adjust: 100%;\">Fatigue, Menstrual irregularity in women, Enlarged thyroid gland (goiter)</li>\r\n</ul>\r\nFree T4 testing may be ordered along with other thyroid tests on a regular basis when a person is undergoing treatment for a&nbsp;thyroid disorder.<br />&nbsp;<br /><span style=\"color: #ff0000;\"><a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://www.newcenturylabs.com/product/testosterone-total-males-adult\" target=\"_blank\" rel=\"noopener\"><strong>Testosterone Male</strong></a><br /><a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://www.newcenturylabs.com/product/testosterone-total-females\" target=\"_blank\" rel=\"noopener\"><strong>Testosterone Female</strong></a><br />&nbsp;</span><br />Testosterone is the main sex hormone (androgen) in men. It is responsible for male physical characteristics. Although it is considered to be a \"male\" sex hormone, it is present in the blood of both men and women. This test measures the level of testosterone in the blood.<br />Testosterone is mainly produced by special&nbsp;endocrine&nbsp;tissue (the Leydig cells) in the male testicles. It is also produced by the&nbsp;adrenal glands in both males and females and, in small amounts, by the ovaries in females.<br />In males, testosterone stimulates development of secondary sex characteristics, including enlargement of the penis, growth of body hair, muscle development, and a deepening voice. It is present in large amounts in males during puberty and in adult males to regulate the sex drive and maintain muscle mass. In women, testosterone is converted to estradiol, the main sex hormone in females.<br />Ordered when decreased sex drive or&nbsp;erectile dysfunction. Some other symptoms include lack of beard and body hair, decreased muscle mass, and development of breast tissue (gynecomastia). Low levels of total and bioavailable testosterone have also been associated with, or caused by, a greater presence of visceral fat (midriff or organ fat),&nbsp;insulin resistance, and increased risk of&nbsp;coronary artery disease.<br />&nbsp;<br /><a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://www.newcenturylabs.com/product/DHEA-Sulfate-Blood-Test\" target=\"_blank\" rel=\"noopener\"><strong>DHEAS</strong></a><br /><br />Dehydroepiandrosterone sulfate (DHEAS) is a male sex hormone (androgen) that is present in both men and women. This test measures the level of DHEAS in the blood.<br />DHEAS:\r\n<ul>\r\n<li style=\"text-size-adjust: 100%;\">Plays a role in developing male secondary sexual characteristics at puberty</li>\r\n<li style=\"text-size-adjust: 100%;\">Can be converted by the body into more potent androgens, such as&nbsp;testosterone&nbsp;and&nbsp;androstenedione</li>\r\n<li style=\"text-size-adjust: 100%;\">Can be converted into the female hormone&nbsp;estrogen<br />&nbsp;</li>\r\n</ul>\r\nDHEAS is produced almost exclusively by the&nbsp;adrenal glands, with smaller amounts being produced by a woman\'s ovaries and a man\'s testicles.<br />It is useful as a marker for adrenal gland function. Adrenal tumors (cancerous and non-cancerous) and adrenal&nbsp;hyperplasia&nbsp;can lead to the overproduction of DHEAS. Rarely, an ovarian tumor may produce DHEAS.<br />Excess DHEAS:\r\n<ul>\r\n<li style=\"text-size-adjust: 100%;\">May not be noticed in adult men</li>\r\n<li style=\"text-size-adjust: 100%;\">Can cause early (precocious) puberty in young boys</li>\r\n<li style=\"text-size-adjust: 100%;\">Can lead to absence of menstrual periods (amenorrhea) and the development of masculine physical characteristics (virilization) in girls and women, such as excess body and facial hair (hirsutism)</li>\r\n<li style=\"text-size-adjust: 100%;\">Can cause a female baby to be born with genitals that are not distinctly male or female in appearance (ambiguous external genitalia)<br />&nbsp;</li>\r\n</ul>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">This test is ordered when<br />A DHEAS test may be ordered, along with other hormone tests, whenever excess (or, more rarely, deficient)&nbsp;androgen&nbsp;production is suspected and/or when a health practitioner wants to evaluate a person\'s&nbsp;adrenal gland&nbsp;function.<br />&nbsp;<br /><a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://www.newcenturylabs.com/product/cortisol-am\" target=\"_blank\" rel=\"noopener\"><strong>Cortisol AM</strong></a><br /><a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://www.newcenturylabs.com/product/cortisol-pm\" target=\"_blank\" rel=\"noopener\"><strong>Cortisol PM&nbsp;</strong></a><br /><br />Cortisol is a&nbsp;hormone&nbsp;that plays a role in the&nbsp;metabolism&nbsp;of&nbsp;proteins,&nbsp;lipids, and&nbsp;carbohydrates. It affects&nbsp;blood glucose levels, helps maintain blood pressure, and helps regulate the&nbsp;immune system. Most cortisol in the blood is bound to a protein; only a small percentage is \"free\" and biologically active. Free cortisol is secreted into the urine and is present in the saliva. This test measures the amount of cortisol in the blood, urine, or saliva.<br />The level of cortisol in the blood (as well as the urine and saliva) normally rises and falls in a \"diurnal variation\" pattern. It peaks early in the morning, then declines throughout the day, reaching its lowest level about midnight. This pattern can change when a person works irregular shifts (such as the night shift) and sleeps at different times of the day, and it can become disrupted when a disease or condition either limits or stimulates cortisol production.<br />&nbsp;</p>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">Don\'t Just Think You\'re Healthy, Know You\'re Healthy&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\6kolsmNbvJgoPS3vPO3y.jpg','hormone-balance-blood-tests','Hormones have a lot of authority. They are the little chemicals that tell your body just right down to the cell what to do and how to do it. And the reality is, there are many other hormones in our body, if not balanced, that can have an influence on your','Blood tests, lipid panel, Estradiol, Testosterone, TSH, C-Reactive Protein, Homocysteine, PSA, CBC, CMP, DHEA , A1C, Hemoglobin , Fibrinogen, hormone balance, thyroid','PUBLISHED',0,'2018-03-07 02:15:37','2021-01-20 06:23:14'),(19,2,6,'Blood Testing Before Supplementing','High doses of supplementation and unknown ingredients can cause liver and nerve damage.','High doses of supplementation and unknown ingredients can cause liver and nerve damage.','<table style=\"border-collapse: collapse; text-size-adjust: 100%; font-family: Helvetica, Arial, sans-serif;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td id=\"templateBody\" style=\"text-size-adjust: 100%; background-image: none; background-position: 50% 50%; background-size: cover; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; border-top: 0px; border-bottom: 0px; padding-top: 27px; padding-bottom: 54px;\" align=\"center\" valign=\"top\" data-template-container=\"\">\r\n<table class=\"templateContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 600px !important; width: 600px !important;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td class=\"bodyContainer\" style=\"text-size-adjust: 100%; background: none center center / cover no-repeat transparent; border-top: 0px; border-bottom: 0px; padding-top: 0px; padding-bottom: 0px;\" valign=\"top\">\r\n<table class=\"mcnTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n<h1 style=\"margin: 0px; padding: 0px; color: #222222; font-size: 40px; font-weight: bold; line-height: 60px; text-align: center;\">Nutritional deficencies and risk to disease can be detected with 1 drop of blood&nbsp;</h1>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; table-layout: fixed !important; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n<tr>\r\n<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px 18px 0px;\">\r\n<table class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnImageBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnImageBlockOuter\">\r\n<tr>\r\n<td class=\"mcnImageBlockInner\" style=\"text-size-adjust: 100%; padding: 9px;\" valign=\"top\">\r\n<table class=\"mcnImageContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnImageContent\" style=\"text-size-adjust: 100%; padding: 0px 9px; text-align: center;\" valign=\"top\"><img class=\"mcnImage\" style=\"border: 0px; height: auto; outline: none; vertical-align: bottom; max-width: 703px; padding-bottom: 0px; display: inline !important;\" src=\"https://gallery.mailchimp.com/c02fa6ffaafa52cd898c2c956/images/19ccf59a-593d-4692-8969-7b804fc2fbca.jpg\" alt=\"\" width=\"564\" align=\"center\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">Have you ever read online that taking a certain type of nutritional supplement would be that Holy Grail to better health?<br />While there may be some truth to it, we may&nbsp; causing toxicity in our blood levels; high doses of supplementation and unknown ingredients can cause liver&nbsp;and nerve damage. Taking a supplement just because it&rsquo;s trendy and you read about it online can actually be very harmful to your body. Putting too much fuel in your car, too much oil in your engine, or even too much air in your tires can cause major malfunctions. Just like our bodies can be like a car we need to have the right amount of minerals and nutrients to produce optimal performance, both mentally and physically, but taking too much of it can be harmful.<br /><br />According to&nbsp;<a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=233ac09f4f&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\">Pew Research</a>&nbsp;&nbsp;80% of internet users have looked online for information about at least one concerning healthcare related topics, from disease prevention, to depression, and supplements. Most frequently people went online to look up information about a specific disease or medical problem (63%) or a particular medical treatment or procedure (47%). They were also interested in diet, nutrition and vitamins (44%) and exercise or fitness information (36%).<br />Other popular health topics include: prescription or over-the-counter drugs and supplementation (34%); alternative treatments (28 percent); health insurance (25%); depression, anxiety or stress (21%) and a particular doctor or hospital (21%).<br />&nbsp;<br /><strong><a style=\"text-size-adjust: 100%; color: #00add8; font-weight: normal;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=28ed003a7d&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\">Vitamin D</a>,&nbsp;<a style=\"text-size-adjust: 100%; color: #00add8; font-weight: normal;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=30a446df66&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\">Vitamin B12</a>,&nbsp;<a style=\"text-size-adjust: 100%; color: #00add8; font-weight: normal;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=c3e136bc06&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\">Omega 3 and 6 fatty acids</a>&nbsp;<a style=\"text-size-adjust: 100%; color: #00add8; font-weight: normal;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=726a16817a&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\">Hemoglobin A1c</a>,&nbsp;<a style=\"text-size-adjust: 100%; color: #00add8; font-weight: normal;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=0a4bd4828f&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\">TSH</a>,&nbsp;<a style=\"text-size-adjust: 100%; color: #00add8; font-weight: normal;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=1ba5331e1b&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\">T4</a>,&nbsp;<a style=\"text-size-adjust: 100%; color: #00add8; font-weight: normal;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=6f93208bdb&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\">T3&nbsp;</a></strong>can help you and your doctors determine your safe dose of vitamin supplementation, confirm diabetes, and check for thyroid function, mental health concerns, and heart disease prevention. The right type of minerals and nutrients can have a tremendous impact on your health from reversing diabetes to achieving optimal thyroid function just to title a few.<br />&nbsp;<br /><a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=7750c5f337&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\"><strong>Vitamin D Benefits:</strong></a><br />Improves mood and hormone balance, helps with bone and connective tissues, Improves immune system function.<br /><br /><em>Reference Range(s)</em><br />30-100 ng/mL<br />&nbsp;&nbsp;<br />&nbsp;<br />&nbsp;<br /><a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=0ba438460a&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\"><strong>B12: Benefits</strong>:</a><br />Keeps the body&rsquo;s nerves and blood cells healthy, helps with mood and mental depression disorders in addition to chronic stress. Helps with mental focus and clarity, helps with heart health, and optimal physical performance.<br /><em>Reference Range(s)</em></p>\r\n<table style=\"border-collapse: collapse; text-size-adjust: 100%; width: 225px;\" border=\"0\" summary=\"\" width=\"225\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&le;4 Years</td>\r\n<td style=\"text-size-adjust: 100%;\">Not established</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">5-9 Years</td>\r\n<td style=\"text-size-adjust: 100%;\">250-1205 pg/mL</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">10-17 Years</td>\r\n<td style=\"text-size-adjust: 100%;\">260-935 pg/mL</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&gt;17 Years</td>\r\n<td style=\"text-size-adjust: 100%;\">200-1100 pg/mL</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h4 style=\"margin: 0px; padding: 0px; color: #999999; font-family: Georgia; font-size: 20px; font-style: italic; line-height: 25px;\">&nbsp;</h4>\r\n<a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=85fbf10075&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\"><strong>Omega 3-6 Fatty Acids Benefits:</strong></a><br />Fish oil also has an incredible impact on the&nbsp;brain, especially when it comes to memory loss and depression. Reduces high blood pressure, promotes strong heart health, and helps treat arthritis.<br /><em>Reference Range(s)</em>\r\n<table style=\"border-collapse: collapse; text-size-adjust: 100%; width: 275px;\" border=\"0\" summary=\"\" width=\"275\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\"><strong>Omega-3 (EPA+DHA) Index</strong></td>\r\n<td style=\"text-size-adjust: 100%;\">1.4-4.9 %</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\"><strong>Risk</strong></td>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp; Optimal</td>\r\n<td style=\"text-size-adjust: 100%;\">&gt;3.2 %</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp; Moderate</td>\r\n<td style=\"text-size-adjust: 100%;\">2.2-3.2 %</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp; High</td>\r\n<td style=\"text-size-adjust: 100%;\">&lt;2.2 %</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\"><strong>Omega-6/Omega-3 Ratio</strong></td>\r\n<td style=\"text-size-adjust: 100%;\">5.7-21.3</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\"><strong>EPA/Arachidonic Acid Ratio</strong></td>\r\n<td style=\"text-size-adjust: 100%;\">&le;0.2</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\"><strong>Arachidonic Acid</strong></td>\r\n<td style=\"text-size-adjust: 100%;\">5.2-12.9 %</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\"><strong>EPA</strong></td>\r\n<td style=\"text-size-adjust: 100%;\">0.2-1.5 %</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\"><strong>DHA</strong></td>\r\n<td style=\"text-size-adjust: 100%;\">1.2-3.9 %</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;<br /><a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=cd7d8998ee&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\"><strong>Hemoglobin A1C&nbsp; Benefits</strong></a><br />This blood test is used to diagnose diabetes and pre diabetes. Over 90 Million Americans are pre diabetic and don&rsquo;t even know it. This test will essentially tell you what your blood sugars have been, on average, for the past 90 days or so. The right supplementation and nutrients can potentially reverse type 2 diabetes.\r\n<h4 style=\"margin: 0px; padding: 0px; color: #999999; font-family: Georgia; font-size: 20px; font-style: italic; line-height: 25px;\">Reference Range(s)</h4>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">&lt;5.7 % of total hemoglobin<br />&nbsp;<br />&nbsp;<br />&nbsp;<br /><a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=3d70fd3de6&amp;e=b2ecb58087\" target=\"_blank\" rel=\"noopener\"><strong>TSH, T3, T4, Benefits:</strong></a><br />&nbsp;In the front of the neck, the thyroid gland surrounding the voice box or larynx, produces important hormones which are vital to metabolism and growth. Abnormal levels can be linked to cancer and heart disease as well as death if not treated. Taking a full thyroid function test can potentially confirm meta_descriptiongishness, chronic fatigue, weight gain, and weight loss.<br />&nbsp;<br />These simple blood tests can go a long way to confirm disorders in nutrition deficiency and potentially chronic illnesses by blood testing before supplementing.<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Know your baseline then take action!<br /><strong>&nbsp; &nbsp