 font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\"><span style=\"font-size: 41px;\"><strong><span style=\"color: #ff0000;\">&nbsp;&nbsp;<a style=\"text-size-adjust: 100%; color: #00add8; font-weight: normal;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=669ce83871&amp;e=7ebc60f9f5\" target=\"_blank\" rel=\"noopener\">Hemoglobin A1c Blood Test</a></span><span style=\"color: #ff0000;\">&nbsp;&nbsp;</span></strong></span></p>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\"><strong>2017 Facts&nbsp;</strong><br />According to the&nbsp;<a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=d3e984cfdc&amp;e=7ebc60f9f5\" target=\"_blank\" rel=\"noopener\">CDC&nbsp;</a>, 9.4 Million Americans have diabetes, that\'s 30.3 Million Americans who have taken the A1c Blood tests and have been confirmed diabetic. According to Quest Diagnostics a confirmed diabetic is consistent with Hemoglobin A1c levels at&nbsp;<strong>&gt;or=6.5%&nbsp;</strong>&nbsp;<br />Pre Diabetes in the United states according to the CDC&nbsp;is at a whopping 100 Million Americans, that\'s 30.7% of the entire US Population! And according to Quest Diagnostics you are pre-diabetic when your A1c Levels hit&nbsp;<strong>&gt; or&nbsp;5.7-6.4%.<br /><br />Bad News</strong><br />Once pre-diabetic levels occurs its very easy to reach confirmed diabetic levels.&nbsp;<br />Once pre-diabetes is present, the path to disease can be significantly systemic to your health. Related diseases are much more probable to start forming.This is called&nbsp;&nbsp;Metabolic Syndrome, &nbsp;the title for a group of risk factors that raises your risk for&nbsp;Heart Disease,&nbsp;Diabetes, stroke, obesity, and other diseases known in America as leading causes of Death. For example 1.5 Million heart attacks and strokes happen in the United States each year according to the CDC-- 800,000 of which are heart related.<br /><br /><strong>Being Proactive</strong><br />Ordering a&nbsp;<a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=b67b2b38e3&amp;e=7ebc60f9f5\" target=\"_blank\" rel=\"noopener\">Hemoglobin A1c</a>&nbsp;along with a Glucose test can help your doctor come up with your baseline health results to help you&nbsp;come&nbsp;up with a solid game plan to reverse or prevent diabetes.&nbsp;<br />Ordering the Hemoglobin A1c blood test is easy to access and cheap when you order it through&nbsp;<a style=\"text-size-adjust: 100%; color: #00add8;\" href=\"https://newcenturylabs.us15.list-manage.com/track/click?u=c02fa6ffaafa52cd898c2c956&amp;id=1fe0276f24&amp;e=7ebc60f9f5\" target=\"_blank\" rel=\"noopener\">New Century Labs</a>. Results take only 72 hours and you instantly can be made aware of any changes you need to make in your life from a better diet to exercising more frequently-- the bright side is:&nbsp;<strong>ITS REVERSIBLE</strong>&nbsp; if caught early!<br /><br /><span style=\"font-size: 24px;\">\"70-80 of All Clinical Decisions Come From 1 Single Drop of Blood.....\"&nbsp;</span><br /><em>\"Quest Diagnostics\"</em>&nbsp;&nbsp;&nbsp;&nbsp;<br /><br />Disease happens before any symptoms appear and with access at your disposal, you have no excuse to not be proactive about your own healthcare.<br /><br />\"We look forward to serving you\"<br />New Century Labs team</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; table-layout: fixed !important; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody