: 0px; padding-top: 0px; padding-bottom: 0px;\" valign=\"top\">\r\n<table class=\"mcnTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n<h1 style=\"margin: 0px; padding: 0px; color: #222222; font-size: 40px; font-weight: bold; line-height: 60px; text-align: center;\">Vitamin D The Brain and YOU<br />&nbsp;</h1>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; table-layout: fixed !important; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n<tr>\r\n<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px 18px 0px;\">\r\n<table class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnImageBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnImageBlockOuter\">\r\n<tr>\r\n<td class=\"mcnImageBlockInner\" style=\"text-size-adjust: 100%; padding: 9px;\" valign=\"top\">\r\n<table class=\"mcnImageContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnImageContent\" style=\"text-size-adjust: 100%; padding: 0px 9px; text-align: center;\" valign=\"top\"><img class=\"mcnImage\" style=\"border: 0px; height: auto; outline: none; vertical-align: bottom; max-width: 1000px; padding-bottom: 0px; display: inline !important;\" src=\"https://gallery.mailchimp.com/c02fa6ffaafa52cd898c2c956/images/0244bbd3-d931-4f66-8f12-61ac604ed244.jpg\" alt=\"\" width=\"564\" align=\"center\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\"><strong>What is Vitamin D</strong><br />Vitamin D is mostly produced in the skin when sunlight touches our skin, also when it&rsquo;s absorbed&nbsp;from eating food, (only a small percentage of vitamin D is&nbsp;absorbed&nbsp;by food) as part of a healthy balanced diet.The liver and&nbsp;kidneys&nbsp;convert the vitamin D&nbsp; into the active hormone, which is called&nbsp;<strong>calcitriol</strong>, which is a steroid&nbsp;hormone&nbsp;that has long been known for its important role in regulating body levels of calcium and phosphorus, and in mineralization of bone.&nbsp;Active vitamin D helps to increase the amount of calcium the gut can&nbsp;absorb&nbsp;from food into the bloodstream and also prevents calcium.&nbsp;Vitamin D modifies the activity of bone cells and is important for the formation of new bone in children and adults.<br /><br />And yes we&rsquo;ve all been told that vitamin D is essential to maintain strong healthy bones and the best way to get vitamin D is sunlight. We all get a little envious of those who live in sunny regions, but even though sun can be abundant in some locations, it doesn&rsquo;t mean that your skin will produce vitamin D in 80 degree temperature.In fact some of the sunniest countries in the world such as Saudi Arabia has a vitamin D deficiency crisis.&nbsp;&nbsp;<br /><br />Now many things need to happen, first and foremost you need to take your clothes off. Yes that&rsquo;s right bathing suit and all where the sun is penetrating directly to your skin, and the recommended amount is 30 minutes daily of direct sunlight. Wearing clothing in the sun will not help your skin to absorb Vitamin D, and neither will putting sunscreen on, but we won&rsquo;t get into the sunscreen debate in this blog. Not everyone however will get the opportunity to live like their vacationing in Mexico every day, so this is why we suggest looking into vitamin D 3 supplementation after determining what your vitamin D blood test levels are. According to Quest Diagnostics the recommend reference range is:&nbsp;<strong>30-100 ng/mL</strong>.&nbsp; However over 50% of the US population is less than the normal reference ranges.<br />&nbsp;<br /><strong>Vitamin D and the Brain</strong><br />There actually may be a link between Vitamin D deficiency and mood disorders which lays between the neurotransmitters&nbsp;<strong>Serotonin</strong>. Our serotonin neurotransmitters is responsible for us having a sense of well being. In other words for us feeling calm, cool,&nbsp;and collected.<br />Let&rsquo;s take a look at serotonin really quick. It&rsquo;s the job of serotonin to help us feel good. The process of creating serotonin in the body is pretty interesting. It comes down to a chemical call&nbsp;<strong>tryptophan</strong>. What tryptophan is, is an amino acid and those amino acids are derived from proteins that we consume.&nbsp;And when we consume those proteins we generally require carbohydrates to allow the tryptophan to enter into the brain.&nbsp;What researchers are now finding is that Vitamin D could be a critical component in that conversion process.&nbsp;So essentially you eat your protein, get your tryptophan, then vitamin D comes in and assists in the creation of serotonin. This is right at the very&nbsp;root of creating the neurotransmitters that helps us feel good.<br />Researchers are continuing to back up the fact that everything seems to be connected in what&rsquo;s called&nbsp;<strong>Monoamine</strong>. The Monoamine system &nbsp;are a group of neurotransmitters including serotonin, dopamine and, norepinephrine, all 3 neurotransmitters that truly regulate how the brain operates when it comes to feeling good.<br /><br /><strong>Vitamin D 3&nbsp;</strong><br />If we include Vitamin D 3 in our supplementation agenda daily we could see a better creation of monoamine firing up on all cylinders in our body, hence making us feel great.<br />There are multiple studies that back up the correlation between vitamin D deficiency and depression, vitamin D deficiency and anxiety, and even vitamin D deficiency and suicide;&nbsp;&nbsp;in addition, to the link between vitamin D deficiency and the development of schizophrenia. This has&nbsp;been researched among patients of all ages around the globe. One meta-analysis reviewed 19 studies published between 1988 and 2013 and found a strong association between vitamin D deficiency and schizophrenia. Of the 2,804 participants from these studies, over 65% of the participants with schizophrenia were vitamin D deficient. Vitamin D deficient participants were 2.16 times more likely to have schizophrenia than vitamin D sufficient participants (Valipour, Saneei, &amp; Esmaillzadeh, 2014).<br /><br />Simply said Vitamin D it&rsquo;s no more than a&nbsp;pro hormone that activates various functions that create other functions in the body to help you feel your best by increasing your energy and mood levels, helping your immune system become stronger, fighting off cardiovascular disease and even helping to eliminate diabetes.<br />New Century labs does not promote any vitamin companies however we do promote blood testing before any supplementation and showing your doctor your blood test results&nbsp; to ensure you get the&nbsp;&nbsp;proper dosage and then to blood test again several months later to track your levels.<br />This can all be done by ordering your Vitamin D 25 Hydroxy blood test</p>\r\n<table class=\"mcnButtonBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000; font-family: \'Times New Roman\'; font-size: medium; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnButtonBlockOuter\">\r\n<tr>\r\n<td class=\"mcnButtonBlockInner\" style=\"text-size-adjust: 100%; padding: 0px 18px 18px;\" align=\"center\" valign=\"top\">\r\n<table class=\"mcnButtonContentContainer\" style=\"text-size-adjust: 100%; border-radius: 3px; background-color: #00add8;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnButtonContent\" style=\"text-size-adjust: 100%; font-family: Helvetica; font-size: 18px; padding: 18px;\" align=\"center\" valign=\"middle\"><a class=\"mcnButton \" style=\"text-size-adjust: 100%; display: block; font-weight: bold; letter-spacing: -0.5px; line-height: 18px; text-decoration-line: none; color: #ffffff;\" title=\"Check Your Vitamin D Levels \" href=\"https://www.newcenturylabs.com/product/vitamin-d-25-hydroxy\" target=\"_blank\" rel=\"noopener\">Check Your Vitamin D Levels</a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000; font-family: \'Times New Roman\'; font-size: medium; min-width: 100%; table-layout: fixed !important;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n<tr>\r\n<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px 18px 0px;\">\r\n<table class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\"><br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<em><strong>&nbsp;Don\'t Just Think You\'re Healthy, Know You\'re Healthy&nbsp;</strong></em></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','posts\\January2021\\X8V7vW95nqJ2CLH9iTiW.jpg','vitamin-D-Blood-Levels','Vitamin D it’s no more than a pro hormone that activates various functions that create other functions in the body to help you feel your best by increasing your energy and mood levels, helping your immune system become stronger, fighting off cardiovascula','Vitamin D, Blood Testing, Blood Test, Direct-to-Consumer, Hormone Balance','PUBLISHED',0,'2018-10-29 10:00:20','2021-01-20 06:22:10'),(22,2,6,'The Rise in STD’s From Online Dating','With the popularly and accessibility of dating apps comes with the risks of accessing STD’s.','With the popularly and accessibility of dating apps comes with the risks of accessing STD’s.','<table class=\"mcnTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n<h2 style=\"margin: 0px; padding: 0px; color: #222222; font-size: 28px; font-weight: bold; line-height: 42px;\">The Rise in STD&rsquo;s From Online Dating&nbsp;<br />&nbsp;</h2>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 27px; font-size: 18px !important;\">Remember when it was considered normal to approach someone you wanted to get to know at the grocery store, or gym, with the intention to ask them out on a date? Nowadays this act is considered &ldquo;creepy&rdquo; not customary, and replaced by dating apps such as: Tinder, Bumble, Match, OkCupid and Grinder, just to title a few. These apps have&nbsp;an average user base in the United States by over 30M members,&nbsp;that&rsquo;s under 10% of the total US population who use dating apps&mdash;yay for qualitative and quantitative analysis&mdash;kidding kidding..<br />We often accredit technology to make resources accessible, quicker, convenient, and on demand. As&nbsp;for dating apps, accessibility and access to what\'s considered and utilized as \"customary,\" for &ldquo;hooking up&rdquo; &ldquo;one-night-stands&rdquo; and simply fly-by-night romance, is now the NORM. Not in every situation; in fact, there have been relationship success stories that can lead to marriage with additional data stating that over 30% of people searching for a partner typically meets online. Those days of feeling embarrassed to confessing to your family and friends you met someone online are over--fewwwww.<br />&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnCaptionBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnCaptionBlockOuter\">\r\n<tr>\r\n<td class=\"mcnCaptionBlockInner\" style=\"text-size-adjust: 100%; padding: 9px;\" valign=\"top\">\r\n<table class=\"mcnCaptionBottomContent\" style=\"border-collapse: collapse; text-size-adjust: 100%;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnCaptionBottomImageContent\" style=\"text-size-adjust: 100%; padding: 0px 9px 9px;\" align=\"center\" valign=\"top\"><img class=\"mcnImage\" style=\"border: 0px; height: auto; outline: none; vertical-align: bottom; max-width: 667px;\" src=\"https://gallery.mailchimp.com/c02fa6ffaafa52cd898c2c956/images/9f436bc8-3bb3-467d-80fd-5aa111d88346.png\" alt=\"\" width=\"564\" /></td>\r\n</tr>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 9px;\" valign=\"top\" width=\"564\">\r\n<h3 style=\"margin: 0px; padding: 0px; color: #444444; font-size: 22px; font-weight: bold; line-height: 33px;\">Swipe Right at Your Own Risk&nbsp;</h3>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\">According to the CDC, about 30,000 new HIV infections occur every year; often times HIV can be symptomless for years or feeling like you have the case of the flu.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n<tr>\r\n<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px;\">\r\n<table class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnDividerBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n<tr>\r\n<td class=\"mcnDividerBlockInner\" style=\"text-size-adjust: 100%; min-width: 100%; padding: 18px;\">\r\n<table class=\"mcnDividerContent\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-size-adjust: 100%;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n<h2 style=\"margin: 0px; padding: 0px; color: #222222; font-size: 28px; font-weight: bold; line-height: 42px;\"><strong>What your partner isn&rsquo;t telling you on Tinder</strong></h2>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 27px; font-size: 18px !important;\">With the popularly and accessibility of dating apps comes with the risks of accessing STD&rsquo;s. In fact, STD&rsquo;s are on the rise and spreading at a rapid rate. In one study researchers at the University of Minnesota were looking at the link between&nbsp;<strong>Craigslist personal ads and HIV</strong>, and identified an increase in HIV cases in 33 states between 1999 and 2008 &mdash; and determined that the advent of Craigslist alone contributed to a 16 percent increase in cases. In Nevada, a&nbsp;<strong>record number of syphilis cases</strong>&nbsp;last year were attributed to the &ldquo;rise in anonymous sex via social media. The California state health department is increasingly hearing that people with STDs met their partners on sites like Tinder, Bumble, and Grinder. There is no doubt that apps are spreading STD&rsquo;s all over the United States, such as Gonorrhea, Syphilis, Herpes, HPV, and even HIV. &nbsp;In fact there are 1.1M Americans living with HIV, and of those infected people, 1 in 7 Americans have HIV and don&rsquo;t even know they\'re infected. Yes, that one person you may have swiped right on that you plan on dating tomorrow. &nbsp;<br />&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n<h2 style=\"margin: 0px; padding: 0px; color: #222222; font-size: 28px; font-weight: bold; line-height: 42px;\"><strong>Case and Point&nbsp;</strong></h2>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 27px; font-size: 18px !important;\">Popular dating sites such as Tinder and Bumble don&rsquo;t really do a good job educating the public on STI prevention, rather it&rsquo;s the individuals own intuition and gut feelings to determine safety; who really thinks all that clear in the heat of the moment. New Century Labs promotes blood testing for folks who are sexually active who, engage&nbsp;in the world of online dating. We&nbsp;encourage&nbsp; you to talk to your partner(s) to test their blood for STD&rsquo;s, including HIV&mdash;just 1 blood test can save your health.<br />One of our customers who we will call Jane Doe called to express her fanatical experience with us about a man she had met on one of the mainstream dating sites, which we wont mention, where one of her conditions before she had an intimate relationship with him was to order STD tests and to share his results with her. Much to the gentlemen&rsquo;s dismay he tested positive on various STD&rsquo;s. Jane Doe was relived, saved, and empowered to have such awareness. Not everyone is like Jane Doe, and not everyone knows you can order your own blood tests online&mdash;we believe this type of access should be the duty of popular dating sites to help inform their audience.&nbsp;<br /><strong>Symptoms and Facts</strong><br />According to the CDC, about 30,000 new HIV infections occur every year; often times HIV can be symptomless for years or feeling like you have the case of the flu. Just because you have the case of the flu doesn&rsquo;t mean you have HIV. However with dating apps comes with higher risks of getting infected.<br />Every year there are over 2M Americans with cases of gonorrhea and Syphilis which&nbsp;are the most common and treatable STD&rsquo;s, with long term health problems if not caught early. Symptoms&nbsp;include&nbsp;fever,&nbsp;chills,&nbsp;skin sores, and&nbsp;pain&nbsp;in the&nbsp;wrists,&nbsp;fingers,&nbsp;knees, or&nbsp;toes. Gonorrhea: Asexually transmitted infection&nbsp;that may lead to&nbsp;pelvic inflammatory disease,&nbsp;infertility, and&nbsp;arthritis.<br />According to the CDC about 25% of women have&nbsp;<strong>genital herpes</strong>&nbsp;and 10% males.&nbsp;This does not include oral herpes and nearly 80% of sexually active people will contract HPV in some point in their lives.<br />Over all 1 in 2 people will contract some form of STD by the time they are 25 years old costing our US healthcare system over $16B dollars.<br /><strong>Getting Tested</strong><br />Our company slogan means what is said:&nbsp;&ldquo;Don&rsquo;t Just Think You&rsquo;re Healthy, Know You&rsquo;re Healthy.&rdquo;&nbsp; This is truly a lifestyle- our employees and customers&nbsp; truly live by this mindset, as we want to share access to STD testing and awareness to all who plan on being sexually active on dating sites. Don&rsquo;t feel shy to request your partner to get tested, as this could save your health and the health of others.<br />We know that getting blood tests is a daunting task traditionally. Let&rsquo;s face it you were raised to call your doctor&rsquo;s office, make an appointment that could take weeks, confess to your doctor all those uncomfortable conversations.<br />With access to ordering STD blood tests on demand, on your terms at NewCentslugabs.com, we believe you will be much more motivated to order your STD tests, so you can have a meaningful conversation with your doctor, and your partner about the state of your health.<br /><br /><strong>Spread the love by not spreading diseases.</strong><br />&nbsp;<br />&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnTextBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #808080; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnButtonBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; color: #000000;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnButtonBlockOuter\">\r\n<tr>\r\n<td class=\"mcnButtonBlockInner\" style=\"text-size-adjust: 100%; padding: 0px 18px 18px;\" align=\"center\" valign=\"top\">\r\n<table class=\"mcnButtonContentContainer\" style=\"te