ext-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"text-size-adjust: 100%; padding-top: 9px;\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" style=\"border-collapse: collapse; text-size-adjust: 100%; max-width: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"text-size-adjust: 100%; word-break: break-word; color: #202020; font-family: Helvetica; font-size: 16px; line-height: 24px; padding: 0px 18px 9px;\" valign=\"top\">\r\n<h1 style=\"margin: 0px; padding: 0px; font-size: 26px; font-weight: bold; line-height: 32.5px;\"><span style=\"font-family: arial, \'helvetica neue\', helvetica, sans-serif;\"><span style=\"font-size: 20px;\">Guiding You Through Your Complete Metabolic Panel</span></span></h1>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\"><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">If you are concerned about the following diseases: Bone Disease Acid, Base, Water Balance Cancer Diabetes Endocrine Disorders Heart Disease Iron Deficiency, Excess Kidney Disease Liver Disease, the CMP is one of the best test to help your doctor identify your health risks. The CMP is only $14.00, the lowest cost in the United States to access online on demand, and final results are available in just 24 hours or less after your blood draw.</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">Depending on the results, your doctor will be able to dive deeper on specifics. And depending on the reference range (below normal, or above normal range) he/she will order additional testing. Please see our Clinical Utility&nbsp;Guide below at the bottom of the page.</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;</span><strong style=\"font-family: arial, \'helvetica neue\', helvetica, sans-serif;\">Basics of the CMP&nbsp;</strong><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">The CMP, or Comprehensive Metabolic Panel, consists of the following: Albumin, Albumin/Globulin Ratio (calculated), Alkaline Phosphatase, ALT, AST, BUN/Creatinine Ratio (calculated), Calcium, Carbon Dioxide, Chloride, Creatinine with&nbsp;GFR Estimated, Globulin (calculated), Glucose, Potassium, Sodium, Total Bilirubin, Total Protein, Urea Nitrogen</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;It gives an indication of an individual&rsquo;s metabolism, kidney and liver health, electrolyte and acid/base balance, and levels of blood glucose and blood proteins. It is possible that you have an elevated test value that needs to be addressed, and you are not aware of it, some of which are considered critical values. For example, if your potassium is abnormal, you may need to go to the ER. There could be less critical values at abnormal levels which need attention if left untreated, such as higher than normal glucose levels. Roughly 10 percent of the U.S. population has diabetes. This condition can result in blindness, heart disease, stroke, kidney damage, and nerve damage if left untreated. With a simple blood test standing between you and these potentially serious medical complications, there&rsquo;s no reason not to get your blood tested.&nbsp;</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">If you drink alcohol you may want to check your kidney and liver function and the CMP test is a good indicator test for this purpose.</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">The CMP also includes a calcium test which ensures that there&rsquo;s enough of the mineral for proper functioning muscles, nerves, and the heart. Calcium is required to form bones and clot blood. Furthermore, the panels look for certain proteins and electrolytes as well as kidney and liver functions to ensure there proper functioning and little damage.</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;&nbsp;</span><br /><strong style=\"font-family: arial, \'helvetica neue\', helvetica, sans-serif;\">Why get tested&nbsp;</strong><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">Whether you&rsquo;re reading this with specific symptoms in mind or you just want to be smart about your health and wellness moving forward, it&rsquo;s never a bad idea to get tested. If you&rsquo;re cautious, these statistics may change your mind.</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;</span></p>\r\n<ul>\r\n<li style=\"text-size-adjust: 100%;\"><span style=\"font-family: arial, \'helvetica neue\', helvetica, sans-serif;\">Medical decisions are&nbsp;made up by about 70% of blood test data.</span></li>\r\n<li style=\"text-size-adjust: 100%;\"><span style=\"font-family: arial, \'helvetica neue\', helvetica, sans-serif;\">90M Americans are pre diabetic and don&rsquo;t even know it.</span></li>\r\n<li style=\"text-size-adjust: 100%;\"><span style=\"font-family: arial, \'helvetica neue\', helvetica, sans-serif;\">Blood cancers account for almost 10 percent of new cancer cases each year in the United States.</span></li>\r\n<li style=\"text-size-adjust: 100%;\"><span style=\"font-family: arial, \'helvetica neue\', helvetica, sans-serif;\">Approximately&nbsp;<strong>1.5 million heart attacks</strong>&nbsp;and strokes occur every year in the United States. More than 800,000 people in the United States die from cardiovascular disease each year&mdash;that\'s 1 in every 3 deaths, and about 160,000 of them occur in people under age 65.</span></li>\r\n<li style=\"text-size-adjust: 100%;\"><span style=\"font-family: arial, \'helvetica neue\', helvetica, sans-serif;\"><strong>Cirrhosis</strong>&nbsp;and other chronic&nbsp;<strong>liver diseases</strong>&nbsp;are common&nbsp;<strong>disease</strong>-related causes of&nbsp;<strong>death</strong>&nbsp;in the&nbsp;<strong>U.S.</strong></span></li>\r\n</ul>\r\n<p style=\"margin: 10px 0px; padding: 0px; text-size-adjust: 100%; line-height: 24px;\"><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">These statistics tell you a couple things. One being proactive about your healthcare through blood testing is core to understanding the risks your body is facing. Thus, the best measure you can take is to go to order your blood tests regularly&nbsp;even if you\'re not having symptoms</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">Blood tests like the CBC and the CMP panel will detect health risks generally&nbsp;with and without any symptoms. Don&rsquo;t pass on this type of care just because you don&rsquo;t think that you need to. Remember, you&rsquo;re in charge of your health and it&rsquo;s vital that you don&rsquo;t pass on the opportunities that allow you to take additional ownership.</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;</span><br /><strong style=\"font-family: arial, \'helvetica neue\', helvetica, sans-serif;\">Where to learn more</strong><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">If this blog post has your mind turning, keep reading! Learning more is one of the best ways to better your health. If you want to read more about the variety of blood tests offered and their basic uses, check out this blog,&nbsp;</span><a style=\"text-size-adjust: 100%; color: #2baadf; font-family: arial, \'helvetica neue\', helvetica, sans-serif;\" href=\"https://www.newcenturylabs.com/blog/post/top-10-blood-tests\">Top Ten Blood Tests</a><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">. If you&rsquo;re ready to take action, come see us! Visiting New Century Labs online is the best way to get your tests done, even if it&rsquo;s precautionary. We offer low cost and convenient blood tests in the United States. Take back your health and maintain your body with easy access to the tests you need. With over 2,300 patient service centers throughout the United States and no appointments necessary, health and wellness start today. Don&rsquo;t wait! Order a test&nbsp;</span><a style=\"text-size-adjust: 100%; color: #2baadf; font-family: arial, \'helvetica neue\', helvetica, sans-serif;\" href=\"https://www.newcenturylabs.com/shop\">here</a><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">.</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;</span><br /><span style=\"font-family: arial, helvetica neue, helvetica, sans-serif;\">&nbsp;</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnImageBlock\" style=\"border-collapse: collapse; text-size-adjust: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnImageBlockOuter\">\r\n<tr>\r\n<td class=\"mcnImageBlockInner\" style=\"text-size-adjust: 100%; padding: 9px;\" valign=\"