INSERT INTO `products` VALUES (1,'Aluminum  Random Urine','aluminum-random-urine','6024','<p>Aluminum is an attacker of our central nervous system. Studies show that toxic metals contribute to brain diseases by producing oxidative stress and aluminum is one of the worst offenders.</p>\r\n<p>Aluminum accumulates in the bones, hair, kidneys, brain, lungs, liver and thyroid where it competes with calcium for absorption and can affect skeletal mineralization and can be detected by taking a simple urine test.</p>\r\n<p>Exposure can occur from daily consumption of female/male cosmetics and hygiene products including industrial exposure, cooking supplies and aerosol sprays. Aluminum levels may be increased in patients on dialysis and in patients with renal failure and Alzheimer&rsquo;s disease. This measure is very sensitive to aluminum containing medications, e.g., aluminum-containing antacids, such as Mylanta and Maalox and may continue to test as elevated for a prolonged period of time even after the medication is stopped.</p>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','<ul>\r\n<li><strong>Fasting Required:</strong> No</li>\r\n<li><strong>Preferred Specimen:</strong> Urine Test W/O Creatinine</li>\r\n<li><strong>Reference Range(s):</strong> 5-30 mcg/L</li>\r\n<li><strong>Turnaround Time:</strong> 3-5 days</li>\r\n<li><strong>Test Code:</strong> 6024</li>\r\n</ul>\r\n<div id=\"eJOY__extension_root\" class=\"eJOY__extension_root_class\" style=\"all: unset;\">&nbsp;</div>','simple','1','2016-10-03 08:30:16','2021-01-28 15:32:35',199.0,0.1,'aluminum, random-urine, order lab tests, affordable blood tests, order blood tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone',0),(6,'Alpha-Fetoprotein Tumor Marker (AFP)','alpha-fetoprotein-tumor-marker-afp','237','<p>AFP concentrations are increased in patients with liver cancer, hepatitis, and liver cirrhosis. Increased levels in severe hepatitis indicate liver cell regeneration. Thus, the absence of AFP in patients with fulminant hepatitis is considered a poor prognostic sign.</p>\r\n\r\n<p>AFP concentrations decline to normal levels with effective therapy. Persistently elevated levels suggest residual disease; rising levels suggest disease progression or recurrence.</p>\r\n\r\n<p>Clinical Use: Distinguishs between seminomatous and non-seminomatous testicular germ cell cancer. Monitors therapy and detect recurrence in individuals with non-seminomatous testicular germ cell cancer. Determines prognosis in individuals with fulminant hepatitis. Monitors therapy in individuals with hepatocellular carcinoma and monitors hepatitis B carriers for evidence of liver cancer</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> No</li>\r\n	<li><strong>Preferred Specimen:</strong>Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th>&nbsp;</th>\r\n				<th>Male (ng/mL)</th>\r\n				<th>Female (ng/mL)</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>1 Month*</td>\r\n				<td>0.5-16387.0</td>\r\n				<td>0.5-18964.0</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-11 Months*</td>\r\n				<td>0.5-28.3</td>\r\n				<td>0.5-77.0</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-3 Years*</td>\r\n				<td>0.5-7.9</td>\r\n				<td>0.5-11.1</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3 Years</td>\r\n				<td>6.1</td>\r\n				<td>6.1</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Limitations:</strong> Patients who have received monoclonal mouse antibodies may have abnormal results. For any patient taking a high dose of biotin, the specimen should be drawn at least eight hours after the last dose. The use of AFP as a tumor marker in pregnant females is not recommended. AFP is not recommended as a screening procedure to detect cancer in the general population.</li>\r\n	<li><strong>For this test draws must be done: </strong> Mon-Fri 1st shift (cutoff 9 a.m.)</li>\r\n	<li><strong>Turnaround Time: </strong> 3 days</li>\r\n	<li><strong>Test Code:</strong> 237</li>\r\n</ul>\r\n','simple','1','2016-11-28 06:55:53','2021-01-16 05:21:53',120.0,56.0,'Alpha-Fetoprotein Tumor Marker',0),(7,'Amylase ','amylase','243','<p>Amylase is an enzyme that helps digest carbohydrates. Amylase It is made in the pancreas      and it is the glands that makes saliva. When the pancreas has a disease or is inflamed, amylase releases into the blood. A test can be done to measure the level of this enzyme in your blood.</p>\r\n<p>The most common cause of elevation of serum amylase is inflammation of the pancreas (pancreatitis). In acute pancreatitis, serum amylase begins to rise within 6-24 hours, remains elevated for a few days and returns to normal in 3-7 days. Other causes of elevated serum amylase are inflammation of salivary glands (mumps), biliary tract disease and bowel obstruction. Elevated serum amylase can also be seen with drugs (e.g., morphine) which constrict the pancreatic duct sphincter preventing excretion of amylase into the intestine.</p>','<ul>\r\n			    <li><strong>Fasting Required:</strong> No</li> \r\n			    <li><strong>Preferred Specimen:</strong> Serum </li>\r\n			    <li><strong>Reference Range(s):</strong> 21-101 U/L </li>	\r\n			    <li><strong>Turnaround Time:</strong> 3 days </li>\r\n			    <li><strong>Test Code:</strong> 243</li>				\r\n</ul>','simple','1','2016-11-28 07:25:30','2021-01-16 05:21:53',48.0,23.0,'Amylase ',0),(8,'ABO Group and RH Type','abo-group-and-rh-type','7788','<p>ABO grouping is a test performed to determine an individual\'s blood type. It is based on the premise that individuals have antigens on their red blood cells (RBCs) that correspond to the 4 main blood groups: A, B, O, or AB.</p>\r\n<p>ABO type and Rh are needed to identify candidates for Rh immune globulin and to assess the risk of hemolytic disease of the newborn</p>','<ul>\r\n<li><strong>Fasting Required:</strong> No</li>\r\n<li><strong>Preferred Specimen:</strong> Whole Blood</li>\r\n<li><strong>Reference Range(s):</strong> See Lab Report</li>\r\n<li><strong>Limitations:</strong>Interferences may include abnormal plasma proteins, cold autoagglutinins, positive direct antiglobin test, and bacteremia.</li>\r\n<li><strong>Turnaround Time:</strong> 3 days</li>\r\n<li><strong>Test Code:</strong> 7788</li>\r\n</ul>','simple','1','2016-11-28 07:32:27','2021-03-16 21:26:09',65.0,0.5,'ABO Group and RH Type',0),(9,'Amino Acid Analysis','amino-acid-analysis','1776','<p><strong>Test Includes:</strong> Includes\r\nIsoleucine, Leucine, Phenylalanine, Tyrosine, Tryptophan, Valine\r\n</p>\r\n<p>Twenty percent of the human body is made up of protein. Protein plays a crucial role in almost all biological processes and amino acids are the building blocks of it. A large proportion of our cells, muscles and tissue is made up of amino acids, meaning they carry out many important bodily functions, such as giving cells their structure. They also play a key role in the transport and the storage of nutrients. Amino acids have an influence on the function of organs, glands, tendons and arteries. They are furthermore essential for healing wounds and repairing tissue, especially in the muscles, bones, skin and hair as well as for the removal of all kinds of waste deposits produced in connection with the metabolism.</p>\r\n','<ul>\r\n			    <li><strong>Fasting Required:</strong> No</li> \r\n			    <li><strong>Preferred Specimen:</strong> Plasma </li>\r\n			    <li><strong>Reference Range(s):</strong> See Lab Report </li>	\r\n			    <li><strong>Turnaround Time:</strong> 7 days  </li>\r\n			    <li><strong>Test Code:</strong> 1776</li>				\r\n</ul>','simple','1','2016-11-28 07:46:57','2021-01-16 05:21:54',399.0,170.0,'Amino Acid Analysis',0),(10,'Aspirin Resistant (11-Dehydrothromboxane B2) ','aspirin-resistant-11-dehydrothromboxane-b2','16174','<p>Aspirin (which inhibits platelet cyclo-oxygenase) reduces the risk of thrombosis in cardiovascular disease by impairing platelet function. Patients who do not respond to the platelet inhibitory effects of aspirin are designated as &quot;ASPIRIN RESISTANT&quot;. The measurement of 11-DEHYDROTHROMBOXANE B2 in urine (the principal metabolite of platelet cyclo-oxygenase derived thromboxane B2) indicates lack of aspirin responsiveness.</p>\r\n\r\n<p>Studies have found that between 5 percent and 45 percent of patients have this problem, but doctors do not routinely test for it. Increasing degrees of aspirin resistance may correlate independently with increasing risk of cardiovascular events. Aspirin resistance can be detected by laboratory tests of platelet thromboxane A2 production or platelet function that depend on platelet thromboxane production. Knowing if you&rsquo;re aspirin resistant could be potentially lifesaving.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> No</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Includes: </strong> Creatinine</li>\r\n	<li><strong>Reference Range(s):</strong> 11-Dehydrothromboxane B2 &gt;1500 pg/mg creat\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th>Creatinine</th>\r\n				<th>Random Urine</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>6 Months</td>\r\n				<td>2-32 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7-11 Months</td>\r\n				<td>2-36 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-2 Years</td>\r\n				<td>2-128 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3-8 Years</td>\r\n				<td>2-149 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>9-12 Years</td>\r\n				<td>2-183 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>12 Years Male</td>\r\n				<td>20-370 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>12 Years Female</td>\r\n				<td>20-320 mg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 10 days</li>\r\n	<li><strong>Test Code:</strong> 16174</li>\r\n</ul>\r\n','simple','1','2016-11-28 07:57:05','2021-01-16 05:21:54',125.0,55.0,'Aspirin Resistant (11-Dehydrothromboxane B2) ',0),(11,'Food Allergy ','food-allergy','10715','<p><strong>Includes:</strong> Almond, Cashew Nut, Codfish, Cow&#39;s Milk, Egg White, Hazelnut, Peanut, Salmon, Scallop Sesame Seed, Shrimp, Soybean, Tuna Walnut, Wheat</p>\r\n\r\n<p>This test takes a lot of guess work out of your daily diet. If you have IBS, rashes, or even a life threatening food you have to avoid, this test can be very important to your over all health.</p>\r\n\r\n<p>Accurate diagnosis of food allergy is important not only for avoidance of foods that may cause a reaction, but also to avoid unnecessary dietary restrictions that may adversely affect quality of life.</p>\r\n\r\n<p>The Food Allergy Profile provides rapid and convenient measurement of food-specific IgE antibodies. The profile includes allergens associated with common food allergies and is useful in confirming or excluding suspected food allergies. Results can help direct subsequent testing and management options, including trial elimination diet, oral food challenge, and further evaluation of non-IgE-related reactions.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> No</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> See Lab Report</li>\r\n	<li><strong>Turnaround Time:</strong> 5 days</li>\r\n	<li><strong>Test Code:</strong> 10715</li>\r\n</ul>\r\n','simple','1','2016-11-28 08:02:19','2021-01-16 05:21:54',349.0,150.0,'Food Allergy ',0),(12,'Wellness Starter','wellness-starter','B-WS-01','<p>Great way to get a general understanding of many important biomarkers. Includes a quick look at your heart health, blood chemistry, electrolyte functions, liver health, and diabetes.</p>\r\n','','bundle','1','2016-11-28 09:13:14','2021-01-16 16:04:37',99.0,NULL,'order lab tests, affordable lab tests, order lab tests online, blood tests, order lab tests without a doctor, order labs, lab tests, buy lab tests online, hormone balance tests',0),(13,'Arsenic Random Urine ','arsenic-random-urine','270','<p>Arsenic is widely distributed in the earth&#39;s crust. Arsenic is used in some pesticides and industrial applications. Arsenic toxicity can cause skin changes, respiratory illness, nausea and vomiting, and other effects.</p>\r\n\r\n<p>A wide range of signs and symptoms may be seen in positive arsenic poisoning which including headache, nausea, vomiting, diarrhea, abdominal pain, hypotension, fever, hemolysis, seizures, and mental status changes. Symptoms of chronic poisoning, also called arseniasis, are mostly insidious and nonspecific. The gastrointestinal tract, skin, and central nervous system are usually involved. Nausea, epigastric pain, colic abdominal pain, diarrhea, and paresthesias of the hands and feet can occur.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> No</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Non-exposed Adult</td>\r\n				<td>35 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Biological Exposure Index (end of shift/work week)</td>\r\n				<td>50 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Creatinine</td>\r\n				<td>Random Urine</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6 Months</td>\r\n				<td>2-32 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7-11 Months</td>\r\n				<td>2-36 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-2 Years</td>\r\n				<td>2-128 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3-8 Years</td>\r\n				<td>2-149 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>9-12 Years</td>\r\n				<td>2-183 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>12 Years</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>20-370 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>20-320 mg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Limitations:</strong> Seafood may increase urinary arsenic. This test may not rule out arsenic if spot levels are normal.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 days</li>\r\n	<li><strong>Test Code:</strong> 270</li>\r\n</ul>\r\n','simple','1','2016-11-29 00:35:27','2021-01-16 05:21:54',199.0,42.0,'Arsenic Random Urine ',0),(14,'Bismuth Random Urine','bismuth-random-urine','6060','<p>Bismuth metal is used to manufacture alloys, catalysts, ceramics, cosmetics, magnets, paints, pharmaceuticals, semiconductors, and x-ray contrast media; excessive use or exposure to Bismuth containing medications may cause renal damage and other adverse effects. Bismuth is used as an antidiarrheal; it is the active ingredient in such &ldquo;Pink Bismuth&rdquo; preparations as Pepto-Bismol, as well as the 2004 reformulation of Kaopectate. It is also used to treat some other gastro-intestinal diseases. The mechanism of action of this substance is still not well documented, however it can remain in the kidney for years in patients treated with bismuth compounds. In chronic poisoning, all organs are affected. In the skin a lichen planus-like rash, in the mouth stomatitis with a blue black gum line. Inflammation and inclusion bodies in the liver, kidney, and bone are characteristic. In the brain, the lesions will cause encephalitis.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> No</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Non-exposed Adult</td>\r\n				<td>35 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Biological Exposure Index (end of shift/work week)</td>\r\n				<td>50 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Creatinine</td>\r\n				<td>Random Urine</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6 Months</td>\r\n				<td>2-32 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7-11 Months</td>\r\n				<td>2-36 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-2 Years</td>\r\n				<td>2-128 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3-8 Years</td>\r\n				<td>2-149 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>9-12 Years</td>\r\n				<td>2-183 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>12 Years</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>20-370 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>20-320 mg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Limitations:</strong> Avoid taking mineral supplements and bismuth preparations such as Pepto-Bismol&trade; for at least 1 week prior to collection.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 days</li>\r\n	<li><strong>Test Code:</strong> 6060</li>\r\n</ul>\r\n','simple','1','2016-11-29 01:56:38','2021-01-16 05:21:54',199.0,42.0,'Bismuth Random Urine',0),(15,'Bordetella Pertussis/Parapertussis DNA, Qualitative Real-Time PCR (Whooping Cough)','bordetella-pertussisparapertussis-dna-qualitative-real-time-pcr-whooping-cough','11365','<p>Bordetella pertussis is the cause of whooping cough that may occur in unimmunized individuals. B. parapertussis is a related organism that causes a similar but milder disease. Pertussis, a more commonly known as whooping cough, is a contagious, respiratory disease caused by the bacterium Bordetella pertussis. The illness is characterized by a prolonged paroxysmal cough, which is often accompanied by an inspiratory whoop. Disease presentation varies with age and history of previous exposure or vaccination. Young infants may present to a clinic or hospital with apnea and no other disease symptoms. Adults and adolescents with some immunity may exhibit only mild symptoms or have the typical prolonged paroxysmal cough. In all persons, cough can continue for months.</p>','<ul>\r\n			    <li><strong>Fasting Required:</strong> No</li> \r\n			    <li><strong>Preferred Specimen:</strong> 1 mL nasopharyngeal aspirate/wash/lavage OR 1 nasal swab </li>\r\n			    <li><strong>Reference Range(s):</strong>  </li>	\r\n			    <li><strong>B. pertussis DNA:</strong>  Not detected</li>	\r\n			    <li><strong>B. parapertussis DNA:</strong>  Not detected</li>\r\n                            <li><strong>Turnaround Time:</strong> 3 days </li>\r\n			    <li><strong>Test Code:</strong>11365</li>				\r\n</ul>','simple','1','2016-11-29 04:04:48','2021-01-16 05:21:54',189.0,90.0,'Bordetella Pertussis/Parapertussis DNA, Qualitative Real-Time PCR (Whooping Cough)',0),(16,'CBC (includes Differential and Platelets)','cbc-includes-differential-and-platelets','6399','<p>A complete blood count is used as a screening test for various disease states including anemia, leukemia and inflammatory processes.</p>\r\n<p><strong>Test includes:</strong> WBC, RBC, Hemoglobin, Hematocrit, MCV, MCH, MCHC, RDW, Platelet Count, MPV and Differential (Absolute and Percent - Neutrophils, Lymphocytes, Monocytes, Eosinophils, and Basophils)  If abnormal cells are noted on a manual review of the peripheral blood smear or if the automated differential information meets specific criteria, a full manual differential will be performed.</p>','<ul>\r\n			    <li><strong>Fasting Required:</strong> No</li> \r\n			    <li><strong>Preferred Specimen:</strong> Whole Blood </li>\r\n			    <li><strong>Reference Range(s):</strong> See Laboratory Report </li>	\r\n                            <li><strong>Turnaround Time:</strong> 1 days </li>\r\n			    <li><strong>Test Code:</strong>  6399</li>				\r\n</ul>','simple','1','2016-11-29 04:24:07','2021-01-16 05:21:54',39.0,15.0,'CBC (includes Differential and Platelets)',0),(17,'Comprehensive Metabolic Panel ','comprehensive-metabolic-panel','10231','<p>The comprehensive metabolic panel (CMP) is used as a baseline screening tool to assess organ function and check for serious conditions such as diabetes, liver disease, and kidney disease. The CMP may also be ordered to monitor various known conditions, such as hypertension, and to monitor people taking specific medications for any kidney, or liver-related side effects. Getting your CMP regularly is a great health screening tool. </p>\r\n<p>Test includes: Albumin, Albumin/Globulin Ratio (calculated), Alkaline Phosphatase, ALT, AST, BUN/Creatinine Ratio (calculated), Calcium, Carbon Dioxide, Chloride, Creatinine with GFR Estimated, Globulin (calculated), Glucose, Potassium, Sodium, Total Bilirubin, Total Protein, Urea Nitrogen</p>','<ul>\r\n			    <li><strong>Fasting Required:</strong> Yes (10-12 Hrs)</li> \r\n			    <li><strong>Preferred Specimen:</strong> Serum </li>\r\n			    <li><strong>Reference Range(s):</strong>  See Laboratory Report </li>	\r\n                            <li><strong>Turnaround Time:</strong> 2 Day </li>\r\n			    <li><strong>Test Code:</strong> 10231</li>				\r\n</ul>','simple','1','2016-11-29 04:39:09','2021-01-16 05:21:54',45.0,14.0,'Comprehensive Metabolic Panel ',0),(18,'Lipid Panel  ','lipid-panel','7600','<p>The lipid profile is used as part of a cardiac risk assessment to help determine an individual&#39;s risk of heart disease and to help make decisions about what treatment may be best if there is borderline or high risk. Lipids are a group of fats and fat-like substances that are important constituents of cells and sources of energy. Monitoring and maintaining healthy levels of these lipids is important in staying healthy</p>\r\n\r\n<p><strong>Test includes:</strong> Total Cholesterol, HDL Cholesterol, Triglycerides, LDL-Cholesterol (calculated), Cholesterol/HDL Ratio (calculated), Non-HDL Cholesterol (calculated)</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes (10-12 Hrs)</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th>Total Cholesterol</th>\r\n				<th>Male (mg/dL)</th>\r\n				<th>Female (mg/dL)</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>20 Years</td>\r\n				<td>125-170</td>\r\n				<td>125-170</td>\r\n			</tr>\r\n			<tr>\r\n				<td>20 Years</td>\r\n				<td>125-200</td>\r\n				<td>125-200</td>\r\n			</tr>\r\n			<tr>\r\n				<td>HDL Cholesterol</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>4 Years</td>\r\n				<td>Not established</td>\r\n				<td>Not established</td>\r\n			</tr>\r\n			<tr>\r\n				<td>5-14 Years</td>\r\n				<td>38-76</td>\r\n				<td>37-75</td>\r\n			</tr>\r\n			<tr>\r\n				<td>15-19 Years</td>\r\n				<td>31-65</td>\r\n				<td>36-76</td>\r\n			</tr>\r\n			<tr>\r\n				<td>19 Years</td>\r\n				<td>40</td>\r\n				<td>46</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Triglycerides</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>9 Years</td>\r\n				<td>30-104</td>\r\n				<td>33-115</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-14 Years</td>\r\n				<td>33-129</td>\r\n				<td>38-135</td>\r\n			</tr>\r\n			<tr>\r\n				<td>15-19 Years</td>\r\n				<td>38-152</td>\r\n				<td>40-136</td>\r\n			</tr>\r\n			<tr>\r\n				<td>19 Years</td>\r\n				<td>150</td>\r\n				<td>150</td>\r\n			</tr>\r\n			<tr>\r\n				<td>LDL-Cholesterol</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>(Calc)</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>20 Years</td>\r\n				<td>110</td>\r\n				<td>110</td>\r\n			</tr>\r\n			<tr>\r\n				<td>20 Years</td>\r\n				<td>130</td>\r\n				<td>130</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Cholesterol/HDL</td>\r\n				<td>5.0</td>\r\n				<td>5.0</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Ratio (Calc)</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Non-HDL Cholesterol</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>20 Years</td>\r\n				<td>120 mg/dL</td>\r\n				<td>120 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>20 Years</td>\r\n				<td>Target for non-HDL cholesterol is 30 mg/dL<br />\r\n				higher than LDL cholesterol target</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Day</li>\r\n	<li><strong>Test Code:</strong> 7600</li>\r\n</ul>\r\n','simple','1','2016-11-29 04:47:43','2021-01-16 05:21:54',49.0,24.0,'Lipid Panel,  cholesterol test, blood test, order blood test online, fasting blood test, affordable blood test, cheap blood test, ',0),(19,'CRP','crp','4420','<p>The level of C-Reactive Protein in the blood is should normally be low.&nbsp;</p>\r\n\r\n<p>A high CRP result or increasing amount of CRP in the blood suggests the presence of inflammation however it will not identify its location or the cause. In individuals suspected of having a serious bacterial infection, a high CRP can be confirmatory. In people with chronic inflammatory conditions, high levels of CRP suggest a flare-up or that treatment has not been effective. If the CRP level is initially elevated and drops, it means that the inflammation or infection is subsiding and/or responding to treatment.</p>\r\n\r\n<p>Increased&nbsp;CRP levels are found in inflammatory conditions including: bacterial infection, rheumatic fever, active arthritis, myocardial infarction, malignancies and in the post-operative state. This test cannot detect the relatively small elevations of CRP that are associated with increased cardiovascular risk. If you intend to evaluate cardiovascular risk (Hs-CRP) is needed.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 0.80 mg/dL</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Day</li>\r\n	<li><strong>Test Code:</strong> 4420</li>\r\n</ul>\r\n','simple','1','2016-11-29 07:40:16','2021-01-16 05:21:54',54.0,24.0,'CRP',0),(20,'CRP-Hs','crp-hs','10124','<p>Ongoing &nbsp;inflammation is a sign &nbsp;of potential in <a href=\"http://emedicine.medscape.com/article/162449-overview\">heart disease</a>; studies have shown that high levels of CRP, taken by high-sensitivity CRP (hs-CRP), can be a marker of <a href=\"http://emedicine.medscape.com/article/1950759-overview\">atherosclerosis</a>.&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;hs-CRP is an important predictor for cardiovascular disease including myocardial infarction, cerebrovascular events, peripheral vascular disease, and sudden cardiac death in individuals without a history of heart disease. In patients with acute coronary disease, CRP level predicts mortality and cardiac complications. High CRP levels foreshadow a worse prognosis in patients with acute coronary syndromes. hs-CRP is also a marker of other chronic disease such as metabolic syndrome. Adding a hs-CRP test along with other cardiovascular related tests can be very essential to help aid your doctor provide you with the most effective treatment.&nbsp;</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>hs-CRP (mg/L)</td>\r\n				<td>Risk According to AHA/CDC Guidelines</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1.0</td>\r\n				<td>Lower relative cardiovascular risk.</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1.0-3.0</td>\r\n				<td>Average relative cardiovascular risk.</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3.1-10.0</td>\r\n				<td>Higher relative cardiovascular risk. Consider retesting in 1 to 2 weeks to exclude a benign transient elevation in the baseline CRP value secondary to infection or inflammation.</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10.0</td>\r\n				<td>Persistent elevation, upon retesting, may be associated with infection and inflammation.</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Day</li>\r\n	<li><strong>Test Code:</strong> 10124</li>\r\n</ul>\r\n','simple','1','2016-11-29 07:49:12','2021-01-16 05:21:54',59.0,26.0,'CRP-Hs',0),(21,'Ceruloplasmin','ceruloplasmin','326','<p>Ceruloplasmin, is a glycoprotein produced in the liver and transports more than 95 percent of the copper in blood. Copper plays an important role in the body by aiding crucial bodily processes. These include producing energy, forming connective tissue, and helping the central nervous system function. Decreased levels of ceruloplasmin are found in Wilson&#39;s Disease, fulminant liver failure, intestinal malabsorption, renal failure resulting in proteinuria, chronic active hepatitis and malnutrition. Elevated levels are found in primary biliary cirrhosis, pregnancy (first trimester), oral contraceptive use and in acute inflammatory conditions since ceruloplasmin is an acute phase reactant.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th>Age</th>\r\n				<th>Male (mg/dL)</th>\r\n				<th>Female (mg/dL)</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>0-30 Days</td>\r\n				<td>8-25</td>\r\n				<td>3-28</td>\r\n			</tr>\r\n			<tr>\r\n				<td>31 Days-11</td>\r\n				<td>15-48</td>\r\n				<td>15-43</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Months</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-3 Years</td>\r\n				<td>25-56</td>\r\n				<td>29-54</td>\r\n			</tr>\r\n			<tr>\r\n				<td>4-6 Years</td>\r\n				<td>29-56</td>\r\n				<td>26-54</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7-9 Years</td>\r\n				<td>25-52</td>\r\n				<td>23-48</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-12 Years</td>\r\n				<td>21-51</td>\r\n				<td>21-48</td>\r\n			</tr>\r\n			<tr>\r\n				<td>13-15 Years</td>\r\n				<td>20-50</td>\r\n				<td>21-46</td>\r\n			</tr>\r\n			<tr>\r\n				<td>16-18 Years</td>\r\n				<td>20-45</td>\r\n				<td>22-50</td>\r\n			</tr>\r\n			<tr>\r\n				<td>18 Years</td>\r\n				<td>18-36</td>\r\n				<td>18-53</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Day</li>\r\n	<li><strong>Test Code:</strong> 326</li>\r\n</ul>\r\n','simple','1','2016-11-29 08:20:16','2021-01-16 05:21:54',59.0,21.0,'Ceruloplasmin',0),(22,'Copper','copper','363','<p>Copper is an essential element that is a cofactor of many enzymes. Copper metabolism is disturbed in Wilson&#39;s disease, Menkes disease, primary biliary cirrhosis, and Indian childhood cirrhosis. Copper concentrations increase in acute phase reactions and during the third trimester of pregnancy. Copper concentrations are decreased with nephrosis, malabsorption, and malnutrition. Copper concentrations are also useful to monitor patients, especially preterm newborns, on nutritional supplementation. Results of copper are often interpreted together with ceruloplasmin.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>5 Months</td>\r\n				<td>38-104 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6-11 Months</td>\r\n				<td>24-152 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>12 Months-23 Months</td>\r\n				<td>76-193 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-3 Years</td>\r\n				<td>87-187 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>4-5 Years</td>\r\n				<td>56-191 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6-9 Years</td>\r\n				<td>117-181 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-13 Years</td>\r\n				<td>87-182 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>14-17 Years</td>\r\n				<td>75-187 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>18 Years</td>\r\n				<td>70-175 mcg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Day</li>\r\n	<li><strong>Test Code:</strong> 363</li>\r\n</ul>\r\n','simple','1','2016-11-30 02:09:16','2021-01-16 05:21:54',89.0,29.0,'Copper',0),(23,'Copper RBC','copper-rbc','3481','<p>One of the best ways to detect Copper deficiency is intracellular, or red blood cell (RBC)&nbsp;vs a regular copper test.</p>\r\n\r\n<p>Copper is an essential element that is a cofactor of many enzymes. Copper metabolism is disturbed in Wilson&#39;s disease, Menkes disease, primary biliary cirrhosis, and Indian childhood cirrhosis. Copper concentrations increase in acute phase reactions. Copper concentrations are decreased with nephrosis, malabsorption, and malnutrition. Copper concentrations are also useful to monitor patients, especially preterm newborns, on nutritional supplementation. Results of copper are often interpreted together with ceruloplasmin</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 0.53-0.91 mg/L</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Day</li>\r\n	<li><strong>Test Code:</strong> 3481</li>\r\n</ul>\r\n','simple','1','2016-11-30 02:13:46','2021-01-16 05:21:54',120.0,60.0,'Copper RBC',0),(24,'Chromium Random Urine','chromium-random-urine','11278','<p>Chromium is a naturally occurring heavy metal that is commonly used in industrial processes and can cause severe health effects in humans. The primary health impacts from chromium are damage to the gastrointestinal, respiratory, and immunological systems, as well as reproductive and developmental problems.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Reference Range(s):</strong> 2.0 ng/mL Includes Creatinine</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Day</li>\r\n	<li><strong>Test Code:</strong> 11278</li>\r\n</ul>\r\n','simple','1','2016-11-30 02:47:48','2021-01-16 05:21:54',98.0,53.0,'Chromium Random Urine',0),(25,'CA 19-9 (Cancer)','ca-19-9-cancer','4698','<p>A large percentage of patients with gastrointestinal tumors (such as pancreatic, liver, gastric, colorectal tumors) and some other malignancies have been shown to have elevated serum &nbsp;CA 19-9 levels. Serum CA 19-9 levels may be useful for monitoring disease activity&nbsp;or&nbsp;predicting relapse following treatment. CA 19-9 should not be used as a screening test.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 34 U/mL</li>\r\n	<li><strong>Limitations:</strong> CA 19-9 is absent in individuals with blood group Lewis Le(a-b-), as observed in approximately 5% of Caucasian and 20-25% of African American patients. CA 19-9 levels, regardless of value, should not be interpreted as absolute evidence of the presence or absence of disease, more testing may be needed.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Day</li>\r\n	<li><strong>Test Code:</strong> 4698</li>\r\n</ul>\r\n','simple','1','2016-11-30 02:52:03','2021-01-16 05:21:54',120.0,35.0,'CA 19-9 (Cancer)',0),(26,'CA-27.29 (Cancer) ','ca-2729-cancer','29493','<p>CA 27.29 may be useful for monitoring patients with various cancers. Elevated CA 27.29 levels are associated with metastatic breast cancer and sometimes with primary breast cancer. CA 27.29 is also elevated in ovarian, liver, pancreatic and lung cancer, as well as in the nonmalignant conditions detailed in the table below. Rising levels suggest lack of therapeutic response and/or progressive disease, whereas decreasing levels suggest response to treatment and disease regression. CA 27.29 elevations in patients with a history of breast cancer and no clinical evidence of disease suggest recurrence.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> CA 27.29 38 U/mL</li>\r\n	<li><strong>Limitations:</strong> CA 27.29 is not intended as a screening test. Values obtained from different assay methods cannot be used interchangeably. CA 27.29 levels, regardless of value, should not be interpreted as absolute evidence of the presence or absence of disease.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Day</li>\r\n	<li><strong>Test Code:</strong> 29493</li>\r\n</ul>\r\n','simple','1','2016-11-30 02:55:44','2021-01-16 05:21:54',120.0,35.0,'CA-27.29 (Cancer) ',0),(27,'CA 15-3 (Cancer) ','ca-15-3-cancer','5819','<p>CA 15-3 may be useful for monitoring patients with metastatic breast cancer and certain ovarian cancers. The CA 15-3 values from sequential samples have a high correlation with the clinical course in most patients with metastatic breast cancer. Benign diseases of the breast and liver may cause elevated results.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> CA 15-3 32 U/mL/li&gt;</li>\r\n	<li><strong>Limitations:</strong> CA 15-3 levels, regardless of value, should not be interpreted as absolute evidence of the presence or absence of disease.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Day</li>\r\n	<li><strong>Test Code:</strong> 5819</li>\r\n</ul>\r\n','simple','1','2016-11-30 03:00:30','2021-01-16 05:21:54',120.0,35.0,'CA 15-3 (Cancer) ',0),(28,'CA 125 (Cancer) ','ca-125-cancer','29256','<p>The CA 125 level can provide prognostic information in the follow-up management of patients with ovarian carcinoma.&nbsp;The assay should be used as an adjunctive test in the management of ovarian cancer patients.&nbsp;</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 35 U/mL</li>\r\n	<li><strong>Limitations:</strong>  CA 125 is affected by menstrual cycle, ectopic endometrial tissue. CA 125 is not recommended as a cancer screening procedure to detect cancer in the general population.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Day</li>\r\n	<li><strong>Test Code:</strong> 29256</li>\r\n</ul>\r\n','simple','1','2016-11-30 04:24:13','2021-01-16 05:21:54',125.0,40.0,'CA 125 (Cancer) ',0),(29,'CEA (Cancer) ','cea-cancer','978','<p>Increased serum CEA levels have been detected in persons with primary colorectal cancer and in patients with other malignancies involving the&nbsp;gastrointestinal tract, breast, lung, ovarian, prostatic, liver and pancreatic cancers. Elevated serum CEA levels have also been detected in patients with nonmalignant disease, especially patients who are older or who are smokers. CEA levels are not useful in screening the general population for undetected cancers. However, CEA levels provide important information about patient prognosis, recurrence of tumors after surgical removal, and effectiveness of therapy.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Non-Smoker</td>\r\n				<td>2.5 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Smoker</td>\r\n				<td>5.0 ng/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Limitations:</strong> The presence of HAMA in patients can cause false-positive or false-negative results with tests for the determination of blood CEA levels. Approximately 5% of colorectal cancers are not associated with increased levels of CEA. CEA may be elevated in many types of solid cancer.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Day</li>\r\n	<li><strong>Test Code:</strong> 978</li>\r\n</ul>\r\n','simple','1','2016-11-30 04:30:05','2021-01-16 05:21:54',120.0,35.0,'CEA (Cancer) ',0),(30,'C-Peptide Response to Glucose, 9 Specimens ','c-peptide-response-to-glucose-9-specimens','15448','<p>C-Peptide is useful in the evaluation of pancreatic beta cell function (e.g., helping distinguish type 1 from type 2 <em>diabetes mellitus</em>, or monitoring patients who have received islet cell or pancreatic transplants) and for determining the source of insulin in patients with hyperinsulinemic hypoglycemia. (e.g., distinguishing insulin-secreting tumors from exogenous insulin administration). It is also sometimes measured as an additional means (more resistant to hemolysis than is insulin itself) for evaluating glucose tolerance tests.&nbsp;</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes 12 Hours</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Fasting:</td>\r\n				<td>0.80-3.85 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>30 minutes post glucose:</td>\r\n				<td>1.78-7.49 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>60 minutes post glucose:</td>\r\n				<td>1.91-8.21 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>90 minutes post glucose:</td>\r\n				<td>1.52-7.95 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>120 minutes post glucose:</td>\r\n				<td>1.19-6.04 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>150 minutes post glucose:</td>\r\n				<td>1.06-5.98 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>180 minutes post glucose:</td>\r\n				<td>1.06-3.88 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>240 minutes post glucose:</td>\r\n				<td>0.86-3.22 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>300 minutes post glucose:</td>\r\n				<td>0.86-2.50 ng/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Limitations:</strong> CA 19-9 is absent in individuals with blood group Lewis Le(a-b-), as observed in approximately 5% of Caucasian and 20-25% of African American patients. CA 19-9 levels, regardless of value, should not be interpreted as absolute evidence of the presence or absence of disease, more testing may be needed.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Day</li>\r\n	<li><strong>Test Code:</strong> 15448</li>\r\n</ul>\r\n','simple','1','2016-11-30 04:37:44','2021-01-16 05:21:54',499.0,195.0,'C-Peptide Response to Glucose, 9 Specimens ',0),(31,'Candida albicans Antibodies (IgG, IgA, IgM)','candida-albicans-antibodiesigg-iga-igm','30440','<p><strong>Candida</strong> albicans is a dimorphic <a href=\"https://en.wikipedia.org/wiki/Fungus\">fungus</a> that grows both as <a href=\"https://en.wikipedia.org/wiki/Yeast\">yeast</a> and <a href=\"https://en.wikipedia.org/wiki/Hypha\">filamentous</a> cells and one of the few species of the <a href=\"https://en.wikipedia.org/wiki/Candida_(fungus)\">Candida</a> genus that cause the infection <a href=\"https://en.wikipedia.org/wiki/Candidiasis\">candidiasis</a> in humans.</p>\r\n\r\n<p><strong>Albicans</strong> is a common member of human <a href=\"https://en.wikipedia.org/wiki/Gut_flora\">gut flora</a> and is detectable in the gastrointestinal tract in 40% of healthy adults. The <a href=\"http://www.ndhealthfacts.org/wiki/Candida\">Candida</a> antigen tests typically monitors three specific antibodies and the Candida antigen itself:&nbsp;</p>\r\n\r\n<p><strong>IgG antibodies</strong></p>\r\n\r\n<p>IgG is the predominant antibody formed from secondary exposure to antigen, and reflects a past or ongoing infection. It is produced as IgM antibody levels decrease after primary exposure. IgG activates complement, and assists the phagocytic system to eliminate antigen from the extravascular space. The IgG antibodies represent the major class of human immunoglobulins and are evenly distributed throughout both our intra- and extravascular fluids. Note that specific IgG antibodies may persist for many years after an infection has been eradicated.&nbsp;</p>\r\n\r\n<p><strong>IgA antibodies</strong></p>\r\n\r\n<p>IgA is found in mucous secretions and is important in local (mucosal) immunity.Although representing only 15-20% of our human serum immunoglobulins, are the predominant antibody class found in seromucus secretions. High levels of specific IgA antibodies against Candida species as measured in serum are thought to be associated with mucosal epithelial, tracheobronchial, and genito-urinary candida infections.&nbsp;</p>\r\n\r\n<p><strong>IgM antibodies</strong></p>\r\n\r\n<p>IgM is the first antibody formed after primary exposure to antigen. IgM readily activates complement, and assists the phagocytic system to eliminate antigen from the intravascular space. IgM are confined in the body to our intravascular tissues and are generally regarded as the predominant immunoglobulins involved in early infections. Often, upon reinfection, IgM antibody levels may not be as elevated as in earlier infections.&nbsp;</p>\r\n\r\n<p><strong>Candida antigen&#39;</strong></p>\r\n\r\n<p>The detection of Candida antigen in serum is evidence that mucosal and immunological barriers have been overwhelmed</p>\r\n\r\n<p>&nbsp;</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 34 U/mL</li>\r\n	<li><strong>Turnaround Time:</strong> 1-5 Days</li>\r\n	<li><strong>Test Code:</strong> 30440</li>\r\n</ul>\r\n','simple','1','2016-11-30 04:43:27','2021-01-16 05:21:54',149.0,40.0,'Candida albicans Antibodies ',0),(32,'Creatine Kinase (CK) Total (myocardial infarction)','creatine-kinase-ck-total-myocardial-infarction','374','<p>Test for myocardial infarction and skeletal muscle damage. Elevated results may be due to: myocarditis, myocardial infarction (heart attack), muscular dystrophy, muscle trauma or&nbsp;excessive exercise.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<thead>\r\n			<tr>\r\n				<th>Age</th>\r\n				<th>Male</th>\r\n				<th>Female</th>\r\n			</tr>\r\n		</thead>\r\n		<tbody>\r\n			<tr>\r\n				<td>&nbsp;</td>\r\n				<td>(U/L)</td>\r\n				<td>(U/L)</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&le;3 Days</td>\r\n				<td>&lt;1578</td>\r\n				<td>&lt;1578</td>\r\n			</tr>\r\n			<tr>\r\n				<td>(newborn)</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>28 Days</td>\r\n				<td>&lt;183</td>\r\n				<td>&lt;134</td>\r\n			</tr>\r\n			<tr>\r\n				<td>11 Months</td>\r\n				<td>&lt;136</td>\r\n				<td>&lt;143</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6 Years</td>\r\n				<td>&lt;160</td>\r\n				<td>&lt;143</td>\r\n			</tr>\r\n			<tr>\r\n				<td>9 Years</td>\r\n				<td>&lt;177</td>\r\n				<td>&lt;143</td>\r\n			</tr>\r\n			<tr>\r\n				<td>12 Years</td>\r\n				<td>&lt;217</td>\r\n				<td>&lt;143</td>\r\n			</tr>\r\n			<tr>\r\n				<td>18 Years</td>\r\n				<td>&lt;245</td>\r\n				<td>&lt;143</td>\r\n			</tr>\r\n			<tr>\r\n				<td>18 Years</td>\r\n				<td>44-196</td>\r\n				<td>29-143</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 374</li>\r\n</ul>\r\n','simple','1','2016-11-30 04:54:49','2021-01-16 05:21:54',89.0,21.0,'Creatine Kinase (CK) Total (myocardial infarction)',0),(33,'Cortisol AM ','cortisol-am','4212','<p>Chronic stress and elevated cortisol levels can increase your risk to a list of various chronic diseases in addition to severe depression and altered hormones and a poor quality of life. &nbsp;A cortisol AM test is done to find problems of the pituitary gland or adrenal glands, such as making too much or too little hormones. The cortisol blood test measures the level of cortisol in the blood. Cortisol is a steroid (glucocorticoid) hormone produced by the adrenal gland.</p>\r\n\r\n<p>Your doctor may recommend you to also take a Cortisol PM test in conjunction with AM Cortisol.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>0-3 Days (infants)</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Premature (31-35 Weeks)</td>\r\n				<td>&le;15.0</td>\r\n				<td>&micro;g/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Term</td>\r\n				<td>&le;14.0</td>\r\n				<td>&micro;g/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Term</td>\r\n				<td>&le;14.0</td>\r\n				<td>&micro;g/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>4 Days-1 Month</td>\r\n				<td>Not established</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>2-11 Months 8 a.m. (7-9 a.m.) specimen</td>\r\n				<td>3.0-23.0</td>\r\n				<td>&micro;g/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-17 Years 8 a.m. (7-9 a.m.) specimen</td>\r\n				<td>3.0-25.0</td>\r\n				<td>&micro;g/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;17 Years 8 a.m. (7-9 a.m.) specimen</td>\r\n				<td>4.0-22.0</td>\r\n				<td>&micro;g/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong></li>\r\n	<li><strong>Test Prep:</strong> Must be taken at any Quest PSC before 9am</li>\r\n	<li><strong>Limitations:</strong> Assay is not recommended when patient is receiving prednisone/prednisolone therapy due to cross reactivity with the antibody used in this assay</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 4212</li>\r\n</ul>\r\n','simple','1','2016-11-30 05:06:03','2021-01-16 05:21:54',79.0,30.0,'Cortisol AM ',0),(34,'Cortisol PM ','cortisol-pm','4213','<p>Chronic stress and elevated cortisol levels can increase your risk to a list of various chronic diseases in addition to severe depression and altered hormones and a poor quality of life. A cortisol PM test is done to find problems of the pituitary gland or adrenal glands, such as making too much or too little hormones. The cortisol blood test measures the level of cortisol in the blood. Cortisol is a steroid (glucocorticoid) hormone produced by the adrenal gland.</p>\r\n\r\n<p>Your doctor may recommend you to also take a Cortisol AM test in conjunction with PM Cortisol.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>0-3 Days (infants)</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Premature (31-35 Weeks)</td>\r\n				<td>&le;15.0</td>\r\n				<td>&micro;g/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Term</td>\r\n				<td>&le;14.0</td>\r\n				<td>&micro;g/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>4 Days-11 Months</td>\r\n				<td>Not established</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;1 Year 4 p.m. (3-5 p.m.) specimen</td>\r\n				<td>3.0-17.0</td>\r\n				<td>&micro;g/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong></li>\r\n	<li><strong>Test Prep:</strong> Must be taken at any Quest PSC Between 3PM and 5PM</li>\r\n	<li><strong>Limitations:</strong> Assay is not recommended when patient is receiving prednisone/prednisolone therapy due to cross reactivity with the antibody used in this assay</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 4213</li>\r\n</ul>\r\n','simple','1','2016-11-30 05:09:36','2021-01-16 05:21:54',79.0,30.0,'Cortisol PM ',0),(35,'Cystatin C with Glomerular Filtration Rate, Estimated (eGFR)','cystatin-c-with-glomerular-filtration-rate-estimated-egfr','94588','<p>Cystatin C is a protein that is produced by the cells in your body. When kidneys are working well, they keep the level of cystatin C in your blood just right.</p>\r\n\r\n<p>If you have an abnormally high concentration of cystatin C in your blood, it means you may have a kidney condition, such as chronic kidney disease. Higher levels of cystatin C may also be caused by diabetes, cancer, HIV, hyperthyroidism, or hypothyroidism.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 0.50-1.00 mg/L</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 10570</li>\r\n</ul>\r\n','simple','1','2016-11-30 05:16:42','2021-01-16 05:21:54',99.0,35.0,'Cystatin C',0),(36,'Chlamydia & Gonorrhoeae RNA TMA ','chlamydia-gonorrhoeae-rna-tma','11363','<p><em>C. trachomatis</em> infections are the leading cause of sexually transmitted diseases in the United States. <em>C. trachomatis</em> is known to cause cervicitis, pelvic inflammatory disease (PID), epididymitis and proctitis. It is also the most frequent cause of non-gonococcal urethritis in men. Among women, the consequences of <em>Chlamydial</em> infections are severe if left untreated.&nbsp;</p>\r\n\r\n<p>Approximately half of <em>Chlamydial</em> infections are asymptomatic.</p>\r\n\r\n<p><em>Neisseria gonorrhoeae</em> (gonococci) is the causative agent of gonorrhea. In men, this disease generally results in anterior urethritis accompanied by purulent exudate. In women, the disease is most often found in the cervix, but the vagina and uterus may also be infected.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>C. trachomatis RNA, TMA</td>\r\n				<td>Not detected</td>\r\n			</tr>\r\n			<tr>\r\n				<td>N. gonorrhoeae RNA, TMA</td>\r\n				<td>Not detected</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Patient Prep:</strong> Urine specimens: The patient should not have urinated for at least one hour prior to specimen collection. Female patients should not cleanse the labial area prior to providing the specimen.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 11363</li>\r\n</ul>\r\n','simple','1','2016-11-30 05:22:22','2021-01-16 05:21:54',149.0,65.0,'Chlamydia & Gonorrhoeae RNA TMA ',0),(37,'Chlamydia RNA TMA ','chlamydia-rna-tma','11361','<p><em>C. trachomatis</em> infections are the leading cause of sexually transmitted diseases in the united states. <em>C. trachomatis</em> is known to cause cervicitis, pelvic inflammatory disease (PID), epididymitis and proctitis. It is also the most frequent cause of non-gonococcal urethritis in men. Among women, the consequences of chlamydial infections are severe if left untreated. Approximately half of chlamydial infections are asymptomatic.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>C. trachomatis RNA, TMA</td>\r\n				<td>Not detected</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Patient Prep:</strong> Urine specimens: The patient should not have urinated for at least one hour prior to specimen collection. Female patients should not cleanse the labial area prior to providing the specimen.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 11361</li>\r\n</ul>\r\n','simple','1','2016-11-30 05:26:36','2021-01-16 05:21:54',99.0,40.0,'Chlamydia RNA TMA ',0),(38,'Carnitine','carnitine','70107','<p>Serum carnitine analysis is useful in the diagnosis and monitoring of patients with carnitine deficiency (either primary or secondary). Primary carnitine deficiency is an autosomal recessively inherited genetic condition that affects carnitine uptake by cells and tissues through a defect in the plasma membrane carnitine transporter. Secondary carnitine deficiency can be seen in some disease states or in patients on carnitine-poor diets, but is also seen in a number of metabolic disorders. In these disorders, carnitine complexes with the accumulated substrate of the blocked metabolic step, and the resulting acylcarnitine ester is excreted in the urine, leading to a depletion of carnitine in the patient.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Test Includes:</strong> Carnitine, Total; Carnitine, Free; Carnitine, Esters; Esterified/Free Ratio</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Carnitine, Total</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult Male</td>\r\n				<td>30-70 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult Female</td>\r\n				<td>25-58 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male &le;17 Years</td>\r\n				<td>32-62 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female &le;17 Years</td>\r\n				<td>28-59 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female &le;17 Years</td>\r\n				<td>28-59 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Carnitine, Free</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult Male</td>\r\n				<td>23-59 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult Female</td>\r\n				<td>19-48 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male &le;17 Years</td>\r\n				<td>25-54 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female &le;17 Years</td>\r\n				<td>19-51 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Carnitine, Esters</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult Male</td>\r\n				<td>4-15 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult Female</td>\r\n				<td>4-13 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male &le;17 Years</td>\r\n				<td>4-12 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female &le;17 Years</td>\r\n				<td>3-16 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Esterified/Free Ratio</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult Male</td>\r\n				<td>0.12-0.39</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult Female</td>\r\n				<td>0.13-0.42</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male &le;17 Years</td>\r\n				<td>0.09-0.35</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female &le;17 Years</td>\r\n				<td>0.09-0.49</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Patient Prep:</strong> Patient should be in a well-fed state</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 70107</li>\r\n</ul>\r\n','simple','1','2016-11-30 05:34:05','2021-01-16 05:21:54',181.0,50.0,'Carnitine',0),(39,'Cadmium Random Urine','cadmium-random-urine','672','<p>Cadmium is a naturally occurring element that is mined and used in industrial production because of its durability. Excessive cadmium exposure can damage lungs, kidneys, and the digestive tract. Cadmium is an extremely toxic metal the kidney is the principal organ targeted by chronic exposure to cadmium. Cadmium nephrotoxicity may follow chronic inhalation or ingestion. Cadmium is a heavy metal of considerable toxicity with destructive impact on most organ systems. It is widely distributed in humans, the chief sources of contamination being cigarette smoke, welding, and contaminated food and beverages. Cadmium toxicity contributes to a large number of health conditions, including the major diseases such as heart disease, cancer and diabetes.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Cadmium</td>\r\n				<td>Random Urine</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Non-exposed Adult</td>\r\n				<td>&le;1.2 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>OSHA Reference Range for Industrial Exposure</td>\r\n				<td>&le;3.0 mcg/g creat</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li>___________________________________________________________________________</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Cadmium</td>\r\n				<td>Random Urine</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6 Months</td>\r\n				<td>2-32 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7-11 Months</td>\r\n				<td>2-36 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-2 Years</td>\r\n				<td>2-128 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3-8 Years</td>\r\n				<td>2-149 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>9-12 Years</td>\r\n				<td>2-183 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>12 Years</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>20-370 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>20-320 mg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 672</li>\r\n</ul>\r\n','simple','1','2016-11-30 05:59:01','2021-01-16 05:21:54',89.0,42.0,'Cadmium Random Urine',0),(40,'Celiac Disease Comprehensive Panel ','celiac-disease-comprehensive-panel','19955','<p>Celiac disease is caused by an immune response to gluten in genetically sensitive individuals. The diagnosis is largely based on a biopsy of the small intestine, but serologic tests also help support a diagnosis and may assist identification of patients who may require biopsy.</p>\r\n\r\n<p>Tissue transglutaminase antibodies (tTG, IgA) is a marker with 95% sensitivity and specificity. Total IgA is measured because 2-3% of celiac disease patients are IgA deficient. Because tTG, IgA, and anti-Gliadin IgA tend to decrease in patients on a gluten-free diet, these markers are also used to assess dietary compliance.</p>\r\n\r\n<p>The endomysial antibody (EMA, IgA) assay has high specificity for celiac disease and is used to confirm positive anti-tTG results</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Test Includes: </strong> Tissue Transglutaminase, IgA with Reflexes; Total IgA with Reflex</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>(tTG) Antibody, (IgA)</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&lt;4 U/mL</td>\r\n				<td>No antibody detected</td>\r\n			</tr>\r\n			<tr>\r\n				<td>4 U/mL</td>\r\n				<td>Antibody detected</td>\r\n			</tr>\r\n			<tr>\r\n				<td>IgA, Serum</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Cord Blood</td>\r\n				<td>1-3 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1 Month</td>\r\n				<td>2-43 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>2-5 Months</td>\r\n				<td>3-66 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6-9 Months</td>\r\n				<td>7-66 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-12 Months</td>\r\n				<td>12-75 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-3 Years</td>\r\n				<td>24-121 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>4-6 Years</td>\r\n				<td>33-235 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7-9 Years</td>\r\n				<td>41-368 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-11 Years</td>\r\n				<td>64-246 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>12-13 Years</td>\r\n				<td>70-432 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>14-15 Years</td>\r\n				<td>57-300 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;16 Years</td>\r\n				<td>81-463 mg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 19955</li>\r\n</ul>\r\n','simple','1','2016-11-30 06:12:22','2021-01-16 05:21:54',199.0,69.0,'Celiac Disease Comprehensive Panel ',0),(41,'Coenzyme Q10 (CoQ10)','coenzyme-q10-coq10','19826','<p>Coenzyme Q10 (CoQ10) is a fat soluble cofacter that is essential for energy producing metabolic pathways and for the proper functioning of the mitochondrial oxidative system. With insufficient CoQ10, the electron transfer activity of the mitochondria decreases, resulting in a net failure to produce the energy necessary to run the cell. Tissues with high energy demand have even greater demands for CoQ10. For example, heart muscle, which continually exerts a pumping action for an entire lifetime, has an immense need for the cofactor. Studies demonstrate the effectiveness of supplemental coenzyme Q10 in cardiomyopathy, myocardial dysfunction, and congestive heart failure. CoQ10 is also a powerful antioxidant like vitamins&nbsp;E and C, and thus serves the role of neutralizing excess free radicals. It is now well established that the control of excessive free radical activity is key in preventing/delaying the progression of degenerative diseases.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Patient Preparation: </strong> Patient should fast 8-12 hours prior to collection. Patient may have water. It is not necessary to discontinue nutritional supplements prior to this test.</li>\r\n	<li><strong>Reference Range(s):</strong> 0.44-1.64 mg/L</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 19826</li>\r\n</ul>\r\n','simple','1','2016-11-30 06:20:21','2021-01-16 05:21:54',149.0,55.0,'Coenzyme Q10 (CoQ10)',0),(42,'Cardio IQ® Advanced Lipid Profile Test ','cardio-iq-advanced-lipid-profile-test','92145','<p>This test goes far beyond your basic lipid test, for starters this test helps to reclassify a patients cardiovascular risk. Nearly&nbsp;half of all heart attack patients were found to have no prior risk which would&nbsp;indicate they were heading toward an attack. Cardio IQ Ion Mobility tests directly detects,&nbsp; measures and quantifies the number and size of all lipoprotein subfractions.&nbsp; Knowing what particles make up your LDL and HDL cholesterol may be important. Ion Mobility Technology provides&nbsp;subclass separation that will allow your healthcare provider to identify your cardiovascular risk over time. Following&nbsp;the change in your lipid profile as you respond to diet, exercise and possible medication to reduce your cardiovascular&nbsp;risk is important. Ion Mobility provides the opportunity to determine if treatment is working and if not, optimize the&nbsp;aggressiveness of therapy to hopefully make a difference that can be seen in the Ion Mobility measurement and graphical&nbsp;representation of your LDL and HDL particles.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes 10-12 Hours</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Test includes:</strong> Cardio IQ&reg; Cholesterol, Total; Cardio IQ&reg; HDL Cholesterol; Cardio IQ&reg; Triglycerides; Cardio IQ&reg; Non-HDL and Calculated Components; Cardio IQ&reg; Lipoprotein Fractionation, Ion Mobility; Cardio IQ&reg; Apolipoprotein B; Cardio IQ&reg; Lipoprotein (a)</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 92145</li>\r\n</ul>\r\n','simple','1','2016-11-30 06:29:59','2021-01-16 05:21:54',199.0,99.0,'Cardio IQ® Advanced Lipid Profile Test ',0),(43,'Cardio IQ® Lipoprotein Fractionation, Ion Mobility  ','cardio-iq-lipoprotein-fractionation-ion-mobility','91604','<p>Ion mobility fractionation is the latest technology in the evolution of advanced lipid subclass measurement. There is a correlation between increased risk of premature heart disease with decreasing size of LDL particles. Ion mobility offers the only direct measurement of lipoprotein particle size and concentration for each lipoprotein from HDL3 to large VLDL.&nbsp;</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes 10-12 Hours</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Test includes:</strong> LDL Particle Number; LDL Small; LDL Medium; HDL Large; LDL Pattern; LDL Peak Size</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 91604</li>\r\n</ul>\r\n','simple','1','2016-11-30 06:41:02','2021-01-16 05:21:54',110.0,53.0,'Cardio IQ® Lipoprotein Fractionation, Ion Mobility  ',0),(44,'Cardio IQ® Apolipoprotein B','cardio-iq-apolipoprotein-b','91726','<p>Apolipoprotein&nbsp;B (APO B) has been reported to be a powerful indicator of CAD. In some patients with CAD, APO B is elevated even in the presence of normal&nbsp;LDL cholesterol. Apo B is a protein that is involved in the metabolism of lipids and is the main protein constituent of lipoproteins such as very low-density lipoprotein (VLDL) and low-density lipoprotein (LDL, the &ldquo;bad cholesterol&rdquo;). Concentrations of apo B tend to mirror those of LDL-C. There are two major forms of Apolipoprotein B, B-100 and B-48. B-100, synthesized in the liver, is the major protein in VLDL, IDL, and LDL cholesterol. B-48, synthesized in the intestines, is essential for the assembly and secretion of chylomicrons. Patients with increased concentrations of Apolipoprotein B are at increased risk of atherosclerosis.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes 10-12 Hours</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Reference Range</td>\r\n				<td>Male</td>\r\n				<td>Female</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&nbsp;</td>\r\n				<td>52-109 mg/dL</td>\r\n				<td>49-103 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Risk Category</td>\r\n				<td>Male</td>\r\n				<td>Female</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Optimal</td>\r\n				<td>&lt;80 mg/dL</td>\r\n				<td>&lt;80 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Moderate</td>\r\n				<td>80-119 mg/dL</td>\r\n				<td>80-119 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>High</td>\r\n				<td>?120 mg/dL</td>\r\n				<td>?120 mg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 91726</li>\r\n</ul>\r\n','simple','1','2016-11-30 06:50:39','2021-01-16 05:21:54',89.0,35.0,'Cardio IQ® Apolipoprotein B',0),(45,'Cardio IQ® Lipoprotein (a)','cardio-iq-lipoprotein-a','91729','<p>This test assesses your risk of cardiovascular disease, Lipoprotein(a) [Lp(a)] is composed of a low density lipoprotein particle and one apolipoprotein B100 molecule linked by a disulfide bond to apolipoprotein(a) [apo(a)]. Apo(a) differs in size due to a variable number of kringle IV repeats. This variation gives rise to multiple Lp(a) isoforms within a population but not within an individual. Genetically determined isoforms with fewer kringle IV repeats are associated with higher Lp(a) blood levels. Lp(a) possesses structural homology with plasminogen and plasmin and can potentially increase cardiovascular disease (CVD) risk by antiplasminogen activity.</p>\r\n\r\n<p>Increased blood levels of Lp(a) are associated with increased risk of atherosclerosis, leading to coronary heart disease (CHD), myocardial infarction, and premature CHD. Increased levels are also associated with ischemic stroke.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes 10-12 Hours</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> &lt;75 nmol/L</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 91729</li>\r\n</ul>\r\n','simple','1','2016-11-30 06:54:42','2021-01-16 05:21:54',89.0,39.0,'Cardio IQ® Lipoprotein (a)',0),(46,'Digoxin','digoxin','418','<p>Digoxin is a drug used to treat heart failure and this test is used for therapeutic Drug Monitoring. Digoxin is a cardiac glycoside derived from the digitalis plant. It is used to treat congestive heart failure and atrial dysrhythmias. Digoxin levels are monitored to assure adequate therapeutic levels are achieved and to avoid toxicity.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 0.8-2.0 µg/L</li>\r\n	<li><strong>Limitations:</strong>  Spironolactone and some herbal drugs may interfere with this test.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 418</li>\r\n</ul>\r\n','simple','1','2016-11-30 07:02:18','2021-01-16 05:21:54',59.0,32.0,'Digoxin',0),(47,'D-Dimer Quantitative (Detects Blood Clots) ','d-dimer-quantitative-detects-blood-clots','8659','<p>D-Dimer is one of the measurable by-products of activation of the fibrinolytic system. Quantitation of D-Dimer assesses fibrinolytic activation and intravascular thrombosis. D-Dimer is of particular value in excluding the diagnosis of venous thromboembolism among patients at high risk.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Limitations:</strong> In patients with low or moderate probability of clots in the deep veins of the leg, a negative D-Dimer result generally rules out DVT. Some patients with blood clots will be false-negatives. This is most common among older patients, those who have undergone prolonged hospitalization, and those with markedly elevated C-reactive protein levels.</li>\r\n	<li><strong>Reference Range(s):</strong> &lt;0.50 mcg/mL FEU</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 8659</li>\r\n</ul>\r\n','simple','1','2016-11-30 07:05:56','2021-01-16 05:21:54',199.0,105.0,'D-Dimer Quantitative (Detects Blood Clots) ',0),(48,'DPT Titer Diphtheria Antitoxoid, Pre and Post Vaccination ','dpt-titer-diphtheria-antitoxoid-pre-and-post-vaccination','10680','<p>This test will detect prior and post vaccination to these 3 diseases: diphtheria, pertussis (whooping cough), and tetanus.&nbsp;</p>\r\n\r\n<p><strong>Diphtheria</strong>: is an infection caused by the bacterium <em>Corynebacterium diphtheriae</em>. Diphtheria causes a thick covering in the back of the throat. It can lead to difficulty breathing, heart failure, paralysis, and even death. According to the CDC Vaccines are recommended for infants, children, teens and adults to prevent diphtheria.&nbsp;</p>\r\n\r\n<p><strong>Pertussis</strong>: a respiratory illness commonly known as whooping cough, is a very contagious disease caused by a type of bacteria called <em>Bordetella pertussis</em>. These bacteria attach to the cilia (tiny, hair-like extensions) that line part of the upper respiratory system. The bacteria release toxins (poisons), which damage the cilia and cause airways to swell.</p>\r\n\r\n<p><strong>Tetanus</strong>: is an infection caused by bacteria called <em>Clostridium tetani</em>. When the bacteria invade the body, they produce a poison (toxin) that causes painful muscle contractions. Another name for tetanus is &quot;lockjaw&quot; because it often causes a person&#39;s neck and jaw muscles to lock, making it hard to open the mouth or swallow. According to the CDC vaccines are recommended for infants, children, teens and adults to prevent tetanus.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Diphtheria Antitoxoid Pre</td>\r\n				<td>No reference range available</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Diphtheria Antitoxoid Post</td>\r\n				<td>&ge;0.01 IU/mL (Post-Vaccination)</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Interpretive Criteria</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&lt;0.01 IU/mL</td>\r\n				<td>Nonprotective antibody level</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;0.01 IU/mL</td>\r\n				<td>Protective antibody level</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 2 Days</li>\r\n	<li><strong>Test Code:</strong> 10680</li>\r\n</ul>\r\n','simple','1','2016-11-30 07:10:55','2021-01-16 05:21:54',129.0,65.0,'DPT Titer Diphtheria Antitoxoid, Pre and Post Vaccination ',0),(49,'DHEA (Dehydroepiandrosterone)','dhea-dehydroepiandrosterone','19894','<p>Dehydroepiandrosterone (DHEA) is a hormone that comes from the adrenal gland. It is also made in the brain. DHEA leads to the production of androgens and estrogens (male and female sex hormones). DHEA levels in the body begin to decrease after age 30.</p>\r\n\r\n<p>Dehydroepiandrosterone (DHEA) is a hormone that comes from the adrenal gland. It is also made in the brain. DHEA leads to the production of androgens and estrogens (male and female sex hormones). DHEA levels in the body begin to decrease after age 30.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Adult</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>61-1636</td>\r\n				<td>ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>102-1185</td>\r\n				<td>ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Pediatric</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&lt;1 Year</td>\r\n				<td>Not established</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-5 Years</td>\r\n				<td>&le;377</td>\r\n				<td>ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6-9 Years</td>\r\n				<td>19-592</td>\r\n				<td>ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-13 Years</td>\r\n				<td>42-1067</td>\r\n				<td>ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>14-17 Years</td>\r\n				<td>137-1489</td>\r\n				<td>ng/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 19894</li>\r\n</ul>\r\n','simple','1','2016-11-30 07:22:02','2021-01-16 05:21:54',129.0,55.0,'DHEA (Dehydroepiandrosterone)',0),(50,'Dihydrotestosterone Free (DHT)','dihydrotestosterone-free-dht','36168','<p>The enzyme (a substance produced by the body to help bring about a biochemical reaction) called 5&alpha;-reductase synthesises DHT from testosterone in areas like the prostate and hair follicles, as well as the testes and adrenal glands. Essentially DHT is made from testosterone and helps the body grow and regulate itself. But while testosterone is at the core of the balding process, dihydrotestosterone (DHT) is now thought to be the main culprit. DHT, a derivative of the male hormone testosterone, is the enemy of hair follicles on your head.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Includes:</strong> Dihydrotestosterone, %DHT Free, DHT, Free</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Dihydrotestosterone, LC/MS/MS</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Females:</td>\r\n				<td>5-46 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Males:</td>\r\n				<td>16-79 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>DHT, Free</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult females:</td>\r\n				<td>0.30-1.90 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult males:</td>\r\n				<td>1.00-6.20 pg/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 9 Days</li>\r\n	<li><strong>Test Code:</strong> 36168</li>\r\n</ul>\r\n','simple','1','2016-11-30 08:06:22','2021-01-16 05:21:54',199.0,65.0,'Dihydrotestosterone Free (DHT)',0),(52,'Epstein-Barr Virus Antibody Panel ','epstein-barr-virus-antibody-panel','6421','<p>Primary infection by&nbsp;EBV causes infectious mononucleosis, usually a self-limiting disease in children and young adults. Infection with EBV can cause lymphoproliferative disorders including tumors. VCA-IgM is typically detectable at clinical presentation, then declines to undetectable levels within a month in young children and within 3 months in other individuals. VCA-IgG is typically detectable at clinical presentation, and persists for life. EBNA IgG typically appears during convalescence (3-4 months after clinical presentation) and remains detectable for life.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Test Includes:</strong> Epstein-Barr Virus VCA Antibody (IgM), Epstein-Barr Virus VCA Antibody (IgG), Epstein-Barr Virus Nuclear Antigen (EBNA) Antibody (IgG)</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Epstein-Barr Virus VCA Antibody (IgM)</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&le;0.90</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>0.91-1.09</td>\r\n				<td>Equivocal</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;1.10</td>\r\n				<td>Positive</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Epstein-Barr Virus VCA Antibody (IgG)</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&le;0.90</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>0.91-1.09</td>\r\n				<td>Equivocal</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;1.10</td>\r\n				<td>Positive</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Epstein-Barr Virus Nuclear Antigen (EBNA) Antibody (IgG)</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&le;0.90</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>0.91-1.09</td>\r\n				<td>Equivocal</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;1.10</td>\r\n				<td>Positive</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 6421</li>\r\n</ul>\r\n','simple','1','2016-12-01 00:02:12','2021-01-16 05:21:54',189.0,68.0,'Epstein-Barr Virus Antibody Panel ',0),(53,'Erythropoietin','erythropoietin','427','<p>Elevated levels of serum erythropoietin (EPO) occur in patients with anemias due to increased red cell.&nbsp;</p>\r\n\r\n<p>Erythropoietin (EPO) is a&nbsp;hormone&nbsp;produced primarily by the kidneys. It plays a key role in the production of red blood cells (RBCs), which carry oxygen from the lungs to the rest of the body. This test measures the amount of erythropoietin in the blood.</p>\r\n\r\n<p>If too much erythropoietin is produced, as occurs with some&nbsp;benign&nbsp;or&nbsp;malignant&nbsp;kidney tumors and with a variety of other cancers, too many RBCs may be produced (polycythemia&nbsp;or erythrocytosis). This can lead to an increase in the blood&#39;s thickness (viscosity) and sometimes to high blood pressure (hypertension), blood clots (thrombosis),&nbsp;heart attack, or&nbsp;stroke.&nbsp;</p>\r\n','<ul style=\"padding-right: 0px; padding-left: 0px; box-sizing: border-box; margin-top: 45px; margin-bottom: 0px; font-family: Raleway, Arial, sans-serif; font-size: 14px; transition: all 0.3s ease 0s !important;\">\r\n	<li style=\"box-sizing: border-box; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em; transition: all 0.3s ease 0s !important;\">\r\n	<h2 class=\"h2-subhead ng-scope\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 16px; margin: 0px; color: rgba(0, 0, 0, 0.87); font-family: Akkurat, sans-serif;\">Reference Range(s)</h2>\r\n\r\n	<div class=\"qd-test-center__test-detail-container--content ng-binding ng-scope\" ng-bind-html=\"testDetails.ReferenceRange\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 14px; margin-top: 8px; margin-bottom: 26px; line-height: 1.3em; font-family: Akkurat, sans-serif;\">\r\n	<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"border-collapse: collapse; border-spacing: 0px;\" summary=\"\" width=\"400\">\r\n		<tbody>\r\n			<tr>\r\n				<td>&nbsp;</td>\r\n				<td><span style=\"font-weight: 700; font-family: sans-serif !important;\">Male (mIU/mL)</span></td>\r\n				<td><span style=\"font-weight: 700; font-family: sans-serif !important;\">Female (mIU/mL)</span></td>\r\n			</tr>\r\n			<tr>\r\n				<td>&lt;1 Year</td>\r\n				<td>Not established</td>\r\n				<td>Not established</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-3 Years</td>\r\n				<td>1.7-17.9</td>\r\n				<td>2.1-15.9</td>\r\n			</tr>\r\n			<tr>\r\n				<td>4-6 Years</td>\r\n				<td>3.5-21.9</td>\r\n				<td>2.9-8.5</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7-9 Years</td>\r\n				<td>1.0-13.5</td>\r\n				<td>2.1-8.2</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-12 Years</td>\r\n				<td>1.0-14.0</td>\r\n				<td>1.1-9.1</td>\r\n			</tr>\r\n			<tr>\r\n				<td>13-15 Years</td>\r\n				<td>2.2-14.4</td>\r\n				<td>3.8-20.5</td>\r\n			</tr>\r\n			<tr>\r\n				<td>16-18 Years</td>\r\n				<td>1.5-15.2</td>\r\n				<td>2.0-14.2</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;18 Years</td>\r\n				<td>2.6-18.5</td>\r\n				<td>2.6-18.5</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</div>\r\n	</li>\r\n	<li style=\"box-sizing: border-box; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em; transition: all 0.3s ease 0s !important;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Fasting Required:</span>&nbsp;No</li>\r\n	<li style=\"box-sizing: border-box; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em; transition: all 0.3s ease 0s !important;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Preferred Specimen:</span>&nbsp;Serum</li>\r\n	<li style=\"box-sizing: border-box; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em; transition: all 0.3s ease 0s !important;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Turnaround Time:</span>&nbsp;3 Days</li>\r\n	<li style=\"box-sizing: border-box; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em; transition: all 0.3s ease 0s !important;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Test Code:</span>&nbsp;427</li>\r\n	<li style=\"box-sizing: border-box; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em; transition: all 0.3s ease 0s !important;\"><span style=\"font-family: Akkurat, sans-serif; font-size: 14px;\">Due to diurnal variation, it is recommended that specimens be collected between 7: 30am and noon</span></li>\r\n</ul>\r\n','simple','1','2016-12-01 00:24:11','2021-01-16 05:21:54',199.0,42.0,'Erythropoietin',0),(54,'Estriol','estriol','34883','<p>The placenta converts DHEA-S produced by the fetal adrenals to Estriol and other estrogens. Estriol is useful in assessing the fetal adrenals and placenta during pregnancy. More commonly, Estriol is one of the maternal serum biochemical markers used to screen for common chromosomal trisomies, especially Down syndrome. Experts suggest that abnormal Estriol levels can lead to various disease conditions in the body.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Adult Male</td>\r\n				<td>&le;0.18 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult Female (Non-pregnant)</td>\r\n				<td>&le;0.21 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Pregnancy</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>First trimester</td>\r\n				<td>&le;2.50 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Second trimester</td>\r\n				<td>&le;9.60 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Third trimester</td>\r\n				<td>&le;14.60 ng/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 34883</li>\r\n</ul>\r\n','simple','1','2016-12-01 00:28:58','2021-01-16 05:21:55',189.0,48.0,'Estriol',0),(55,'Estrone','estrone','23244','<p>Estrone is primarily derived from metabolism of androstenedione in peripheral tissues, especially adipose tissues.&nbsp;Individuals with obesity have increased conversion of androstenedione to Estrone leading to higher concentrations.&nbsp;In addition, an increase in the ratio of Estrone to Estradiol may be useful in assessing menopause in women.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Adult</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Follicular Stage</td>\r\n				<td>10-138 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Luteal Stage</td>\r\n				<td>16-173 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Postmenopausal</td>\r\n				<td>&le;65 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>&le;68 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Pediatric</td>\r\n				<td>Male (pg/mL)</td>\r\n				<td>Female (pg/mL)</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Pre-pubertal (1-9 Years)</td>\r\n				<td>&lt;10</td>\r\n				<td>&le;34</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-11 Years</td>\r\n				<td>&le;12</td>\r\n				<td>&le;72</td>\r\n			</tr>\r\n			<tr>\r\n				<td>12-14 Years</td>\r\n				<td>&le;28</td>\r\n				<td>&le;75</td>\r\n			</tr>\r\n			<tr>\r\n				<td>15-17 Years</td>\r\n				<td>&le;64</td>\r\n				<td>&le;188</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 23244</li>\r\n</ul>\r\n','simple','1','2016-12-01 00:36:23','2021-01-16 05:21:55',199.0,55.0,'Estrone',0),(56,'Estrogen Total ','estrogen-total','439','<p>Estrogens are secreted by the gonads, adrenal glands, and placenta. Total estrogens provide an overall picture of estrogen status for men and women.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Adult Female</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Follicular Phase (1-12 days)</td>\r\n				<td>90-590 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Luteal Phase</td>\r\n				<td>130-460 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Postmenopausal</td>\r\n				<td>50-170 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult Male</td>\r\n				<td>60-190 pg/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 439</li>\r\n</ul>\r\n','simple','1','2016-12-01 00:44:57','2021-01-16 05:21:55',129.0,55.0,'Estrogen Total ',0),(57,'Estradiol','estradiol','4021','<p>Measuring the circulating levels of estradiol is important for assessing the ovarian function and monitoring follicular development for assisted reproduction protocols. Estradiol plays an essential role throughout the human menstrual cycle. Elevated estradiol levels in females may also result from primary or secondary ovarian hyperfunction. Very high estradiol levels are found during the induction of ovulation for assisted reproduction therapy or in pregnancy. Decreased estradiol levels in females may result from either lack of ovarian synthesis (primary ovarian hypofunction and menopause) or a lesion in the hypothalamus-pituitary axis (secondary ovarian hypofunction). Elevated estradiol levels in males may be due to increased aromatization of androgens, resulting in gynecomastia.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Follicular Phase</td>\r\n				<td>19-144 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Mid-Cycle</td>\r\n				<td>64-357 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Luteal Phase</td>\r\n				<td>56-214 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Postmenopausal</td>\r\n				<td>&le;31 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>&le;39 pg/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 4021</li>\r\n</ul>\r\n','simple','1','2016-12-01 00:49:32','2021-01-16 05:21:55',99.0,31.0,'Estradiol',0),(58,'Estradiol Free','estradiol-free','36169','<p>Much of estradiol is bound to proteins. The unbound portion and estradiol bound to proteins with low affinity reflect the free concentration. The free estradiol may better correlate with medical conditions than the total estradiol concentrations.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Estradiol, Free</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Follicular Stage</td>\r\n				<td>0.43-5.03 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Mid-Cycle Stage</td>\r\n				<td>0.72-5.89 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Luteal Stage</td>\r\n				<td>0.40-5.55 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Postmenopausal</td>\r\n				<td>&le;0.38 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult Male</td>\r\n				<td>&le;0.45 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Estradiol</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Follicular Stage</td>\r\n				<td>39-375 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Mid-Cycle Stage</td>\r\n				<td>94-762 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Luteal Stage</td>\r\n				<td>48-440 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Postmenopausal</td>\r\n				<td>&le;10 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult Male</td>\r\n				<td>&le;29 pg/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 36169</li>\r\n</ul>\r\n','simple','1','2016-12-01 01:03:07','2021-01-16 05:21:55',199.0,65.0,'Estradiol Free',0),(59,'Ferritin','ferritin','457','<p>Useful in the diagnosis of hypochromic, microcytic anemias. Decreased in iron deficiency anemia and increased in iron overload. Decreased ferritin levels are associated with iron deficiency anemia. Elevated levels, on the other hand, are associated with sideroblastic anemia, hemochromatosis, and acute iron poisoning. Ferritin may also be increased in acute and chronic liver disease (including hepatitis and hepatoma), in non-iron deficiency anemia (aplastic, megaloblastic, hemolytic, thalassemia major and minor, spherocytosis, porphyria cutanea tarda), alcoholism, pregnancy, malignancy (leukemia, lymphoma, Hodgkin&rsquo;s disease, renal cell carcinoma), infection, inflammation (arthritis), hyperthyroidism, Gaucher&rsquo;s disease, acute myocardial infarction, and following a recent blood transfusion. In acute phase reactions, a bone marrow stain may be required to detect concurrent iron deficiency anemia.&nbsp;</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Limitations:</strong> Liver dysfunction and other factors can cause a reduction in the clearance of serum ferritin resulting in an increase in serum ferritin levels. Ferritin is an acute phase reactant that may be elevated in a wide-range of inflammatory conditions and infections. Clinical studies suggest the sensitivity may be 35-48% and specificity of 75-78% to detect iron deficiency.</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Age</td>\r\n				<td>Male</td>\r\n				<td>Female</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&lt;4 Days</td>\r\n				<td>Not established</td>\r\n				<td>Not established</td>\r\n			</tr>\r\n			<tr>\r\n				<td>4-14 Days</td>\r\n				<td>100-717 ng/mL</td>\r\n				<td>100-717 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>15 Days-5 Months</td>\r\n				<td>14-647 ng/mL</td>\r\n				<td>14-647 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6-11 Months</td>\r\n				<td>8-182 ng/mL</td>\r\n				<td>8-182 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-4 Years</td>\r\n				<td>5-100 ng/mL</td>\r\n				<td>5-100 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>5-13 Years</td>\r\n				<td>14-79 ng/mL</td>\r\n				<td>14-79 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>14-15 Years</td>\r\n				<td>13-83 ng/mL</td>\r\n				<td>6-67 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>16-19 Years</td>\r\n				<td>11-172 ng/mL</td>\r\n				<td>6-67 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>20-39 Years</td>\r\n				<td>20-345 ng/mL</td>\r\n				<td>10-154 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>40-59 Years</td>\r\n				<td>20-380 ng/mL</td>\r\n				<td>10-232 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;59 Years</td>\r\n				<td>20-380 ng/mL</td>\r\n				<td>20-288 ng/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 457</li>\r\n</ul>\r\n','simple','1','2016-12-01 01:12:07','2021-01-16 05:21:55',49.0,24.0,'Ferritin',0),(60,'Fibrinogen Activity','fibrinogen-activity','461','<p>Fibrinogen is essential for the formation of a blood clot. Deficiency can produce mild to severe bleeding disorders. Low fibrinogen levels can also cause thrombosis due to an increase in coagulation activity. Thrombosis refers to the formation of a blood clot inside of a blood vessel. The clot blocks the normal flow of blood through the circulatory system. This can lead to serious medical conditions such as heart attack and stroke.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Plasma</li>\r\n	<li><strong>Limitations:</strong> Expected impact by therapeutic levels (potential interference depends upon drug concentration): Warfarin: no effect; Heparin (UFH or LMWH): UFH-no effect, LMWH-normal to falsely low; Dabigatran or Argatroban (Thrombin Inhibitors): no effect or falsely low; Rivaroxaban or Apixaban (Factor Xa Inhibitors): no effect.</li>\r\n	<li><strong>Reference Range(s):</strong> 175-425 mg/dL</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 461</li>\r\n</ul>\r\n','simple','1','2016-12-01 01:18:00','2021-01-16 05:21:55',89.0,37.0,'Fibrinogen Activity',0),(61,'Folate (Folic Acid)','folate-folic-acid','466','<p>&nbsp;Folic acid deficiency is common in pregnant women, alcoholics, in patients whose diets do not include raw fruits and vegetables, and in people with structural damage to the small intestine. The most reliable and direct method of diagnosing folate deficiency is the determination of folate levels in both erythrocytes and serum. Low folic acid levels, however, can also be the result of a primary vitamin B12 deficiency that decreases the ability of cells to take up folic acid.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>?4 years:</td>\r\n				<td>Not established</td>\r\n			</tr>\r\n			<tr>\r\n				<td>5-9 years:</td>\r\n				<td>&gt;7.1 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-17 years:</td>\r\n				<td>&gt;8.0 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>?18 years:</td>\r\n				<td>Low: &lt;3.4 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Borderline:</td>\r\n				<td>3.4-5.4 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Normal:</td>\r\n				<td>&gt;5.4 ng/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 466</li>\r\n</ul>\r\n','simple','1','2016-12-01 01:23:22','2021-01-16 05:21:55',89.0,29.0,'Folate (Folic Acid)',0),(62,'FSH (Follicle Stimulating Hormone)','fsh-follicle-stimulating-hormone','470','<p>It&#39;s responsible for the growth of ovarian follicles. Follicles produce estrogen and progesterone in the ovaries and help maintain the menstrual cycles in women. In men, FSH is a part of the development of the gonads as well as sperm production. The FSH test measures the level of FSH found in your blood. This test is also useful in the differential diagnosis of pituitary and gonadal insufficiency and in children with precocious puberty.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Limitations:</strong> Only third generation FSH testing is appropriate to assess gonadal dysfunction in non-adults (&lt;18 years). Combined with luteinizing hormone (LH), FSH is useful in the diagnosis and management of infertility and in monitoring FSH suppressive therapy.</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>1.6-8.0 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Follicular Phase</td>\r\n				<td>2.5-10.2 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Mid-Cycle Peak</td>\r\n				<td>3.1-17.7 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Luteal Phase</td>\r\n				<td>1.5-9.1 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Postmenopausal</td>\r\n				<td>23.0-116.3 mIU/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 470</li>\r\n</ul>\r\n','simple','1','2016-12-01 01:29:45','2021-01-16 05:21:55',79.0,22.0,'FSH (Follicle Stimulating Hormone)',0),(63,'FTA-ABS ','fta-abs','4112','<p>The FTA-ABS is a specific treponemal assay to detect antibody to <em>t. Pallidum</em>. The FTA-ABS becomes reactive 4-6 weeks after infection. Unlike the nontreponemal tests, once the FTA-ABS test becomes reactive, it will remain reactive for many years. Since the reactivity found with the FTA-ABS does not indicate response to therapy, it is not suitable for monitoring treatment. The FTA-ABS test does not distinguish between syphillis and other treponematoses such as yaws, pinta and bejil.</p>\r\n\r\n<p><strong><em>t. Pallidum</em></strong>: Treponema pallidum is a spirochaete bacterium with subspecies that cause treponemal diseases such as syphilis, bejel, pinta, and yaws. The treponemes have a cytoplasmic and an outer membrane.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> Non-Reactive</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 4112</li>\r\n</ul>\r\n','simple','1','2016-12-01 01:33:06','2021-01-16 05:21:55',69.0,27.0,'FTA-ABS ',0),(64,'FSH and LH','fsh-and-lh','7137','<p>FSH and LH are secreted by the anterior pituitary in response to gonadotropin-releasing hormone (GNRH) secreted by the hypothalamus. In both males and females, FSH and LH secretion is regulated by a balance of positive and negative feedback mechanisms involving the hypothalamic-pituitary axis, the reproductive organs, and the pituitary and sex steroid hormones. FSH and LH play a critical role in maintaining the normal function of the male and female reproductive systems. Abnormal FSH levels with corresponding increased or decreased levels of LH, estrogens, progesterone, and testosterone are associated with a number of pathological conditions. Increased FSH levels are associated with menopause and primary ovarian hypofunction in females and primary hypogonadism in males. Decreased levels of FSH are associated with primary ovarian hyper-function in females and primary hypergonadism in males. Normal or decreased levels of FSH are associated with polycystic ovary disease in females. In males, LH is also called interstitial cell-stimulating hormone (ICSH). Abnormal LH levels with corresponding increased or decreased levels of FSH, estrogens, progesterone, and testosterone are associated with a number of pathological conditions. Increased LH levels are associated with menopause, primary ovarian hypofunction, and polycystic ovary disease in females and primary hypo-gonadism in males. Decreased LH levels are associated with primary ovarian hyperfunction in females and primary hyper-gonadism in males.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>FSH</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>1.6-8.0 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Follicular Phase</td>\r\n				<td>2.5-10.2 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Mid-Cycle Peak</td>\r\n				<td>3.1-17.7 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Luteal Phase</td>\r\n				<td>1.5- 9.1 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Postmenopausal</td>\r\n				<td>23.0-116.3 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>LH</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>18-59 Years</td>\r\n				<td>1.5-9.3 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;60 Years</td>\r\n				<td>1.6-15.2 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Follicular Phase</td>\r\n				<td>1.9-12.5 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Mid-Cycle Peak</td>\r\n				<td>8.7-76.3 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Luteal Phase</td>\r\n				<td>0.5-16.9 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Postmenopausal</td>\r\n				<td>10.0-54.7 mIU/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 7173</li>\r\n</ul>\r\n','simple','1','2016-12-01 02:36:13','2021-01-16 05:21:55',99.0,40.0,'FSH and LH',0),(65,'Gamma Glutamyl Transferase (GGT)','gamma-glutamyl-transferase-ggt','482','<p>&nbsp;Elevated GGT is found in all forms of liver disease. Measurement of GGT is used in the diagnosis and treatment of alcoholic cirrhosis, as well as primary and secondary liver tumors. It is more sensitive than alkaline phosphatase, the transaminases, and leucine aminopeptidase in detecting obstructive jaundice, cholangitis, and cholecystitis. Normal levels of GGT are seen in skeletal diseases; thus, GGT in serum can be used to ascertain whether a disease, suggested by elevated alkaline phosphatase, is skeletal or hepatobiliary.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&nbsp;</td>\r\n				<td>Male (U/L)</td>\r\n				<td>Male (U/L)</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&lt;6 Months</td>\r\n				<td>12-122</td>\r\n				<td>15-132</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6-11 Months</td>\r\n				<td>&le;39</td>\r\n				<td>&le;39</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-12 Years</td>\r\n				<td>3-22</td>\r\n				<td>3-22</td>\r\n			</tr>\r\n			<tr>\r\n				<td>13-15 Years</td>\r\n				<td>8-32</td>\r\n				<td>7-18</td>\r\n			</tr>\r\n			<tr>\r\n				<td>16-19 Years</td>\r\n				<td>9-31</td>\r\n				<td>6-26</td>\r\n			</tr>\r\n			<tr>\r\n				<td>20-29 Years</td>\r\n				<td>3-70</td>\r\n				<td>3-40</td>\r\n			</tr>\r\n			<tr>\r\n				<td>30-39 Years</td>\r\n				<td>3-90</td>\r\n				<td>3-50</td>\r\n			</tr>\r\n			<tr>\r\n				<td>40-54 Years</td>\r\n				<td>3-95</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>40-49 Years</td>\r\n				<td>&nbsp;</td>\r\n				<td>3-55</td>\r\n			</tr>\r\n			<tr>\r\n				<td>50-59 Years</td>\r\n				<td>&nbsp;</td>\r\n				<td>3-70</td>\r\n			</tr>\r\n			<tr>\r\n				<td>55-59 Years</td>\r\n				<td>3-85</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;60 Years</td>\r\n				<td>3-70</td>\r\n				<td>3-65</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 482</li>\r\n</ul>\r\n','simple','1','2016-12-01 02:48:03','2021-01-16 05:21:55',59.0,18.0,'Gamma Glutamyl Transferase (GGT)',0),(66,'Glucose','glucose','483','<p>Serum glucose levels may be abnormally high (hyperglycemia) or abnormally low (hypoglycemia). Glucose measurements are used in the diagnosis and treatment of carbohydrate metabolic disorders including diabetes mellitus, idiopathic hypoglycemia, and pancreatic islet cell neoplasm.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes</li>\r\n	<li><strong>Patient Preparation: </strong> Fasting required. Fasting is defined as no consumption of food or beverage other than water for at least 8 hours before testing</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Limitations:</strong> Glucose levels may be depressed if sample is left to clot and not spun for an excessive length of time.</li>\r\n	<li><strong>Reference Range(s):</strong> 65-99 mg/dL</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 483</li>\r\n</ul>\r\n','simple','1','2016-12-01 02:52:23','2021-01-16 05:21:55',39.0,19.0,'Glucose',0),(67,'Haemophilus influenzae Type B Antigen, LA (Bacterial Meningitis)','haemophilus-influenzae-type-b-antigen-la-bacterial-meningitis','4505','<p>Useful for rapid diagnosis of <em>Haemophilus influenzae</em> (Type B) as a cause of bacterial meningitis.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> Not detected</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 4505</li>\r\n</ul>\r\n','simple','1','2016-12-01 04:07:36','2021-01-16 05:21:55',199.0,65.0,'Haemophilus influenzae Type B Antigen, LA (Bacterial Meningitis)',0),(68,'Hemoglobin A1c ','hemoglobin-a1c','496','<p>The hemoglobin A1c test may be used to screen for and diagnose diabetes and prediabetes in adults. A1c is frequently used to help newly diagnosed diabetics determine how elevated their uncontrolled blood glucose levels have been over the last 2-3 months. The test may be ordered several times while control is being achieved, and then at least twice a year to verify that good control is being maintained</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Whole Blood</li>\r\n	<li><strong>Limitations:</strong> Hemoglobin A1c is observed to be lower in healthy pregnant women than healthy non-pregnant women. Medical conditions associated with high red blood cell turnover are associated with lower hemoglobin A1c results.</li>\r\n	<li><strong>Reference Range(s):</strong> &lt;5.7 % of total hemoglobin</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 496</li>\r\n</ul>\r\n','simple','1','2016-12-01 04:24:25','2021-01-16 05:21:55',59.0,23.0,'Hemoglobin A1c ',0),(69,'Hepatitis A IgM Antibody ','hepatitis-a-igm-antibody','512','<p>IgM antibodies to Hepatitis&nbsp;A suggest a <strong>current, acute or recent Hepatitis&nbsp;A infection. </strong>Viral hepatitis is a common form of liver disease that affects roughly 1% to 2% of the United States population. It is caused by a diverse group of hepatotropic agents that lead to liver inflammation and cell death.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> Non-Reactive</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 512</li>\r\n</ul>\r\n','simple','1','2016-12-01 04:27:24','2021-01-16 05:21:55',89.0,29.0,'Hepatitis A IgM Antibody ',0),(70,'Hepatitis B Surface Antibody Immunity (Quantitative) ','hepatitis-b-surface-antibody-immunity-quantitative','8475','<p>This assay is used to determine immune status for Hepatitis B as &ge;10 mIU/mL as per CDC Guidelines. Hepatitis B surface antibody quantitation is used to determine hepatitis B immune status, ie, to determine if the patient has developed immunity against the hepatitis B virus. Such immunity may develop following exposure to the hepatitis B virus or its vaccine.</p>\r\n\r\n<p>Patients at higher risk of exposure to the virus include:</p>\r\n\r\n<ul>\r\n	<li>Infants born to infected mothers</li>\r\n	<li>Sex partners of infected persons</li>\r\n	<li>People with more than 1 sex partner in the last 6 months</li>\r\n	<li>People with a history of sexually transmitted infection</li>\r\n	<li>Men who have sex with men</li>\r\n	<li>Injection drug users</li>\r\n	<li>Household contacts of an infected person</li>\r\n	<li>Healthcare and safety workers who have contact with blood and body fluids</li>\r\n	<li>People who have lived or traveled in an area in which hepatitis B is common</li>\r\n	<li>People who live or work in a prison</li>\r\n</ul>\r\n\r\n<p>Testing is not recommended routinely following vaccination. It is advised only for people whose subsequent clinical management depends on knowledge of their immune status. These people include:</p>\r\n\r\n<ul>\r\n	<li>Chronic hemodialysis patients</li>\r\n	<li>Immunocompromised people, including those with HIV infection, hematopoietic stem-cell transplant recipients, and people receiving chemotherapy</li>\r\n	<li>Infants born to women who test positive for the hepatitis B surface antigen</li>\r\n	<li>Sex partners of people who test positive for the hepatitis B surface antigen</li>\r\n	<li>Healthcare and public safety workers who have contact with blood or body fluids</li>\r\n</ul>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> &ge;10 mIU/mL</li>\r\n	<li><strong>Turnaround Time:</strong> 4 Days</li>\r\n	<li><strong>Test Code:</strong> 8475</li>\r\n</ul>\r\n','simple','1','2016-12-01 04:30:53','2021-01-16 05:21:55',99.0,31.0,'Hepatitis B Surface Antibody Immunity (Quantitative) ',0),(71,'Hepatitis C Viral RNA, Quantitative, Real-Time PCR  ','hepatitis-c-viral-rna-quantitative-real-time-pcr','35645','<p>Useful in monitoring therapy and/or disease progression. Reportable range is 15 to 100,000,000 IU/mL (1.18-8.00 Log IU/mL).</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Plasma</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>HCV RNA, Quantitative, PCR</td>\r\n				<td>&lt;15 IU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>HCV RNA, Quantitative, PCR</td>\r\n				<td>&lt;1.18 Log IU/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 35645</li>\r\n</ul>\r\n','simple','1','2016-12-01 04:35:59','2021-01-16 05:21:55',699.0,315.0,'Hepatitis C Viral RNA, Quantitative, Real-Time PCR  ',0),(72,'Hepatitis D Virus (HDV) Total Antibody','hepatitisd-virus-hdv-total-antibody','4990','<p>Hepatitis&nbsp;D Virus (HDV) infection occurs in association with HBV infection. A positive result for HDV total antibody may indicate either acute or chronic HDV infection.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Plasma</li>\r\n	<li><strong>Reference Range(s):</strong> Negative</li>\r\n	<li><strong>Turnaround Time:</strong> 1-5 Days</li>\r\n	<li><strong>Test Code:</strong> 4990</li>\r\n</ul>\r\n','simple','1','2016-12-01 04:40:55','2021-01-16 05:21:55',149.0,50.0,'Hepatitis D Virus (HDV) Total Antibody',0),(73,'HIV-1/2 Antigen and Antibodies, Fourth Generation','hiv-12-antigen-and-antibodies-fourth-generation','91431','<p>This 4th generation HIV Ag/Ab Combo assay is intended to be used as an aid in the diagnosis of HIV1/HIV2 infection, including acute or primary HIV-1 infection.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> HIV Ag/Ab, 4th Generation Non-Reactive</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 91431</li>\r\n</ul>\r\n','simple','1','2016-12-01 04:45:33','2021-01-16 05:21:55',89.0,34.0,'HIV-1/2 Antigen and Antibodies, Fourth Generation',0),(74,'Hematocrit','hematocrit','509','<p>The hematocrit blood test determines the percentage of red blood cells (RBC&#39;s) in the blood. Blood is composed mainly of red blood cells and white blood cells suspended in an almost clear fluid called serum. The hematocrit test indicates the percentage of blood by volume that is composed of red blood cells. The condition called &quot;anemia&quot; results from having too few red blood cells. Anemia causes a variety of symptoms. The hematocrit&nbsp;is a basic test that can tell a physician a lot about a person&#39;s health.&nbsp;This test is the usual method for determining anemia.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Whole Blood</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&le;2 Weeks</td>\r\n				<td>42.0-65.0 %</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1 Month</td>\r\n				<td>33.0-55.0 %</td>\r\n			</tr>\r\n			<tr>\r\n				<td>2 Months</td>\r\n				<td>28.0-42.0 %</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6 Months</td>\r\n				<td>29.0-41.0 %</td>\r\n			</tr>\r\n			<tr>\r\n				<td>2 Years</td>\r\n				<td>31.0-41.0 %</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6 Years</td>\r\n				<td>34.0-42.0 %</td>\r\n			</tr>\r\n			<tr>\r\n				<td>12 Years</td>\r\n				<td>35.0-45.0 %</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&nbsp;</td>\r\n				<td>Male</td>\r\n				<td>Female</td>\r\n			</tr>\r\n			<tr>\r\n				<td>18 Years</td>\r\n				<td>36.0-49.0 %</td>\r\n				<td>34.0-46.0 %</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;18 Years</td>\r\n				<td>38.5-50.0 %</td>\r\n				<td>35.0-45.0 %</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 509</li>\r\n</ul>\r\n','simple','1','2016-12-01 04:52:13','2021-01-16 05:21:55',59.0,22.0,'Hematocrit',0),(75,'Herpes Simplex Virus 1/2 (IgG), Type-Specific Antibodies (HerpeSelect®)','herpes-simplex-virus-12-igg-type-specific-antibodies-herpeselect','6447','<p>Herpes Simplex Virus (HSV) is responsible for several clinically significant human viral diseases, with severity ranging from inapparent to fatal. Clinical manifestations include genital tract infections, neonatal herpes, meningoencephalitis, keratoconjunctivitis, and gingivostomatitis. There are two HSV serotypes that are closely related antigenically. HSV type 2 is more commonly associated with genital tract and neonatal infections, while HSV type 1 is more commonly associated with infections of non-genital sites. Specific typing is not usually required for diagnosis or treatment. The mean time to seroconversion using the type specific assay is 25 days.&nbsp;The performance of this assay has not been established for use in a pediatric population, for neonatal screening, or for testing of immunocompromised patients.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Limitations:</strong> Individuals infected with HSV may not exhibit detectable IgG antibody in the early stages of infection</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&lt;0.90</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>0.90-1.10</td>\r\n				<td>Equivocal</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;1.10</td>\r\n				<td>Positive</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 6447</li>\r\n</ul>\r\n','simple','1','2016-12-01 04:56:26','2021-01-16 05:21:55',189.0,62.0,'Herpes Simplex Virus 1/2 (IgG), Type-Specific Antibodies (HerpeSelect®)',0),(76,'HCG, Total, Quantitative ','hcg-total-quantitative','8396','<p>hCG may reach detectable limits within 7-10 days of conception. hCG is produced by the placenta and reaches a peak between the 7th and 10th week of gestation. hCG is a glycoprotein hormone produced by the syncytiotrophoblast of the placenta and secreted during normal pregnancy and with pathologic conditions such as hydatidiform mole, choriocarcinoma and testicular neoplasm.&nbsp;</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Limitations:</strong> Heterophilic antibodies may produce low false-positive results; urinary hCG is negative if &quot;phantom&quot; hCG is suspected. Pituitary secretion may be a source of low level hCG in post menopausal women</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>&lt;5 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Non-pregnant or Premenopausal</td>\r\n				<td>&lt;5 mIU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Postmenopausal</td>\r\n				<td>&lt;10 mIU/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 8396</li>\r\n</ul>\r\n','simple','1','2016-12-01 05:00:38','2021-01-16 05:21:55',89.0,29.0,'hCG, Total, Quantitative ',0),(77,'HCG, Total, Qualitative (Pregnancy Test)','hcg-total-qualitative-pregnancy-test','8435','<p>This test should be used only to determine pregnancy</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Limitations:</strong> Heterophilic antibodies may produce low false-positive results; urinary hCG is negative if &quot;phantom&quot; hCG is suspected. Pituitary secretion may be a source of low level hCG in post menopausal women.</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Male and Female (Non-pregnant)</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female (Pregnant)</td>\r\n				<td>Positive</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 8435</li>\r\n</ul>\r\n','simple','1','2016-12-01 05:06:33','2021-01-16 05:21:55',49.0,26.0,'HCG, Total, Qualitative (Pregnancy Test)',0),(78,'Hepatic Function Panel ','hepatic-function-panel','10256','<p>A liver panel may be used to screen for liver damage, especially if someone has a condition or is taking a drug that may affect the liver. A comprehensive metabolic panel (CMP),&nbsp;which is often performed as part of a general health checkup, may be ordered instead of a liver panel for routine screening. This group of tests includes most of the liver panel as well as additional tests that evaluate other organs and systems within the body.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Includes:</strong> Total Protein, Albumin, Globulin (calculated), Albumin/Globulin Ratio (calculated), Total Bilirubin, Direct Bilirubin, Indirect Bilirubin (calculated), Alkaline Phosphatase, AST, ALT</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 10256</li>\r\n</ul>\r\n','simple','1','2016-12-01 05:09:33','2021-01-16 05:21:55',45.0,20.0,'Hepatic Function Panel ',0),(79,'Heavy Metals Comprehensive Panel, Random Urine ','heavy-metals-comprehensive-panel-random-urine','14573','<p>A liver panel may be used to screen for liver damage, especially if someone has a condition or is taking a drug that may affect the liver. A comprehensive metabolic panel (CMP),&nbsp;which is often performed as part of a general health checkup, may be ordered instead of a liver panel for routine screening. This group of tests includes most of the liver panel as well as additional tests that evaluate other organs and systems within the body.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Limitations:</strong> Ingestion of seafood within three days of specimen collection can affect results. Includes: Arsenic, Cadmium, Cobalt, Lead, Mercury, Thallium, Creatinine</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Arsenic Random Urine</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Non-exposed Adult</td>\r\n				<td>&le;35 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Biological Exposure Index (end of shift/work week)</td>\r\n				<td>&le;50 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Mercury Random Urine</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Non-exposed Adult</td>\r\n				<td>&le;4 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Biological Exposure Index (pre-shift)</td>\r\n				<td>&le;35 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Lead, Random Urine</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Non-exposed Adult</td>\r\n				<td>&lt;10 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Cadmium, Random Urine</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Non-exposed Adult</td>\r\n				<td>&le;1.2 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>OSHA Reference Range for Industrial Exposure</td>\r\n				<td>&le;3.0 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Cobalt, Random Urine</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Non-exposed Adult</td>\r\n				<td>&le;2.8 mcg/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Biological Exposure Index (end of shift/work week)</td>\r\n				<td>&le;15.0 mcg/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Thallium, Random Urine</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Non-exposed Adult</td>\r\n				<td>&lt;0.4 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Creatinine, Random Urine</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&le;6 Months</td>\r\n				<td>2-32 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7-11 Months</td>\r\n				<td>2-36 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-2 Years</td>\r\n				<td>2-128 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3-8 Years</td>\r\n				<td>2-149 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>9-12 Years</td>\r\n				<td>2-183 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;12 Years</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>20-370 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>20-320 mg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Day</li>\r\n	<li><strong>Test Code:</strong> 14573</li>\r\n</ul>\r\n','simple','1','2016-12-01 05:21:56','2021-01-16 05:21:55',799.0,299.0,'Heavy Metals Comprehensive Panel, Random Urine ',0),(80,'Helicobacter pylori, Urea Breath Test ','helicobacter-pylori-urea-breath-test','14839','<p><em>Helicobacter pylori</em> is a gram-negative microaerophilic curved bacillus with an affinity for human gastric mucosa. <em>H. pylori</em> has been identified as an important pathogen in the upper GI tract. The casual relationship between <em>H. pylori</em> and chronic active gastritis, duodenal ulcers, and gastric ulcers has been well documented. BreathTek&trade; UBiT&reg; for <em>H. pylori</em> is a non-invasive, non-radioactive method for detecting urease activity associated with <em>H. pylori</em> infection. It is FDA approved to confirm cure and offers 95.2% sensitivity and 89.7% specificity compared with endoscopic methods.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes 1 Hour</li>\r\n	<li><strong>Preferred Specimen:</strong> Human Breath</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Patient Preparation: </strong> Patient should fast one hour before collection of baseline breath sample. Pranactin&reg;-Citric contains a small amount of aspartame sweetener. Test may not be suitable for patients with phenylketonuria whose dietary phenylalanine should be restricted.</li>\r\n	<li><strong>Turnaround Time:</strong> 2 Day</li>\r\n	<li><strong>Test Code:</strong> 14839</li>\r\n</ul>\r\n','simple','1','2016-12-01 05:26:16','2021-01-16 05:21:55',299.0,75.0,'Helicobacter pylori, Urea Breath Test ',0),(81,'Herpesvirus 6 Antibodies (IgG, IgM) ','herpesvirus-6-antibodiesigg-igm','34282','<p>HHV-6 is a distinct herpes virus that typically causes a self-limiting illness in patients who are not immunocompromised. In some patients, especially if immumocompromised, HHV-6 can cause febrile convulsions in infants, encephalitis mononucleosis-like symptoms, and hepatitis.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 34282</li>\r\n</ul>\r\n','simple','1','2016-12-01 05:30:14','2021-01-16 05:21:55',189.0,65.0,'Herpesvirus 6 Antibodies (IgG, IgM) ',0),(82,'Hemoglobinopathy Evaluation ','hemoglobinopathy-evaluation','35489','<p>A hemoglobinopathy evaluation is a group of tests that identifies abnormal forms of or suggests problems with production of hemoglobin in order to screen for and/or diagnose a hemoglobin disorder.</p>\r\n\r\n<p>The detection and proper identification of hemoglobinopathies and thalassemias is an important aspect of the evaluation of patients with anemia, microcytosis and erythrocytosis</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes</li>\r\n	<li><strong>Includes:</strong> Hemoglobin A1, Fetal Hemoglobin, Hemoglobin A2 and any hemoglobin variants, Red Blood Cell Count, Hemoglobin, Hematocrit, MCV, MCH, RDW</li>\r\n	<li><strong>Preferred Specimen:</strong> Whole Blood</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Turnaround Time:</strong> 2 Days</li>\r\n	<li><strong>Test Code:</strong> 35489</li>\r\n</ul>\r\n','simple','1','2016-12-01 05:45:07','2021-01-16 05:21:55',189.0,60.0,'Hemoglobinopathy Evaluation ',0),(83,'Histamine','histamine','36586','<p>Histamine is a mediator of the allergic response. Histamine release causes itching, flushing, hives, vomiting, syncope, and even shock. In addition, some patients with gastric carcinoids may exhibit high concentrations of histamine</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Plasma</li>\r\n	<li><strong>Reference Range(s):</strong> 0.1-1.8 ng/mL</li>\r\n	<li><strong>Patient Preparation: </strong> Avoid taking allergy causing drugs, antihistamines, oral corticosteroids and substances which block H2 receptors 24 hours prior to collection.</li>\r\n	<li><strong>Turnaround Time:</strong> 4 Days</li>\r\n	<li><strong>Test Code:</strong> 36586</li>\r\n</ul>\r\n','simple','1','2016-12-01 05:50:17','2021-01-16 05:21:55',128.0,75.0,'Histamine',0),(84,'Heterophile Mono Screen ','heterophile-mono-screen','654','<p>Heterophile antibodies, in patients with infectious mononucleosis, may be present as early as the fourth day of illness, and by the twenty-first day of illness, 90% of patients will exhibit a positive test. The Epstein-Barr virus causes infectious mononucleosis.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> Negative</li>\r\n	<li><strong>Limitations:</strong> Failure to develop heterophil antibodies occurs frequently in children and in about 10% of adults with infectious mononucleosis. In these cases, development of EBV antibodies is applicable. 955 specificity. Less than 2% false-positives have occurred in patients with Hodgkin disease, acute lymphoma, acute lymphomatic leukemia, infectious hepatitis, pancreatic carcinoma, cytomegalovirus, Burkitt lymphoma, rheumatoid arthritis, malaria and rubella.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 7008</li>\r\n</ul>\r\n','simple','1','2016-12-01 06:46:39','2021-01-16 05:21:55',79.0,31.0,'Heterophile Mono Screen ',0),(85,'Homocysteine','homocysteine','31789','<p>An elevated concentration of homocysteine is an independent risk factor for cardiovascular disease. When used in conjunction with methylmalonic acid (MMA), these tests are useful to diagnose and monitor vitamin B12 (cobalamin) and folic acid deficiency and are often useful in evaluating macrocytosis (an elevated MCV, an erythrocytic index).</p>\r\n\r\n<p><strong>Clinical Use:</strong></p>\r\n\r\n<p>-Diagnose homocystinuria, vitamin B12 deficiency, and folate deficiency</p>\r\n\r\n<p>-Assess risk of cardiovascular disease (CVD), stroke, and dementia (including Alzheimer disease)</p>\r\n\r\n<p>-Monitor therapy in patients with elevated homocysteine levels</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>&lt;11.4 umol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>&lt;10.4 