s. The measurement of total iron binding in the same specimen may facilitate the clinician&#39;s ability to distinguish between low serum iron levels caused by iron deficiency from those related to inflammatory neoplastic disorders. The assay for iron measures the amount of iron which is bound to transferrin. The total iron binding capacity (TIBC) measures the amount of iron that would appear in blood if all the transferrin were saturated with iron. It is an indirect measurement of transferrin concentrations but expressed as an iron measurement. To obtain the percent saturation, the serum iron is divided by the TIBC which gives the actual amount of saturated transferrin. The percent saturation is low in iron deficiency and high in iron storage diseases.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Iron,Total</td>\r\n				<td>Male (mcg/dL)</td>\r\n				<td>Female (mcg/dL)</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&lt;1 Month</td>\r\n				<td>32-112</td>\r\n				<td>29-127</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-11 Months</td>\r\n				<td>27-109</td>\r\n				<td>25-126</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-3 Years</td>\r\n				<td>29-91</td>\r\n				<td>25-101</td>\r\n			</tr>\r\n			<tr>\r\n				<td>4-19 Years</td>\r\n				<td>27-164</td>\r\n				<td>27-164</td>\r\n			</tr>\r\n			<tr>\r\n				<td>20-29 Years</td>\r\n				<td>50-195</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;30 Years</td>\r\n				<td>50-180</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>20-49 Years</td>\r\n				<td>&nbsp;</td>\r\n				<td>40-190</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;50 Years</td>\r\n				<td>&nbsp;</td>\r\n				<td>45-160</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Iron Binding Capacity</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&nbsp;</td>\r\n				<td>Male (mcg/dL) (calc)</td>\r\n				<td>Female (mcg/dL) (calc)</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&lt;1 Month</td>\r\n				<td>94-232</td>\r\n				<td>94-236</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-5 Months</td>\r\n				<td>116-322</td>\r\n				<td>89-311</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6-11 Months</td>\r\n				<td>176-384</td>\r\n				<td>138-365</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-19 Years</td>\r\n				<td>271-448</td>\r\n				<td>271-448</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;20 Years</td>\r\n				<td>250-425</td>\r\n				<td>250-450</td>\r\n			</tr>\r\n			<tr>\r\n				<td>% Saturation</td>\r\n				<td>Male</td>\r\n				<td>Female</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&lt;1 Year</td>\r\n				<td>Not established</td>\r\n				<td>Not established</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-12 Years</td>\r\n				<td>8-48 %</td>\r\n				<td>8-45 %</td>\r\n			</tr>\r\n			<tr>\r\n				<td>13-19 Years</td>\r\n				<td>9-52 %</td>\r\n				<td>8-45 %</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;20 Years</td>\r\n				<td>15-60 %</td>\r\n				<td>11-50 %</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 7573</li>\r\n</ul>\r\n','simple','1','2016-12-01 07:37:49','2021-01-16 05:21:55',42.0,19.0,'Total Iron, Iron Binding Capacity % Saturation (calculated) ',0),(92,'Lymphocyte Subset Panel 4 ','lymphocyte-subset-panel-4','7924','<p>Assists in evaluating helper and suppressor cell immune status in immunodeficiency diseases such as AIDS.</p>\r\n\r\n<p>Clinical Use:</p>\r\n\r\n<p>-Determines immune status of patients with HIV infection</p>\r\n\r\n<p>-Monitors anti-retroviral and immunosuppressive therapy</p>\r\n\r\n<p>-Differential diagnosis of congenital and acquired immune deficiencies&nbsp;&nbsp;</p>\r\n\r\n<p>Includes</p>\r\n\r\n<p>Absolute Lymphocytes,&nbsp;Percentage CD4, Absolute CD4, Percentage CD8, Absolute CD8, CD4/CD8 Ratio (calculated)</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Whole Blood</li>\r\n	<li><strong>Reference Range(s):</strong> See Medical Report</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 7924</li>\r\n</ul>\r\n','simple','1','2016-12-01 07:40:59','2021-01-16 05:21:55',299.0,75.0,'Lymphocyte Subset Panel 4 ',0),(93,'Lithium  ','lithium','613','<p>Lithium is used to treat manic-depressive disorders and the manic phase of affective disorders, including mania. The therapeutic window is relatively small. Therapeutic drug monitoring is useful to optimize dose and avoid toxicity.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Patient Preparation:</strong> Collect just prior to next dose</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 0.6-1.2 mmol/L</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 613</li>\r\n</ul>\r\n','simple','1','2016-12-01 07:43:55','2021-01-16 05:21:55',59.0,24.0,'Lithium  ',0),(94,'Lactic Acid','lactic-acid','585','<p>Lactic acid is the endproduct of the anaerobic metabolism of glucose. The blood lactic acid concentration is affected by its production in muscle cells and erythrocytes and its rate of metabolism in the liver. During exercise, blood lactate can increase up to ten times of normal levels.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Patient Preparation:</strong> Sample should be collected without the use of a tourniquet, avoid hand-clenching. If a tourniquet has been used, it should be released for one minute prior to drawing blood. Collected blood should be cooled on ice immediately and separated from the cells within 3 hours.</li>\r\n	<li><strong>Preferred Specimen:</strong> Plasma</li>\r\n	<li><strong>Reference Range(s):</strong> 4-16 mg/dL</li>\r\n	<li><strong>Limitations:</strong> Spironolactone and some herbal drugs may interfere with this test.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 585</li>\r\n</ul>\r\n','simple','1','2016-12-01 07:47:07','2021-01-16 05:21:55',69.0,31.0,'Lactic Acid',0),(95,'Lipase (Acute Pancreatitis) ','lipase-acute-pancreatitis','606','<p>Confirmatory evidence for diagnosis of pancreatitis. The blood test for lipase is most often used, along with an amylase test, to help diagnose and monitor acute pancreatitis. It may also be used to diagnose and monitor chronic pancreatitis and other disorders that involve the pancreas.</p>\r\n\r\n<p>Lipase testing is also occasionally used in the diagnosis and follow-up of cystic fibrosis, celiac disease, and Crohn disease.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 7-60 U/L</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 606</li>\r\n</ul>\r\n','simple','1','2016-12-01 07:51:00','2021-01-16 05:21:55',69.0,25.0,'Lipase (Acute Pancreatitis) ',0),(96,'Lyme Disease ','lyme-disease','6646','<p>Lyme disease is caused by a bacterium <em>borrelia burgdorferi</em> and is transmitted by ticks. EIA is the screening test with high sensitivity for antibody detection. Immunoblot testing qualitatively examines with high specificity antibodies in a patient&#39;s specimen. Immunoblot testing is appropriate for confirming a detected EIA test result.&nbsp;</p>\r\n\r\n<p>Tick-borne diseases are caused by infections transmitted to humans via a tick vector such as the deer tick, dog tick, wood tick, and Lone Star tick. In the United States, transmission occurs primarily in the spring and summer months. Causative agents include bacteria (including rickettsia), viruses, and protozoa. The incidence varies by geographic location and causative agent.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Includes:</strong> If Lyme Disease Antibody Screen is Equivocal or Positive, Lyme Disease Antibodies (IgG, IgM), Immunoblot</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>?0.90</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>0.91-1.09</td>\r\n				<td>Equivocal</td>\r\n			</tr>\r\n			<tr>\r\n				<td>?1.10</td>\r\n				<td>Positive</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 6646</li>\r\n</ul>\r\n','simple','1','2016-12-01 07:56:55','2021-01-16 05:21:55',99.0,43.0,'Lyme Disease ',0),(97,'Lead (Blood) ','lead-blood','599','<p>Blood lead level analysis is performed to evaluate the body burden of lead. Lead is a cumulative protoplasmic poison that may be ingested, inhaled, or absorbed directly through the skin. Toxic effects are categorized as gastrointestinal, central nervous system, neuromuscular, hematologic, renal, or constitutional. Common symptoms include constipation, anorexia, abdominal pain, weight loss, fatigue, and a characteristic peripheral neuropathy (wrist drop). Severe poisoning may lead to nephropathy, encephalopathy, convulsions, and even death.</p>\r\n\r\n<p>Lead poisoning may result from occupational exposure (mining, smelters, sheet metal, battery manufacture, automobile radiator repair, demolition work, alloys, and metal plating). Poisoning may also occur subsequent to exposure to leaded containers, lead clay, glazed pottery, solder, paints, and bullets (wound).</p>\r\n\r\n<p>Infants and children aged 9 months to 6 years are particularly susceptible to the effects of lead due to greater gastrointestinal absorption. Lead exposure can lead to irreversible IQ deficits, poor academic achievement, reduced attention span, and hyperactivity.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Whole Blood</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Birth-6 Years</td>\r\n				<td>&lt;5 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;6 Years</td>\r\n				<td>&lt;5 mcg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li>Blood lead levels in the range of 5-9 mcg/dL have been associated with adverse health effects in children aged 6 years and younger. Patient management varies by age and CDC Blood Level Range. Refer to the CDC website regarding Lead Publications/Case Management for recommended interventions.</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 599</li>\r\n</ul>\r\n','simple','1','2016-12-01 08:03:33','2021-01-16 05:21:55',79.0,29.0,'Lead (Blood) ',0),(98,'Lead (Urine) ','lead-urine','601','<p>Elevated urinary lead concentration is indicative of chronic lead toxicity. Urinary lead concentrations may be used to monitor detoxification therapy. Lead interferes with the metabolism of calcium and Vitamin D. High blood lead levels in children can cause consequences which may be irreversible including learning disabilities, behavioral problems, and mental retardation. At very high levels, lead can cause convulsions, coma and death. Too much lead can damage various systems of the body including the nervous and reproductive systems and the kidneys, and it can cause high blood pressure and anemia. Lead accumulates in the bones and lead poisoning may be diagnosed from a blue line around the gums. Lead is especially harmful to the developing brains of fetuses and young children and to pregnant women.</p>\r\n\r\n<p>Elevated urinary lead concentration is indicative of chronic lead toxicity. Urinary lead concentrations may be used to monitor detoxification therapy.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Lead, Random Urine</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Non-exposed Adult</td>\r\n				<td>&lt;10 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Creatinine, Random Urine</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&le;6 Months</td>\r\n				<td>2-32 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7-11 Months</td>\r\n				<td>2-36 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-2 Years</td>\r\n				<td>2-128 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3-8 Years</td>\r\n				<td>2-149 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>9-12 Years</td>\r\n				<td>2-183 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;12 Years</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>20-370 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>20-320 mg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 601</li>\r\n</ul>\r\n','simple','1','2016-12-01 08:11:29','2021-01-16 05:21:55',89.0,42.0,'Lead (Urine) ',0),(99,'Mercury','mercury','637','<p>Mercury, a highly toxic metal, is present in select industrial environments and in contaminated ocean fish. Urinary measurements are appropriate for assessing ongoing exposure to inorganic mercury.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Includes:</strong> Creatinine</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Mercury Random Urine</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Non-exposed Adult</td>\r\n				<td>&le;4 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Biological Exposure Index (pre-shift)</td>\r\n				<td>&le;35 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Creatinine, Random Urine</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&le;6 Months</td>\r\n				<td>2-32 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7-11 Months</td>\r\n				<td>2-36 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-2 Years</td>\r\n				<td>2-128 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3-8 Years</td>\r\n				<td>2-149 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>9-12 Years</td>\r\n				<td>2-183 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;12 Years</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>20-370 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>20-320 mg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Patient Preparation:</strong> Avoid seafood consumption for 48 hours prior to collection</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 637</li>\r\n</ul>\r\n','simple','1','2016-12-01 08:18:29','2021-01-16 05:21:55',195.0,65.0,'Mercury',0),(100,'Mumps Virus ','mumps-virus','8624','<p>Mumps is an acute, usually self-limited systemic illness characterized by parotidites, high fever and fatigue. One third of infections are asymptomatic. A live attenuated vaccine is available. The mumps EIA IgG antibody test is sufficiently sensitive to establish immune status of the patient.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&le;0.90</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Interpretive criteria</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&le;0.90</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>0.91-1.09</td>\r\n				<td>Equivocal</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;1.10</td>\r\n				<td>Positive</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li>A positive result indicates that the patient has antibody to mumps virus. It does not differentiate between an active or past infection. The clinical diagnosis must be interpreted in conjunction with clinical signs and symptoms of the patient.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 8624</li>\r\n</ul>\r\n','simple','1','2016-12-01 08:24:19','2021-01-16 05:21:55',129.0,33.0,'Mumps Virus ',0),(101,'Magnesium','magnesium','622','<p>Magnesium measurements are used in the diagnosis and treatment of hypomagnesemia (abnormally low plasma levels of magnesium) and hypermagnesemia (abnormally high plasma levels of magnesium). Magnesium is decreased in chronic nephritis, acute pancreatitis, and alcoholic cirrhosis. It is increased in acute or chronic renal failure and Addison&#39;s Disease.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 1.5-2.5 mg/dL</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 622</li>\r\n</ul>\r\n','simple','1','2016-12-01 23:20:12','2021-01-16 05:21:55',45.0,23.0,'Magnesium',0),(102,'Magnesium RBC (Red Blood Cell)','magnesium-rbc-red-blood-cell','623','<p>Magnesium is an essential trace element. Deficiency leads to irritability, neuromuscular abnormalities, cardiac and renal damage. Its salts are used as antacids and cathartics. Excessive amount may cause CNS depression, loss of muscle tone, respiratory and cardiac arrest.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 4.0-6.4 mg/dL</li>\r\n	<li><strong>Patient Preparation: </strong> Patient should refrain from taking vitamins, or mineral herbal supplements for at least one week before sample collection</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 623</li>\r\n</ul>\r\n','simple','1','2016-12-01 23:22:15','2021-01-16 05:21:55',87.0,33.0,'Magnesium RBC (Red Blood Cell)',0),(103,'Manganese RBC ','manganese-rbc','16594','<p>Manganese deficiency produces growth disorders, alters skeletal and cartilage formation and impairs reproduction. Industrial workers absorb manganese mainly through the lungs.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Whole Blood</li>\r\n	<li><strong>Reference Range(s):</strong> 12-26 mcg/L</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 16594</li>\r\n</ul>\r\n','simple','1','2016-12-01 23:26:55','2021-01-16 05:21:55',89.0,35.0,'Manganese RBC ',0),(104,'Methaqualone (Quaalude™) ','methaqualone-quaalude','645','<p>Methaqualone (&quot;quaaludes&quot;) is a central nervous system depressant, with similar effects to barbiturates, and has been prescribed as an anti-anxiety medication or sleep aid. This drug is no longer manufactured or distributed in the United States, and true positive patient samples are uncommon. The detection of methaqualone in serum or urine is useful in the detection of abuse by individuals, resultant treatment for those individuals, and possibly in assisting with criminal prosecution.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Plasma</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Turnaround Time:</strong> 11 Days</li>\r\n	<li><strong>Test Code:</strong> 645</li>\r\n</ul>\r\n','simple','1','2016-12-01 23:33:15','2021-01-16 05:21:55',99.0,45.0,'Methaqualone (Quaalude™) ',0),(105,'Norovirus ','norovirus','15544','<p>Norovirus is the major cause of nonbacterial gastroenteritis associated with outbreaks and sporadic cases in humans. Norovirus affects all age groups, with an incubation period of 24 to 48 hours and typically lasts up to 3 days with symptoms of nausea, vomiting, diarrhea, abdominal cramps, headache and fever. Detection of viral antigen in stool helps confirm individual cases and define outbreaks.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Stool</li>\r\n	<li><strong>Reference Range(s):</strong> Negative</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 15544</li>\r\n</ul>\r\n','simple','1','2016-12-01 23:35:46','2021-01-16 05:21:55',99.0,55.0,'Norovirus ',0),(106,'Nickel','nickel','5215','<p>Nickel toxicity is associated with allergy, asthma, urticaria, erythema multiforme, contact dermatitis, and hand eczema.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Nickel, Random Urine</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Non-exposed Adult</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>1.2-6.2 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>2.2-10.2 mcg/g creat</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Creatinine, Random Urine</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&le;6 Months</td>\r\n				<td>2-32 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7-11 Months</td>\r\n				<td>2-36 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-2 Years</td>\r\n				<td>2-128 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3-8 Years</td>\r\n				<td>2-149 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>9-12 Years</td>\r\n				<td>2-183 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;12 Years</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>20-370 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>20-320 mg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code: 5215</strong></li>\r\n</ul>\r\n','simple','1','2016-12-01 23:43:28','2021-01-16 05:21:56',129.0,42.0,'Nickel',0),(107,'Organic Acids Qualitative (Extremely Compressive)','organic-acids-qualitative-extremely-compressive','90404','<p>Organic acidurias are a group of inborn errors of metabolism that may lead to acute life-threatening illness, developmental delays, and metabolic decompensation. Positive results may warrant confirmation by alternative specific methods. Organic acidurias are inherited disorders resulting from a deficient enzyme or transport protein. Although most are autosomal recessive disorders, several are X-linked. The more than 60 described organic acidurias affect many metabolic pathways including amino acid metabolism, lipid metabolism, purine and pyrimidine metabolism, the urea cycle, the Krebs cycle, and fatty acid oxidation. These disorders are characterized by a wide variety of symptoms such as lethargy, coma, hypotonia, seizures, ataxia, vomiting, failure to thrive, developmental delay, liver disease, neutropenia, thrombocytopenia, osteomalacia, and osteoporosis. Severity of presentation is highly variable as is age of onset, and patients may not present with the most characteristic features. Laboratory results commonly indicate metabolic acidosis, increased anion gap, hyperammonemia, hypoglycemia, lactic acidemia, ketosis, or abnormal lipid patterns. Treatment may be based on dietary restrictions and/or supplementation with cofactors (eg, riboflavin or cobalamin) or conjugating agents (eg, carnitine or sodium benzoate); however, there is no effective therapy for some of the disorders.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Includes:</strong> 63 Organic Acids; Creatinine, Random Urine</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 90404</li>\r\n</ul>\r\n','simple','1','2016-12-01 23:46:37','2021-01-16 05:21:56',599.0,170.0,'Organic Acids Qualitative (Extremely Compressive)',0),(108,'Osmolality (Serum)','osmolality-serum','677','<p>Serum osmolality is increased in hypernatremia, hyperglycemia, uremia, ethanol, methanol, or ethylene glycol overdoses, and in diabetes insipidus.</p>\r\n\r\n<p>This test helps check your body&#39;s water balance. Your doctor may order this test if you have signs of any of the following:</p>\r\n\r\n<p>-Low sodium (<a href=\"https://medlineplus.gov/ency/article/000394.htm\">hyponatremia</a>) or water loss</p>\r\n\r\n<p>-Poisoning from harmful substances such as <a href=\"https://medlineplus.gov/ency/article/002644.htm\">ethanol</a>, <a href=\"https://medlineplus.gov/ency/article/002680.htm\">methanol</a>, or <a href=\"https://medlineplus.gov/ency/article/000774.htm\">ethylene glycol</a></p>\r\n\r\n<p>-Problems producing urine</p>\r\n\r\n<p>In healthy people, when osmolality in the blood becomes high, the body releases <a href=\"https://medlineplus.gov/ency/article/003702.htm\">antidiuretic hormone</a> (ADH).</p>\r\n\r\n<p>This hormone causes the kidneys to reabsorb water. This results in more concentrated urine. The reabsorbed water dilutes the blood. This allows blood osmolality to fall back to normal.</p>\r\n\r\n<p>Low blood osmolality suppresses ADH. This reduces how much water the kidneys reabsorb. Dilute urine is passed to get rid of the excess water, which increases blood osmolality back toward normal.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 278-305 mOsm/kg</li>\r\n	<li><strong>Turnaround Time:</strong> 2 Days</li>\r\n	<li><strong>Test Code:</strong> 677</li>\r\n</ul>\r\n','simple','1','2016-12-01 23:49:27','2021-01-16 05:21:56',69.0,25.0,'Osmolality (Serum)',0),(109,'Osmolality (Urine)','osmolality-urine','678','<p>For assessing the concentrating ability of the kidney.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Reference Range(s):</strong> 50-1200 mOsm/kg</li>\r\n\r\n	<li><strong>Turnaround Time:</strong> 2 Days</li>\r\n	<li><strong>Test Code:</strong> 678</li>\r\n</ul>\r\n','simple','1','2016-12-01 23:51:26','2021-01-16 05:21:56',79.0,31.0,'Osmolality (Urine)',0),(110,'Pregnenolone','pregnenolone','31493','<p>Pregnenolone&nbsp;may be called&nbsp;known as the mother hormone.&nbsp; All other steroids including testosterone and estrogen are derived from this hormone called Pregenolone. It is very important to maintain&nbsp;optimal pregnenolone levels in the blood, which are&nbsp;critical for a healthy hormone balance. Pregnenolone is also important for proper brain development, cognition, memory, and mood. These dramatic effects on the brain are why pregnenolone is known as a neuro-active steroid. According to studies by the age of 75 our bodies produce 60% less pregnenolone than the levels produced in our mid-thirties. For this reason pregnenolone is one of the biomarkers of aging. Like counting the rings of a tree, by measuring the level of pregnenolone at any given point of a person&rsquo;s life, it is often possible to make an educated guess as to his or her age.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Adult</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Males (18-58 Years)</td>\r\n				<td>13-208 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Premenopausal Females (18-51 Years)</td>\r\n				<td>7-188 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Postmenopausal Females (59-81 Years)</td>\r\n				<td>13-111 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Pediatric</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1 Day-59 Days</td>\r\n				<td>12-1331 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>60 Days-1 Year</td>\r\n				<td>&le;170 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>2-6 Years</td>\r\n				<td>&le;107 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7-9 Years</td>\r\n				<td>&le;114 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-12 Years</td>\r\n				<td>&le;163 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>13-17 Years</td>\r\n				<td>&le;325 ng/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 31493</li>\r\n</ul>\r\n','simple','1','2016-12-01 23:59:27','2021-01-16 05:21:56',189.0,79.0,'Pregnenolone',0),(111,'Proinsulin (Insulin)','proinsulin-insulin','760','<p>Proinsulin is used to detect and monitor excessive hormone production from insulinomas. Proinsulin is the prohormone precursor to insulin made in the <a href=\"https://en.wikipedia.org/wiki/Beta_cell\">beta cells</a> of the <a href=\"https://en.wikipedia.org/wiki/Islets_of_Langerhans\">islets of Langerhans</a>, specialized regions of the <a href=\"https://en.wikipedia.org/wiki/Pancreas\">pancreas</a>. In humans, proinsulin is encoded by the <strong><em>INS</em></strong> <a href=\"https://en.wikipedia.org/wiki/Gene\">gene</a>.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> &le;18.8 pmol/L</li>\r\n	<li><strong>Limitations:</strong> Spironolactone and some herbal drugs may interfere with this test.</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 760</li>\r\n</ul>\r\n','simple','1','2016-12-02 00:02:05','2021-01-16 05:21:56',499.0,215.0,'Proinsulin (Insulin)',0),(112,'PSA Total','psa-total','5363','<p>Elevated serum PSA concentrations have been reported in men with prostate cancer, benign prostatic hypertrophy, and inflammatory conditions of the prostate.</p>\r\n\r\n<p>Prostate cancer is the most commonly detected cancer in men in the United States, affecting approximately 1 out of every 6 men. It is the second leading cause of cancer death among men in the United States. Although prostate cancer is thought to begin when men are in their thirties and forties, it is most often diagnosed after age 65. Prevalence increases with age</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>&le;4.0 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>Not established</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Limitations:</strong> Based on solid evidence, screening with PSA and/or DRE detects some prostate cancers that would never have caused important clinical problems. Current prostate cancer treatments, including radical prostatectomy and radiation therapy, result in permanent side effects in many men. The most common of these side effects are erectile dystunction and urinary incontinence. Whatever the screening modality, the screening process itself can lead to adverse psychological effects in men who have a prostate biopsy but do not have identified prostate cancer. Prostatic biopsies are associated with complications, including fever, pain, hematospermia/hematuria, positive urine cultures, and rarely sepsis. Lower PSA levels are associated with obesity.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 5363</li>\r\n</ul>\r\n','simple','1','2016-12-02 00:08:11','2021-01-16 05:21:56',59.0,26.0,'PSA Total',0),(113,'Prothrombin Time with INR ','prothrombin-time-with-inr','8847','<p>Screening test for abnormalities of coagulation factors that are involved in the extrinsic pathway. Also used to monitor effects of Warfarin therapy&nbsp;and to study patients with hereditary and acquired clotting disorders.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Plasma</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>PT 9.0-11.5 sec</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>INR</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Reference range</td>\r\n				<td>0.9-1.1</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Moderate-intensity Warfarin therapy</td>\r\n				<td>2.0-3.0</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Higher-intensity Warfarin therapy</td>\r\n				<td>3.0-4.0</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Limitations:</strong> Expected impact by therapeutic levels (potential interference depends upon drug concentration): Warfarin: prolonged; Heparin (UFH or LMWH): little to no effect (reagent contains a heparin neutralizer); Dabigatran or Argatroban (Thrombin Inhibitors): normal to prolonged; Rivaroxaban or Apixaban (Factor Xa Inhibitors): prolonged.</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 8847</li>\r\n</ul>\r\n','simple','1','2016-12-02 00:15:06','2021-01-16 05:21:56',49.0,20.0,'Prothrombin Time with INR ',0),(114,'Phosphate (as Phosphorus)','phosphate-as-phosphorus','718','<p>Serum phosphorus (Phosphate) levels alone are of limited diagnostic value and should be correlated with serum calcium levels. An increased phosphorus with decreased calcium suggests either hypoparathyroidism or renal disease. A decreased phosphorus and an increased calcium suggests hyperparathyroidism&nbsp;or sarcoidosis. When both calcium and phosphorus are decreased diagnostic considerations include malabsorption, vitamin&nbsp;D deficiency and renal tubular acidosis. Increased phosphorus and normal or increased calcium suggests Milk-alkali syndrome or hypervitaminosis D.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Plasma</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&lt;1 Week</td>\r\n				<td>4.0-9.0 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1 Week-2 Years</td>\r\n				<td>4.0-8.0 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3-12 Years</td>\r\n				<td>3.0-6.0 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>13-64 Years</td>\r\n				<td>2.5-4.5 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;64 Years</td>\r\n				<td>2.1-4.3 mg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 718</li>\r\n</ul>\r\n','simple','1','2016-12-02 00:20:52','2021-01-16 05:21:56',49.0,19.0,'Phosphate (as Phosphorus)',0),(115,'Progesterone','progesterone','745','<p>A progesterone test measures the amount of the hormone progesterone in a blood sample. Progesterone is a female hormone produced by the ovaries during release of a mature egg from an ovary (ovulation). Progesterone helps prepare the lining of the uterus (endometrium) to receive the egg if it becomes fertilized by a sperm. If the egg is not fertilized, progesterone levels drop and menstrual bleeding begins. During pregnancy, the placenta also produces high levels of progesterone, starting near the end of the first trimester and continuing until the baby is born. Levels of progesterone in a pregnant woman are about 10 times higher than they are in a woman who is not pregnant. Some types of cancer cause abnormal progesterone levels in men and women.</p>\r\n\r\n<p>-Helps find the cause of infertility.</p>\r\n\r\n<p>-Monitors the success of medicines for infertility or the effect of treatment with progesterone.</p>\r\n\r\n<p>-Helps determine whether ovulation is occurring.</p>\r\n\r\n<p>-Assess the risk of miscarriage.</p>\r\n\r\n<p>-Monitors the function of the ovaries and placenta during pregnancy.</p>\r\n\r\n<p>-Helps to diagnose a&nbsp;problem with the adrenal glands and some types of cancer.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Male</td>\r\n				<td>&lt;1.4 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Female</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Follicular Phase</td>\r\n				<td>&lt;1.0 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Luteal Phase</td>\r\n				<td>2.6-21.5 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Postmenopausal</td>\r\n				<td>&lt;0.5 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Pregnancy</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>First Trimester</td>\r\n				<td>4.1-34.0 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Second Trimester</td>\r\n				<td>24.0-76.0 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Third Trimester</td>\r\n				<td>52.0-302.0 ng/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 745</li>\r\n</ul>\r\n','simple','1','2016-12-02 00:29:04','2021-01-16 05:21:56',69.0,25.0,'Progesterone',0),(116,'Prolactin','prolactin','746','<p>Prolactin is a hormone released by the pituitary gland. The prolactin test measures the amount of prolactin in the blood.</p>\r\n\r\n<p>Prolactin is usually measured when checking for pituitary tumors and the cause of:</p>\r\n\r\n<p>Breast milk production that is not related to childbirth (galactorrhea)</p>\r\n\r\n<p>Decreased sex drive (libido) in men and women, Impotence, Infertility, Irregular or no menstrual periods (amenorrhea.)</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Adult Male</td>\r\n				<td>2.0-18.0 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult Female</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Non-Pregnant</td>\r\n				<td>3.0-30.0 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Pregnant</td>\r\n				<td>10.0-209.0 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Postmenopausal</td>\r\n				<td>2.0-20.0 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Stages of Puberty (Tanner Stages)</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&nbsp;</td>\r\n				<td>Female Observed</td>\r\n				<td>Male Observed</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Stage I</td>\r\n				<td>3.6.12.0 ng/mL</td>\r\n				<td>&le;10.0 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Stage II-III</td>\r\n				<td>2.6-18.0 ng/mL</td>\r\n				<td>&le;6.1 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Stage IV-V</td>\r\n				<td>3.2-20.0 ng/mL</td>\r\n				<td>2.8-11.0 ng/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 746</li>\r\n</ul>\r\n','simple','1','2016-12-02 00:42:12','2021-01-16 05:21:56',79.0,37.0,'Prolactin',0),(117,'Rubella Antibodies (IgG, IgM) Diagnostic ','rubella-antibodies-igg-igm-diagnostic','37673','<p>Rubella (German Measles) is a common and usually benign viral infection of children. IgM antibody is detectable 11-25 days after the onset of exanthem, in most individuals 15-25 days after vaccination, and in 90-97% of infants with congenital rubella between 2 weeks and 3 months after birth. Acute and convalescent IgG titers may be interpreted to identify a &gt;30% rise in the antibody index. A positive IgG antibody indicates successful immunization or past exposure.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Limitations:</strong> False-positives may be found in newborns from mothers. IgM may persist after infection is treated.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 37673</li>\r\n</ul>\r\n','simple','1','2016-12-02 00:44:13','2021-01-16 05:21:56',189.0,80.0,'Rubella Antibodies (IgG, IgM) Diagnostic ',0),(118,'Rheumatoid Factor ','rheumatoid-factor','4418','<p>Elevated RF is found in collagen vascular diseases such as SLE, rheumatoid arthritis, scleroderma, Sjogren&#39;s syndrome, and in other conditions such as leprosy, tuberculosis, syphilis, malignancy, thyroid disease and in a significant percentage of otherwise normal elderly patients.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 4418</li>\r\n</ul>\r\n','simple','1','2016-12-02 00:46:18','2021-01-16 05:21:56',59.0,23.0,'Rheumatoid Factor ',0),(119,'Renal Function Panel ','renal-function-panel','10314','<p>A renal panel is a group of tests that may be performed together to evaluate kidney (renal) function. The tests measure levels of various substances, including several minerals, electrolytes, proteins, and glucose (sugar), in the blood to determine the current status of the kidneys.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Test Includes:</strong> Albumin, BUN/Creatinine Ratio (calculated), Calcium, Carbon Dioxide, Chloride, Creatinine, Estimated Glomerular Filtration Rate (calculated), Glucose, Phosphate (as Phosphorus), Potassium, Sodium, Urea Nitrogen</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Limitations:</strong> Spironolactone and some herbal drugs may interfere with this test.</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 10314</li>\r\n</ul>\r\n','simple','1','2016-12-02 00:48:32','2021-01-16 05:21:56',49.0,21.0,'Renal Function Panel ',0),(120,'Reticulocyte Count, Automated (Erythropietic Activity)','reticulocyte-count-automated-erythropietic-activity','793','<p>Use in evaluating erythropoietic activity. A reticulocyte test is used to determine the number and/or percentage of reticulocytes in the blood to help evaluate conditions that affect red blood cells (RBCs), such as <a href=\"https://labtestsonline.org/understanding/conditions/anemia\">anemia</a> or <a href=\"https://labtestsonline.org/understanding/conditions/bone-marrow-disorders/\">bone marrow disorders</a>. Reticulocytes are newly produced, relatively immature red blood cells. They form and mature in the <a href=\"https://labtestsonline.org/glossary/bone-marrow\">bone marrow</a> before being released into the blood.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Limitations:</strong> Large platelets, parasites, howell jolly bodies, or cold agglutins may cause inaccurate results.</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&le;3 Days</td>\r\n				<td>53000-370000 cells/&micro;L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7 Days</td>\r\n				<td>&le;51000 cells/&micro;L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1 Months</td>\r\n				<td>8000-84000 cells/&micro;L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>2 Months</td>\r\n				<td>11000-180000 cells/&micro;L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3 Months</td>\r\n				<td>11000-160000 cells/&micro;L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1 Years</td>\r\n				<td>9000-126000 cells/&micro;L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>12 Years</td>\r\n				<td>23000-92000 cells/&micro;L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>17 Years</td>\r\n				<td>24000-94000 cells/&micro;L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;17 Years Male</td>\r\n				<td>25000-90000 cells/&micro;L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;17 Years Female</td>\r\n				<td>20000-80000 cells/&micro;L</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 793</li>\r\n</ul>\r\n','simple','1','2016-12-02 00:56:36','2021-01-16 05:21:56',59.0,21.0,'Reticulocyte Count, Automated (Erythropietic Activity)',0),(121,'Rubella Immune Status ','rubella-immune-status','802','<p>Rubella is an acute exanthematous viral infection of children and adults. Rash, fever and lymphadenopathy characterize the illness. While many infections are subclinical, this virus has the potential to cause fetal infection with resultant birth defects. Diagnosis of a Rubella infection is best made serologically. In the absence of a current or recent infection, a demonstration of specific IgG on a serum sample is evidence of immunity to Rubella.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&le;0.90</td>\r\n				<td>Not consistent with immunity</td>\r\n			</tr>\r\n			<tr>\r\n				<td>0.91-1.09</td>\r\n				<td>Equivocal</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;1.10</td>\r\n				<td>Consistent with immunity</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 802</li>\r\n</ul>\r\n','simple','1','2016-12-02 00:59:42','2021-01-16 05:21:56',49.0,21.0,'Rubella Immune Status ',0),(122,'Sed Rate by Modified Westergren (ESR)','sed-rate-by-modified-westergren-esr','809','<p>Useful in differentiating inflammatory and neoplastic diseases and as an index of disease severity.&nbsp;CRP is also useful in monitoring inflammatory disease states.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Whole Blood</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&nbsp;</td>\r\n				<td>Male</td>\r\n				<td>Female</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&le;50 Years</td>\r\n				<td>&le;15 mm/h</td>\r\n				<td>&le;20 mm/h</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;50 Years</td>\r\n				<td>&le;20 mm/h</td>\r\n				<td>&le;30 mm/h</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Limitations:</strong> Patients with polycythemia and many hemoglobin abnormalities may have depressed sed rates whereas patients with anemia may have elevated sed rates.</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 809</li>\r\n</ul>\r\n','simple','1','2016-12-02 01:04:12','2021-01-16 05:21:56',29.0,20.0,'Sed Rate by Modified Westergren (ESR)',0),(123,'Selenium RBC','selenium-rbc','17133','<p>Selenium is a key component of a number of functional selenoproteins required for normal health. The best know of these are the antioxidant glutathione peroxidase enzymes. Selenium plays an important role in the control of thyroid hormone metabolism and is important for proper reproductive performance.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Whole Blood</li>\r\n	<li><strong>Reference Range(s):</strong> 120-300 mcg/L</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 17133</li>\r\n</ul>\r\n','simple','1','2016-12-02 01:07:03','2021-01-16 05:21:56',80.0,46.0,'Selenium RBC',0),(124,'Thyroid stimulating hormone (TSH)','thyroid-stimulating-hormone-tsh','899','<p>Thyroid stimulating hormone (TSH) is one of the most important hormones currently used to diagnose thyroid abnormalities. This glycoprotein is secreted by the pituitary and stimulates release of thyroxine (T4) and triiodothyronine (T3) from the thyroid gland. TSH release from the pituitary is controlled by thyrotropin releasing hormone (TRH) stimulation and negative feedback from free T3 and free T4. In general, TSH appears to be the more sensitive indicator of thyroid hormone status.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Premature Infants (28-36 Weeks)</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1st Week of Life</td>\r\n				<td>0.20-27.90 mIU/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Term Infants (&gt;37 Weeks)</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Serum or Cord Blood</td>\r\n				<td>1.00-39.00 mIU/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-2 Days</td>\r\n				<td>3.20-34.60 mIU/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3-4 Days</td>\r\n				<td>0.70-15.40 mIU/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>5 Days-4 Weeks</td>\r\n				<td>1.70-9.10 mIU/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-11 Months</td>\r\n				<td>0.80-8.20 mIU/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-19 Years</td>\r\n				<td>0.50-4.30 mIU/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;20 Years</td>\r\n				<td>0.40-4.50 mIU/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Pregnancy</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>First Trimester</td>\r\n				<td>0.26-2.66 mIU/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Second Trimester</td>\r\n				<td>0.55-2.73 mIU/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Third Trimester</td>\r\n				<td>0.43-2.91 mIU/L</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 899</li>\r\n</ul>\r\n','simple','1','2016-12-02 01:16:55','2021-01-16 05:21:56',70.0,34.0,'Thyroid stimulating hormone (TSH)',0),(125,'T3 Free ','t3-free','34429','<p>A free or total triiodothyronine (free T3 or total T3) test is used to assess thyroid function. It is ordered primarily to help diagnose hyperthyroidism and may be ordered to help monitor treatment of a person with a known thyroid disorder. T3 and T4 (thyroxine) are hormones produced by the thyroid gland. This test is used to diagnose hyperthyroidism and to clarify thyroid status in the presence of a possible protein binding abnormality.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&lt;1 Month</td>\r\n				<td>Not established</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-23 Months</td>\r\n				<td>3.3-5.2 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>2-12 Years</td>\r\n				<td>3.3-4.8 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>13-20 Years</td>\r\n				<td>3.0-4.7 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;20 Years</td>\r\n				<td>2.3-4.2 pg/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 34429</li>\r\n</ul>\r\n','simple','1','2016-12-02 01:22:10','2021-01-16 05:21:56',68.0,26.0,'T3 Free ',0),(126,'T3 Total ','t3-total','859','<p>Total T3 measurements are used to diagnose and monitor treatment of hyperthyroidism and are essential for recognizing T3 toxicosis.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&lt;1 Month</td>\r\n				<td>Not established</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-23 Months</td>\r\n				<td>117-239 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>2-12 Years</td>\r\n				<td>105-207 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>13-20 Years</td>\r\n				<td>86-192 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;20 Years</td>\r\n				<td>76-181 ng/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 859</li>\r\n</ul>\r\n','simple','1','2016-12-02 02:23:44','2021-01-16 05:21:56',58.0,24.0,'T3 Total ',0),(127,'T3 Reverse ','t3-reverse','90963','<p>The assay may be useful in the diagnosis of nonthyroidal illness (NTI). Patients with&nbsp;NTI have low T3 concentrations and increased concentrations of rT3. RT3 may be useful in neonates to distinguish euthyroid sick syndrome from central hypothyroidism.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 8-25 ng/dL</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 90963</li>\r\n</ul>\r\n','simple','1','2016-12-02 02:25:28','2021-01-16 05:21:56',180.0,52.0,'T3 Reverse ',0),(128,'T3 Uptake ','t3-uptake','861','<p>Decreased: Pregnancy, estrogens, hyperproteinemia, acute intermittent porphyria.<br />\r\nIncreased: Androgens, hyperproteinemia, stress, acute liver disease.<br />\r\nThis assay is a measure of available thyroid hormone binding sites and should be interpreted with thyroxine levels.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> 22-35 %</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 861</li>\r\n</ul>\r\n','simple','1','2016-12-02 02:27:12','2021-01-16 05:21:56',49.0,19.0,'T3 Uptake ',0),(129,'T4 Free ','t4-free','866','<p>For diagnosis of hypothyroidism and hyperthyroidism. Free thyroxine (free T4) tests are used to help evaluate thyroid function and diagnose thyroid diseases, including hyperthyroidism and hypothyroidism, usually after discovering that the thyroid stimulating hormone (TSH) level is abnormal.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&lt;1 Month</td>\r\n				<td>Not established</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-23 Months</td>\r\n				<td>0.9-1.4 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>2-12 Years</td>\r\n				<td>0.9-1.4 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>13-20 Years</td>\r\n				<td>0.8-1.4 ng/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;20 Years</td>\r\n				<td>0.8-1.8 ng/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 866</li>\r\n</ul>\r\n','simple','1','2016-12-02 02:30:12','2021-01-16 05:21:56',48.0,21.0,'T4 Free ',0),(130,'T4 Total ','t4-total','867','<p>For diagnosis of hypothyroidism and hyperthyroidism. T4 is a hormone that plays a role in several body functions, including growth and metabolism.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Limitations:</strong> Nonthyroidal chronic diseases, nicotinic acid and nutrition may decrease results. Thyrotoxicosis may not always cause abnormal results. Binding protein variations may cause variations in results. Increases may be associated with pregnancy or oral contraceptive use.</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>T4 (Thyroxine), Total</td>\r\n				<td>4.5-12.0 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Free T4 Index (T7)</td>\r\n				<td>1.4-3.8</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 867</li>\r\n</ul>\r\n','simple','1','2016-12-02 02:34:37','2021-01-16 05:21:56',48.0,20.0,'T4 Total ',0),(131,'Thyroid Antibodies ','thyroid-antibodies','267','<p>Measurement of thyroglobulin antibodies is useful in the diagnosis and management of a variety of thyroid disorders including Hashimoto&#39;s thyroiditis, Graves&#39; disease and certain types of goiter.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Limitations:</strong> Heterophil antibodies may produce falsely-elevated results.</li>\r\n	<li><strong>Reference Range(s):</strong> &le;1 IU/mL</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 267</li>\r\n</ul>\r\n','simple','1','2016-12-02 02:36:39','2021-01-16 05:21:56',67.0,26.0,'Thyroid Antibodies ',0),(132,'Testosterone Free ','testosterone-free','18944','<p>Testosterone testing can be used to diagnose various conditions in men, and women. Testosterone is the main sex hormone in men, produced mainly by the testicles, and is responsible for male physical characteristics. Although it is considered to be a &quot;male&quot; sex hormone, it is present in the blood of both males and females.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Adult</td>\r\n				<td>Males (pg/mL)</td>\r\n				<td>Females (pg/mL)</td>\r\n			</tr>\r\n			<tr>\r\n				<td>18-69 Years</td>\r\n				<td>46.0-224.0</td>\r\n				<td>0.2-5.0</td>\r\n			</tr>\r\n			<tr>\r\n				<td>70-89 Years</td>\r\n				<td>6.0-73.0</td>\r\n				<td>0.3-5.0</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong>&nbsp;18944</li>\r\n</ul>\r\n','simple','1','2016-12-02 02:40:50','2021-01-16 05:21:56',168.0,70.0,'Testosterone Free ',0),(133,'Wellness Baseline','wellness-baseline','wb-02','<p><span style=\"font-family: Raleway, Arial, sans-serif; font-size: 14px; text-align: center;\">Slightly more tests than you would get at your physical exam, which includes essential information about hormone balance, heart health, diabetes and various abnormalities.</span></p>\r\n','<p><span style=\"font-family: Raleway, Arial, sans-serif; font-size: 14px; text-align: center;\">Slightly more tests than you would get at your physical exam which, includes essent