Males (Adult)','testosterone-total-males-adult','873','<p>Testosterone circulates almost entirely bound to transport proteins: Normally less than 1-2% is free. The principal transport protein for testosterone is known as sex hormone binding globulin (SHBG) or testosterone-estradiol binding globulin (TeBG). Testosterone measurements are used to assess erectile dysfunction, infertility, gynecomastia, and osteoporosis and to assess hormone replacement therapy.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Limitations:</strong> Immunoassay does not provide sufficient sensitivity in detecting low concentrations among non-adults and women.</li>\r\n	<li><strong>Reference Range(s):</strong> Adult Male 250-827 ng/dL All test requests for Testosterone on female and pediatric (&lt;18 years) patients must use test code 15983 - Testosterone, Total.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 873</li>\r\n</ul>\r\n','simple','1','2016-12-06 05:07:13','2021-01-16 05:21:56',79.0,31.0,'Testosterone Total Males (Adult)',0),(140,'Tetanus Antitoxoid (Pre and Post Vaccination) ','tetanus-antitoxoid-pre-and-post-vaccination','91424','<p>Tetanus is a serious illness caused by Clostridium bacteria. The bacteria live in soil, saliva, dust, and manure. The bacteria can enter the body through a deep cut, like those you might get from stepping on a nail, or through a burn.</p>\r\n\r\n<p>The infection causes painful tightening of the muscles, usually all over the body. It can lead to &quot;locking&quot; of the jaw. This makes it impossible to open your mouth or swallow. Tetanus is a medical emergency. You need to get treatment in a hospital.</p>\r\n\r\n<p>A <a href=\"https://medlineplus.gov/tetanusdiphtheriaandpertussisvaccines.html\">vaccine</a> can prevent tetanus. It is given as a part of routine childhood immunization. Adults should get a tetanus shot, or booster, every 10 years. If you get a bad cut or burn, see your doctor - you may need a booster. Immediate and proper wound care can prevent tetanus infection.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Tetanus Antitoxoid Pre</td>\r\n				<td>No reference range available</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Tetanus Antitoxoid Post</td>\r\n				<td>&lt;0.05 IU/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Interpretive Criteria</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&lt;0.05 IU/mL</td>\r\n				<td>Nonprotective antibody level</td>\r\n			</tr>\r\n			<tr>\r\n				<td>0.05-0.49 IU/mL</td>\r\n				<td>Indeterminate for protective antibody</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;0.50 IU/mL</td>\r\n				<td>Protective antibody level</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 91424</li>\r\n</ul>\r\n','simple','1','2016-12-06 05:15:20','2021-01-16 05:21:56',140.0,50.0,'Tetanus Antitoxoid (Pre and Post Vaccination) ',0),(141,'Trichomonas vaginalis RNA, Qualitative, TMA (Female)','trichomonas-vaginalis-rna-qualitative-tma-female','19550','<p>Trichomonas (or &ldquo;trich&rdquo;) is a very common sexually transmitted disease (STD) that is caused by infection with a protozoan parasite called <em>Trichomonas vaginalis</em>. Although symptoms of the disease vary, most women and men who have the parasite cannot tell they are infected.</p>\r\n\r\n<p>This organism is considered one of the most common curable, sexually transmitted infections (STI) in the United States. Some studies suggest that <em>T vaginalis</em> is more prevalent than <em>Chlamydia trachomatis.</em> Over seven million cases of <em>T vaginalis</em> are estimated to occur annually in both males and females. The actual number of cases may be underestimated since 1) infection with <em>T vaginalis</em> is not a reportable disease in the U.S and 2 a significant number of cases are asymptomatic (10 to 50%); and 3) most tests (excluding transcription mediated amplification [TMA]) are not sensitive enough to detect the presence of this parasite.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Patient Prep:</strong> The patient should not have urinated for at least one hour prior to specimen collection. Patient to provide a first-catch urine</li>\r\n	<li><strong>Reference Range(s):</strong> T. vaginalis RNA,QL TMA Not detected This test was performed using the APTIMA&reg; Trichomonas vaginalis Assay (GEN-PROBE&reg;).</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 19550</li>\r\n</ul>\r\n','simple','1','2016-12-06 05:23:29','2021-01-16 05:21:56',140.0,55.0,'Trichomonas vaginalis RNA, Qualitative, TMA (Female)',0),(142,'Trichomonas vaginalis RNA, Qualitative, TMA (Male)','trichomonas-vaginalis-rna-qualitative-tma-male','90801','<p>Trichomonas (or &ldquo;trich&rdquo;) is a very common sexually transmitted disease (STD) that is caused by infection with a protozoan parasite called <em>Trichomonas vaginalis</em>. Although symptoms of the disease vary, most women and men who have the parasite cannot tell they are infected.</p>\r\n\r\n<p>This organism is considered one of the most common curable, sexually transmitted infections (STI) in the United States. Some studies suggest that <em>T vaginalis</em> is more prevalent than <em>Chlamydia trachomatis.</em> Over seven million cases of <em>T vaginalis</em> are estimated to occur annually in both males and females. The actual number of cases may be underestimated since 1) infection with <em>T vaginalis</em> is not a reportable disease in the U.S and 2 a significant number of cases are asymptomatic (10 to 50%); and 3) most tests (excluding transcription mediated amplification [TMA]) are not sensitive enough to detect the presence of this parasite.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Patient Prep:</strong> The patient should not have urinated for at least one hour prior to specimen collection. Patient to provide a first-catch urine</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>T. vaginalis RNA, QL, TMA, Males Not detected</td>\r\n			</tr>\r\n			<tr>\r\n				<td>This test was performed using the APTIMA&reg;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Trichomonas vaginalis assay (GEN-PROBE&reg;).</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 90801</li>\r\n</ul>\r\n','simple','1','2016-12-06 05:28:16','2021-01-16 05:21:56',120.0,55.0,'Trichomonas vaginalis RNA, Qualitative, TMA (Male)',0),(143,'Tyrosine ','tyrosine','902','<p>Tyrosine or 4-hydroxyphenylalanine is one of the 22 amino acids that are used by cells to synthesize proteins. It is a non-essential amino acid with a polar side group.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes</li>\r\n	<li><strong>Preferred Specimen:</strong> Plasma</li>\r\n	<li><strong>Patient Preparation:</strong> Collect specimen after an overnight fast (or at least 4 hours after a meal) if possible. Non-fasting samples are acceptable for pediatric patients.</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&le;30 Days</td>\r\n				<td>33-160 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>31 Days-23 Months</td>\r\n				<td>24-125 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>2-17 Years</td>\r\n				<td>31-108 &micro;mol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;18 Years</td>\r\n				<td>38-96 &micro;mol/L</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 902</li>\r\n</ul>\r\n','simple','1','2016-12-06 05:32:34','2021-01-16 05:21:56',120.0,55.0,'Tyrosine ',0),(144,'Tox 10 Profile, THC 20, with Alcohol Urine (Substance Abuse)','tox-10-profile-thc-20-with-alcohol-urine-substance-abuse','15720','<p>Do you suspect a patient or family member on drugs? If you have concerns or doubts that someone you know is taking dangerous substances, knowing can be done with a simple urine test.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Test Includes:</strong> Amphetamines, Barbituates, Benzodiazepines, Cocaine, Marijuana, Methadone, Methaqualone, Opiates, PCP (Phencyclidine), Propoxyphene, Ethanol</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 15720</li>\r\n</ul>\r\n','simple','1','2016-12-06 05:36:19','2021-01-16 05:21:56',350.0,120.0,'Tox 10 Profile, THC 20, with Alcohol Urine (Substance Abuse)',0),(145,'Treponema pallidum Antibody Particle Agglutination (STI) ','treponema-pallidum-antibody-particle-agglutination-sti','653','<p>The TP-PA test is designed to be used as an aid in the confirmation of atibodies&nbsp;to the treponemal organisms that cause syphilis. Other diseases such as yaws or pinta give positive results.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> Non-Reactive</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 653</li>\r\n</ul>\r\n','simple','1','2016-12-06 05:47:53','2021-01-16 05:21:56',115.0,115.0,'Treponema pallidum Antibody Particle Agglutination (STI) ',0),(146,'Uranium','uranium','34698','<p>Uranium is used as a fuel for nuclear reactors, armor piercing ammunition and guidance devices. Certain uranium compounds are used in the leather and wood industries for stains and dyes and coming back from war zones overseas. Uranium exposure may cause elevations of beta-2-microglobulin.</p>\r\n\r\n<p>The adverse effects on human health include the following:</p>\r\n\r\n<ul>\r\n	<li>Lung cancer</li>\r\n	<li>Reactive airway disease</li>\r\n	<li>Neurological abnormalities</li>\r\n	<li>Vision degradation</li>\r\n	<li>Lymphoma and other cancers</li>\r\n	<li>Birth defects in offspring</li>\r\n</ul>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Patient Preparation:</strong> Avoid exposure to gadolinium based contrast media for 48 hours prior to sample collection</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 34698</li>\r\n</ul>\r\n','simple','1','2016-12-06 05:50:57','2021-01-16 05:21:56',290.0,185.0,'Unanium',0),(147,'Urinalysis Complete ','urinalysis-complete','5463','<p>Dipstick urinalysis is important in accessing the chemical constituents in the urine and the relationship to various disease states. Microscopic examination helps to detect the presence of&nbsp;cells and other formed elements</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Test Includes:</strong> Macroscopic and Microscopic Examinations</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 5463</li>\r\n</ul>\r\n','simple','1','2016-12-06 05:54:10','2021-01-16 05:21:57',42.0,21.0,'Urinalysis Complete ',0),(148,'Urinalysis Macroscopic ','urinalysis-macroscopic','6448','<p>Dipstick urinalysis is important in accessing the chemical constituents in the urine and the relationship to various diseases.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Urine</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>pH</td>\r\n				<td>5.0-8.0</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Specific gravity</td>\r\n				<td>1.001-1.035</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Protein</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Glucose</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Appearance</td>\r\n				<td>Clear</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Leukocyte esterase</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Color</td>\r\n				<td>Yellow</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Occult blood</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Nitrite</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Bilirubin</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Ketones</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Reducing substances</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 6448</li>\r\n</ul>\r\n','simple','1','2016-12-06 06:12:44','2021-01-16 05:21:57',40.0,18.0,'Urinalysis Macroscopic ',0),(149,'Uric Acid ','uric-acid','905','<p>Serum uric acid measurements are useful in the diagnosis and treatment of numerous renal and metabolic disorders, including renal failure, gout, leukemia, psoriasis, starvation or other wasting conditions, and in patients receiving cytotoxic drugs.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> (See Patient Prep)</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Patient Preparation:</strong> If a cholesterol measurement is to be performed along with triglycerides, the patient should be fasting 9-12 hours prior to collection.</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&nbsp;</td>\r\n				<td>Male</td>\r\n				<td>Female</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&lt;1 Month</td>\r\n				<td>1.5-3.9 mg/dL</td>\r\n				<td>1.5-4.6 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-11 Months</td>\r\n				<td>1.5-5.6 mg/dL</td>\r\n				<td>1.5-5.4 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-3 Years</td>\r\n				<td>2.1-5.6 mg/dL</td>\r\n				<td>1.8-5.0 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>4-6 Years</td>\r\n				<td>1.8-5.5 mg/dL</td>\r\n				<td>2.0-5.1 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>7-9 Years</td>\r\n				<td>1.8-5.4 mg/dL</td>\r\n				<td>1.8-5.5 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-12 Years</td>\r\n				<td>2.2-5.8 mg/dL</td>\r\n				<td>2.5-5.9 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>13-15 Years</td>\r\n				<td>3.1-7.0 mg/dL</td>\r\n				<td>2.2-6.4 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>16-18 Years</td>\r\n				<td>2.1-7.6 mg/dL</td>\r\n				<td>2.4-6.6 mg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;19 Years</td>\r\n				<td>4.0-8.0 mg/dL</td>\r\n				<td>2.5-7.0 mg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 1 Day</li>\r\n	<li><strong>Test Code:</strong> 905</li>\r\n</ul>\r\n','simple','1','2016-12-06 06:26:14','2021-01-16 05:21:57',52.0,19.0,'Uric Acid ',0),(150,'Vitamin D, 25-Hydroxy','vitamin-d-25-hydroxy','17306','<p>An estimated 68% to 77% of patients have suboptimal (&lt;30 ng/mL) levels of vitamin D. This important nutrient promotes skeletal health by enhancing the intestinal absorption of calcium and phosphorus. Measurement of serum 25-OH vitamin D concentrations provide a good index of circulating vitamin D activity in patients not suffering from renal disease. Lower than normal 25-OH vitamin D levels can result from a dietary deficiency, poor absorption of the vitamin or impaired metabolism of the sterol in the liver. A 25-OH vitamin D deficiency can lead to bone diseases such as rickets and osteomalacia. Above normal levels can lead to hypercalcemia</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 17306</li>\r\n</ul>\r\n','simple','1','2016-12-06 06:28:15','2021-01-16 05:21:57',98.0,33.0,'Vitamin D, 25-Hydroxy',0),(151,'Vitamin B6','vitamin-b6','926','<p>Test is used to determine vitamin B6 deficiency or overdosage, for monitoring treatment, and to evaluate wellness and health.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes</li>\r\n	<li><strong>Preferred Specimen:</strong> Plasma</li>\r\n	<li><strong>Patient Preparation:</strong> Overnight fasting is required</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>2-17 Years</td>\r\n				<td>3.0-35.0 ng/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult</td>\r\n				<td>2.1-21.7 ng/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 926</li>\r\n</ul>\r\n','simple','1','2016-12-06 06:33:15','2021-01-16 05:21:57',120.0,60.0,'Vitamin B6',0),(152,'Vitamin B12','vitamin-b12','927','<p>Vitamin B12 is decreased in pernicious anemia, total or partial gastrectomy, malabsorption and certain congenital and biochemical disorders.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Patient Preparation:</strong> Overnight fasting is required</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&le;4 Years</td>\r\n				<td>Not established</td>\r\n			</tr>\r\n			<tr>\r\n				<td>5-9 Years</td>\r\n				<td>250-1205 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-17 Years</td>\r\n				<td>260-935 pg/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;17 Years</td>\r\n				<td>200-1100 pg/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 927</li>\r\n</ul>\r\n','simple','1','2016-12-06 06:39:29','2021-01-16 05:21:57',70.0,28.0,'Vitamin B12',0),(153,'Vitamin C','vitamin-c','929','<p>Vitamin C is an antioxidant involved in connective tissue metabolism, drug-metabolizing systems, and mixed-function oxidase systems to list a few. Vitamin C deficiency causes scurvy; manifestations include impaired formation of mature connective tissue, bleeding into the skin, weakness, fatigue, and depression.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> See Patient Preparation</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Patient Preparation:</strong> Overnight fasting is preferred. Patient should refrain from taking vitamin C supplements or fruits 24 hours prior to sample collection.</li>\r\n	<li><strong>Overnight fasting is required</strong></li>\r\n	<li><strong>Reference Range(s):</strong> 0.2-1.5 mg/dL</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 929</li>\r\n</ul>\r\n','simple','1','2016-12-06 06:43:22','2021-01-16 05:21:57',110.0,37.0,'Vitamin C',0),(154,'Vitamin E','vitamin-e','931','<p>Deficiency of vitamin E may cause extensive neuropathy in young children and, in addition, is suspect as&nbsp;a possible cause of motor and sensory neuropathy in older children and in adults. One likely cause of vitamin E deficiency is intestinal malabsorption, resulting from bowel disease, pancreatic disease, or chronic cholestasis. Other causes of malabsorption of vitamin E include celiac disease, cystic fibrosis, and intestinal lymphangiectasia.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Patient Preparation:</strong> Overnight fasting is required.</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Alpha-Tocopherol</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult</td>\r\n				<td>5.7-19.9 mg/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Pediatric</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Term Infants (Cord Blood)</td>\r\n				<td>1.8-5.8 mg/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>4 Months-1 Year</td>\r\n				<td>&le;9.1 mg/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1-2 Years</td>\r\n				<td>2.9-16.6 mg/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>3-5 Years</td>\r\n				<td>5.5-11.8 mg/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6-8 Years</td>\r\n				<td>4.6-14.8 mg/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>9-11 Years</td>\r\n				<td>6.2-14.3 mg/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>12-17 Years</td>\r\n				<td>3.7-12.4 mg/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Beta-Gamma-Tocopherol</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult</td>\r\n				<td>&le;4.3 mg/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Pediatric 3-17 Years</td>\r\n				<td>&le;3.8 mg/L</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 9 Days</li>\r\n	<li><strong>Test Code:</strong> 36168</li>\r\n</ul>\r\n','simple','1','2016-12-06 06:50:55','2021-01-16 05:21:57',112.0,37.0,'Vitamin E',0),(155,'VMA (Vanillylmandelic Acid), 24-Hour Urine','vmavanillylmandelic-acid-24-hour-urine','934','<p>Vanillylmandelic acid (VMA) is the major urinary product resulting from the metabolic degradation of catecholamine, norepinephrine and epinephrine. Elevated concentrations of VMA are commonly found in cases of catecholamine secreting tumors such as pheochromocytoma, neuroblastoma, and ganglioneuroma.</p>\r\n\r\n<p>Drugs which can interfere with testing due to physiologic response: clonidine, L-dopa, methocarbamol, monoamine oxidase inhibitors, reserpine, salicylates.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> NO</li>\r\n	<li><strong>Preferred Specimen:</strong> 24 Hr Urine</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>3-8 Years</td>\r\n				<td>&le;2.3 mg/24 h</td>\r\n			</tr>\r\n			<tr>\r\n				<td>9-12 Years</td>\r\n				<td>&le;3.4 mg/24 h</td>\r\n			</tr>\r\n			<tr>\r\n				<td>13-17 Years</td>\r\n				<td>&le;3.9 mg/24 h</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;17 Years</td>\r\n				<td>&le;6.0 mg/24 h</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Limitations:</strong> Requires accurate 24-hour urine collection.</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 934</li>\r\n</ul>\r\n','simple','1','2016-12-06 06:55:44','2021-01-16 05:21:57',110.0,45.0,'VMA (Vanillylmandelic Acid), 24-Hour Urine',0),(156,'VLDL Cholesterol ','vldl-cholesterol','319','<p>High levels of VLDL cholesterol have been associated with the development of plaque deposits on artery walls, which narrow the passage and restrict blood flow. VLDL (Bad) Cholesterol. Expand Section. VLDL contains the highest amount of triglycerides. VLDL is considered a type of bad cholesterol, because it helps cholesterol build up on the walls of arteries.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong> Yes</li>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Patient Preparation:</strong> Patient should fast 9-12 hours prior to collection</li>\r\n	<li><strong>Test Includes:</strong> Triglycerides, VLDL (calculation)</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>Triglycerides</td>\r\n				<td>&nbsp;</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&nbsp;</td>\r\n				<td>Male (mg/dL)</td>\r\n				<td>Female (mg/dL)</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&le;9 Years</td>\r\n				<td>30-104</td>\r\n				<td>33-115</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-14 Years</td>\r\n				<td>33-129</td>\r\n				<td>38-135</td>\r\n			</tr>\r\n			<tr>\r\n				<td>15-19 Years</td>\r\n				<td>38-152</td>\r\n				<td>40-136</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&gt;19 Years</td>\r\n				<td>&lt;150</td>\r\n				<td>&lt;150</td>\r\n			</tr>\r\n			<tr>\r\n				<td>VLDL Cholecterol</td>\r\n				<td>&lt;30</td>\r\n				<td>mg/dL (calc)</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 319</li>\r\n</ul>\r\n','simple','1','2016-12-06 07:02:18','2021-01-16 05:21:57',78.0,19.0,'VLDL Cholesterol ',0),(157,'Viscosity ','viscosity','918','<p>High serum viscosity may be most commonly observed in patients with Waldenstr&ouml;m&#39;s macroglobulinemia and multiple myeloma. Patients with high viscosity may have capillary occlusion, stasis hypoxia, and acidosis.</p>\r\n','<ul>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> See Laboratory Report</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 918</li>\r\n</ul>\r\n','simple','1','2016-12-06 07:05:13','2021-01-16 05:21:57',78.0,35.0,'Viscosity ',0),(158,'Zink Transporter 8 ZnT8 Antibody ','zink-transporter-8-znt8-antibody','93022','<p>Patient population is primarily children and adolescents to confirm a diagnosis of type 1 diabetes.</p>\r\n','<ul>\r\n	<li><strong>Preferred Specimen:</strong> Serum</li>\r\n	<li><strong>Reference Range(s):</strong> &lt;15 U/mL</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 93022</li>\r\n</ul>\r\n','simple','1','2016-12-06 07:07:05','2021-01-16 05:21:57',200.0,90.0,'Zink Transporter 8 ZnT8 Antibody ',0),(159,'Zinc ','zinc','945','<p>Zinc is an essential element involved in a myriad of enzyme systems including wound healing, immune function, and fetal development. Zinc measurements are used to detect and monitor industrial, dietary, and accidental exposure to zinc. Also, zinc measurements may be used to evaluate health and monitor response to treatment.</p>\r\n','<ul>\r\n	<li><strong>Preferred Specimen:</strong> Plasma</li>\r\n	<li><strong>Reference Range(s):</strong>\r\n	<table>\r\n		<tbody>\r\n			<tr>\r\n				<td>&le;5 Months</td>\r\n				<td>26-141 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6-11 Months</td>\r\n				<td>29-131 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>12-23 Months</td>\r\n				<td>31-120 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>2-3 Years</td>\r\n				<td>29-115 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>4-5 Years</td>\r\n				<td>48-119 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>6-9 Years</td>\r\n				<td>48-129 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>10-13 Years</td>\r\n				<td>25-148 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>14-17 Years</td>\r\n				<td>46-130 mcg/dL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Adult</td>\r\n				<td>60-130 mcg/dL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li><strong>Turnaround Time:</strong> 5 Days</li>\r\n	<li><strong>Test Code:</strong> 945</li>\r\n</ul>\r\n','simple','1','2016-12-06 07:13:03','2021-01-16 05:21:57',95.0,31.0,'Zinc ',0),(160,'ZINC RBC','zinc-rbc','6354','<p>Zinc is an essential element involved in a myriad of enzyme systems including wound healing, immune function, and fetal development. Zinc measurements are used to detect and monitor industrial, dietary, and accidental exposure to zinc. Also, Zinc measurements may be used to evaluate health and monitor response to treatment.</p>\r\n','<ul>\r\n	<li><strong>Preferred Specimen:</strong> Plasma</li>\r\n	<li><strong>Reference Range(s):</strong> 9.0-14.7 mg/L</li>\r\n	<li><strong>Turnaround Time:</strong> 3 Days</li>\r\n	<li><strong>Test Code:</strong> 6354</li>\r\n</ul>\r\n','simple','1','2016-12-06 07:16:11','2021-01-16 05:21:57',110.0,45.0,'ZINC RBC',0),(161,'One time Specimen Collection Fee','one-time-specimen-collection-fee',NULL,'','','additional','1',NULL,'2021-02-23 14:22:09',0.1,NULL,NULL,1),(162,'Talk to our MD about your results','talk-to-our-md-about-your-results',NULL,NULL,NULL,'simple','1','2017-01-23 17:00:00','2021-04-06 06:41:15',26.0,NULL,NULL,0),(163,'Insulin-like Growth Factor I (IGF-I)','insulin-like-growth-factor-i-igf-i','16293','<p><span lang=\"EN\" open=\"\" style=\"color: rgb(99, 102, 106); font-family:;\"><font size=\"3\">Insulin-like growth factor I (IGF-I, or somatomedin C), a protein involved in stimulating somatic growth, is regulated principally by growth hormone (GH) and nutritional intake. IGF-I is transported in serum by several proteins; this helps maintain relatively high IGF-I plasma levels and minimizes fluctuations in serum IGF-I concentrations.<br />\r\nMeasuring IGF-I is useful in several growth-related disorders. Dwarfism caused by deficiency of growth hormone (hypopituitarism) results in decreased serum levels of IGF-I, while acromegaly (growth hormone excess) results in elevated levels of IGF-I. IGF-I measurements are also helpful in assessing nutritional status; levels are reduced in undernutrition and restored with a proper diet.</font></span></p>\r\n\r\n<p>&nbsp;</p>\r\n','<p>Fasting Required: No</p>\r\n\r\n<p>Preferred Specimen: Serum</p>\r\n\r\n<h4>Reference Range(s)</h4>\r\n\r\n<p>See Laboratory Report</p>\r\n\r\n<p>Turnaround Time: 7 Days</p>\r\n\r\n<p>Test Code: 16293</p>\r\n','simple','1','2017-03-31 10:20:49','2021-01-16 05:21:57',69.0,69.0,'Igf-1',0),(165,'Vitamin K ','vitamin-k','36585','<p><strong>Vitamin K</strong>&nbsp;is a fat-soluble&nbsp;<strong>vitamin</strong>&nbsp;that is most well-known for the important role it plays in blood clotting. However,&nbsp;<strong>vitamin K</strong>&nbsp;is also absolutely essential to build strong bones and prevent heart disease, and it plays a crucial role in other bodily functions other than blood clotting.&nbsp;Vitamin K helps to prevent hardening of the arteries, which is a common factor in coronary artery disease and heart failure. Research suggests that vitamin K may help to keep calcium out of artery linings and other body tissues, where it can be damaging.&nbsp;Vitamin K helps to prevent hardening of the arteries, which is a common factor in coronary artery disease and heart failure. Research suggests that vitamin K may help to keep calcium out of artery linings and other body tissues, where it can be damaging.</p>\r\n','<ul>\r\n	<li><strong>Fasting Required:</strong>&nbsp;Over night fasting is perferred&nbsp;</li>\r\n	<li><strong>Preferred Specimen:</strong>&nbsp;Plasma</li>\r\n	<li><strong>Reference Range(s):</strong>&nbsp;80-1160 pg/mL</li>\r\n	<li><strong>Turnaround Time:</strong>&nbsp;3-5 days</li>\r\n	<li><strong>Test Code:</strong>&nbsp;36585</li>\r\n</ul>\r\n','simple','1','2017-11-21 00:33:37','2021-01-16 05:21:57',249.0,175.0,'Cheap Blood test, vitamin k ',0),(166,'Thyroid Stimulating Immunoglobulin (TSI)','thyroid-stimulating-immunoglobulin-tsi','30551','<p>The TSI test measures the level of thyroid-stimulating immunoglobulin (TSI) in your blood. High levels of TSI in the blood can indicate the presence of Graves&rsquo; disease, which is an autoimmune disorder that affects the thyroid gland. If you have Graves&rsquo; disease, you&rsquo;re more likely to develop other autoimmune diseases such as type 1 diabetes or Addison&rsquo;s disease. Graves&#39; disease is a classic form of hyperthyroid disease, affecting approximately 0.4% of the population of the United States. It is caused by IgG immunoglobulins, collectively known as thyroid stimulating immunoglobulins (TSI). Patients who are candidates for antithyroid drug therapy may not respond to this treatment when TSI levels are markedly elevated. The determination of TSI can also assist in predicting hyperthyroidism in neonates, due to placental transmission of the immunoglobulins from a mother with hyperthyroidism.</p>\r\n','<p style=\"margin-left:.5in;\"><span style=\"box-sizing: border-box; font-weight: 700; color: rgb(82, 81, 82); font-family: Raleway, Arial, sans-serif; font-size: 16.8px; transition: all 0.3s ease 0s !important;\">Fasting Required</span><strong>:</strong>&nbsp;NO</p>\r\n\r\n<p style=\"margin-left:.5in;\"><span style=\"box-sizing: border-box; font-weight: 700; color: rgb(82, 81, 82); font-family: Raleway, Arial, sans-serif; font-size: 16.8px; transition: all 0.3s ease 0s !important;\">Preferred Specimen</span><strong>:</strong>&nbsp;Serum</p>\r\n\r\n<p style=\"margin-left:.5in;\"><span style=\"box-sizing: border-box; font-weight: 700; color: rgb(82, 81, 82); font-family: Raleway, Arial, sans-serif; font-size: 16.8px; transition: all 0.3s ease 0s !important;\">Reference Range(s):</span><strong>&nbsp;</strong>&lt;140% Baseline</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong><span style=\"box-sizing: border-box; font-weight: 700; color: rgb(82, 81, 82); font-family: Raleway, Arial, sans-serif; font-size: 16.8px; transition: all 0.3s ease 0s !important;\">Turnaround Time</span><strong>:</strong>&nbsp;5 Days</p>\r\n\r\n<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</strong><span style=\"box-sizing: border-box; font-weight: 700; color: rgb(82, 81, 82); font-family: Raleway, Arial, sans-serif; font-size: 16.8px; transition: all 0.3s ease 0s !important;\">Test Code</span><strong>:</strong>&nbsp;30551</p>\r\n','simple','1','2017-11-22 11:54:02','2021-01-16 05:21:57',199.0,130.0,'Cheap Blood Test, TSI, Thyroid Stimulating Immunoglobulin, Thyroid',0),(168,'Vitamin B1 (Thiamine)','vitamin-b1-thiamine','5042','<p><span style=\"color: rgb(99, 102, 106); font-family: arial, sans-serif; font-size: 16px;\">Vitamin B1 is required for branched-chain amino acid and carbohydrate metabolism. Vitamin B1 deficiency is most often due to alcoholism or chronic illness. In the early stage, patients with vitamin B1 deficiency exhibit anorexia, irritability, apathy, and generalized weakness. Prolonged deficiency causes beriberi.</span></p>\r\n','<ul style=\"box-sizing: border-box; margin-top: 45px; margin-bottom: 0px; padding-right: 0px; padding-left: 0px; font-family: Raleway, Arial, sans-serif; font-size: 14px; transition: all 0.3s ease 0s !important;\">\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Fasting Required:</span>&nbsp;Yes</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Preferred Specimen:</span>&nbsp;Whole Blood</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Patient Preparation:</span>&nbsp;Overnight fasting is required</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Reference Range(s):</span></li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\">Adults 78-185 nmol/L</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\">&nbsp;</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\">&nbsp;</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Turnaround Time:</span>&nbsp;3 Days</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Test Code:</span>&nbsp;5042</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\">\r\n	<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"margin: 0px; padding: 0px; border-collapse: collapse; border-spacing: 0px; line-height: 1.5; color: rgb(99, 102, 106); font-family: arial, sans-serif;\" summary=\"\" width=\"200\">\r\n		<tbody>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n</ul>\r\n\r\n<div>&nbsp;</div>\r\n','simple','1','2017-11-24 13:47:25','2021-01-16 05:21:57',149.0,89.0,'vitamin b1, Thiamine, blood test',0),(169,'Acetylcholine Receptor Binding Antibody (AcHR)','acetylcholine-receptor-binding-antibody-achr','206','<p><span style=\"color: rgb(99, 102, 106); font-family: arial, sans-serif; font-size: 16px;\">Myasthenia Gravis (MG) is an autoimmune neuromuscular disorder characterized by muscle weakness, most commonly due to autoantibody-mediated loss of functional acetylcholine receptors (AChR) in the neuromuscular junction. AChR binding autoantibodies are diagnostic of MG, and are found in 85-90% of&nbsp;MG patients. This assay aids in the differential diagnosis of conditions with MG-like muscle weakness and in monitoring therapeutic response. If binding antibodies are negative, assays for modulating and blocking antibodies should be considered.</span></p>\r\n','<ul style=\"box-sizing: border-box; margin-top: 45px; margin-bottom: 0px; padding-right: 0px; padding-left: 0px; font-family: Raleway, Arial, sans-serif; font-size: 14px; transition: all 0.3s ease 0s !important;\">\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Fasting Required:</span>&nbsp;NO</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Preferred Specimen:</span>&nbsp;Serum</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Patient Preparation:</span>&nbsp;None</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Reference Range(s):</span></li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\">\r\n	<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"margin: 0px; padding: 0px; border-collapse: collapse; border-spacing: 0px; line-height: 1.5; color: rgb(99, 102, 106); font-family: arial, sans-serif;\" summary=\"\" width=\"200\">\r\n		<tbody>\r\n			<tr>\r\n				<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">Negative</td>\r\n				<td colspan=\"2\" style=\"margin: 0px; padding: 0px; vertical-align: top;\">&le;0.30 nmol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">Equivocal</td>\r\n				<td colspan=\"2\" style=\"margin: 0px; padding: 0px; vertical-align: top;\">0.31-0.49 nmol/L</td>\r\n			</tr>\r\n			<tr>\r\n				<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">Positive</td>\r\n				<td colspan=\"2\" style=\"margin: 0px; padding: 0px; vertical-align: top;\">&ge;0.50 nmol/L</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Turnaround Time:</span>&nbsp;3 Days</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Test Code:</span>&nbsp;206</li>\r\n</ul>\r\n','simple','1','2017-11-24 14:07:42','2021-01-16 05:21:57',349.0,149.0,'Acetylcholine Receptor Binding Antibody, blood test, direct-to-consumer',0),(170,'Cysticercus Antibody (Parasites)','cysticercus-antibody-parasites','34173','<p>Cysticercosis is caused by infection with the larval form (cysticercus) of the pork tapeworm&nbsp;<em>Taenia solium</em>. Clinical manifestations of cysticercosis most commonly result from the lodging of cysticerci in brain and neural tissue. Common symptoms of neurocysticercosis include seizures and convulsions. Antibodies from other parasitic infections, especially echinococcosis, may cross-react in the Cysticercus IgG ELISA.</p>\r\n\r\n<p>The pork tapeworm responsible for causing cysticercosis is endemic to many parts of the developing world, including Latin America, Asia, and sub-Saharan Africa. The World Health Organization (WHO) estimates that cysticercosis affects about 50-100 million people worldwide. The incidence of cysticercosis has increased in the United States due to increased immigration from developing countries. Approximately 1,000 new cases of cysticercosis in the United States are reported annually.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','<ul style=\"box-sizing: border-box; margin-top: 45px; margin-bottom: 0px; padding-right: 0px; padding-left: 0px; font-family: Raleway, Arial, sans-serif; font-size: 14px; transition: all 0.3s ease 0s !important;\">\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Fasting Required:</span>&nbsp;No</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Preferred Specimen:</span>&nbsp;Serum</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"color: rgb(82, 81, 82); font-family: Raleway, Arial, sans-serif; font-size: 16.8px; font-weight: 700;\">Patient Preparation:&nbsp;</span><span style=\"color: rgb(82, 81, 82); font-family: Raleway, Arial, sans-serif; font-size: 16.8px;\">None</span></li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 