en associated with benign and malignant prostatic disorders. Studies indicate that in men 50 years or older measurement of PSA is a useful addition to the digital rectal exam in the early detection of prostate cancer. In addition, PSA decreases to undetectable levels following complete resection of the tumor and may rise again with recurrent disease or persist with residual disease. Thus, PSA levels may be of assistance in the management of prostate cancer patients.</span></p>\r\n','<ul style=\"box-sizing: border-box; margin-top: 45px; margin-bottom: 0px; padding-right: 0px; padding-left: 0px; font-family: Raleway, Arial, sans-serif; font-size: 14px; transition: all 0.3s ease 0s !important;\">\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Fasting Required:</span>&nbsp;NO</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Preferred Specimen:</span>&nbsp;Serum</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Reference Range(s):</span></li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"color: rgb(99, 102, 106); font-family: arial, sans-serif; font-size: 16px;\">See Laboratory Report</span></li>\r\n</ul>\r\n\r\n<p style=\"box-sizing: border-box;