donic Acid</strong></td>\r\n				<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">5.2-12.9%</td>\r\n			</tr>\r\n			<tr>\r\n				<td style=\"margin: 0px; padding: 0px; vertical-align: top;\"><strong>EPA</strong></td>\r\n				<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">0.2-1.5&nbsp;%</td>\r\n			</tr>\r\n			<tr>\r\n				<td style=\"margin: 0px; padding: 0px; vertical-align: top;\"><strong>DHA</strong></td>\r\n				<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">1.2-3.9&nbsp;%</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Turnaround Time:</span>&nbsp;3 Day</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Test Code:</span>&nbsp;91001</li>\r\n</ul>\r\n','simple','1','2017-12-06 16:47:59','2021-01-16 05:21:57',199.0,54.0,'Omega 3, 6 Fatty Acids, Cheap blood test, online blood test, cardio, lipid ',0),(174,'ANA Screen IFA, with Reflex to Titer and Pattern','ana-screen-ifa-with-reflex-to-titer-and-pattern','249','<p>Antinuclear antibodies (ANA) are a group of&nbsp;antibodies&nbsp;produced by a person&#39;s&nbsp;immune system&nbsp;when it fails to adequately distinguish between &quot;self&quot; and &quot;non-self.&quot; These antibodies, known as autoantibodies, attack the body&#39;s own healthy cells and cause&nbsp;signs&nbsp;and&nbsp;symptoms&nbsp;such as tissue and organ&nbsp;inflammation,&nbsp;joint&nbsp;and muscle pain, and fatigue. ANA specifically target substances found in the&nbsp;nucleus&nbsp;of a cell, hence the name &quot;antinuclear.&quot; The ANA test identifies the presence of these autoantibodies in the blood.&nbsp;The ANA test is one of the primary tests for helping to diagnose a suspected autoimmune disorder or ruling out other conditions with similar signs and symptoms.</p>\r\n\r\n<p>&nbsp;</p>\r\n','<p>Fasting Required: No</p>\r\n\r\n<p>Preferred Specimen: Serum</p>\r\n\r\n<p>Reference Range(s):</p>\r\n\r\n<p><strong style=\"font-family: arial, sans-serif;\">ANA Screen&nbsp;</strong>Negative</p>\r\n\r\n<p><strong style=\"font-family: arial, sans-serif;\">ANA Titer</strong>&nbsp;</p>\r\n\r\n<p>&lt;1:40Negative</p>\r\n\r\n<p>1:40-1:80Low antibody level</p>\r\n\r\n<p>&gt;1:80Elevated antibody level</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div>&nbsp;</div>\r\n','simple','1','2018-05-08 20:25:37','2021-01-16 05:21:57',99.0,29.0,'ANA Screen ',0),(176,'Sex Hormone Binding Globulin (SHBG) ','sex-hormone-binding-globulin-shbg','30740','<p>Sex hormone binding globulin (SHBG) is a&nbsp;protein&nbsp;that is produced by the liver and binds tightly to the&nbsp;hormones&nbsp;testosterone, dihydrotestosterone (DHT), and estradiol (an&nbsp;estrogen). In this bound state, SHBG transports these hormones in the blood as biologically inactive forms. This test measures the level of SHBG in the blood and is most often used to help evaluate for testosterone deficiency or excess. In men, about 45% to 65% of testosterone in blood is normally bound to SHBG, with the remainder weakly and reversibly bound to&nbsp;albumin&nbsp;(the main protein in the blood). Only about 2% to 3% of testosterone is immediately available to the tissues as free testosterone, but testosterone that is weakly bound to albumin is also bioavailable and can be readily taken up by the body&#39;s tissues.</p>\r\n\r\n<p>&nbsp;</p>\r\n','<p>Fasting Required: No</p>\r\n\r\n<p>Preferred Specimen: Plasma</p>\r\n\r\n<p>Reference Range(s)</p>\r\n\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"margin: 0px; padding: 0px; border-collapse: collapse; border-spacing: 0px; line-height: 1.5; color: rgb(99, 102, 106); font-family: arial, sans-serif;\" summary=\"\" width=\"375\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"margin: 0px; padding: 0px; vertical-align: top;\">&lt;3&nbsp;Years</td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">Not established</td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"margin: 0px; padding: 0px; vertical-align: top;\">&nbsp;</td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">&nbsp;<strong>Male</strong></td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">&nbsp;<strong>Female</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"margin: 0px; padding: 0px; vertical-align: top;\">3-9 Years&nbsp;</td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">32-158 nmol/L</td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">32-158 nmol/L</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"margin: 0px; padding: 0px; vertical-align: top;\">10-13 Years</td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">20-166&nbsp;nmol/L</td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">24-120 nmol/L</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"margin: 0px; padding: 0px; vertical-align: top;\">14-17 Years</td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">20-87&nbsp;nmol/L</td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">12-150 nmol/L</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"margin: 0px; padding: 0px; vertical-align: top;\">18-55 Years</td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">10-50 nmol/L</td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">17-124 nmol/L</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"3\" style=\"margin: 0px; padding: 0px; vertical-align: top;\">&gt;55 Years</td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">22-77 nmol/L</td>\r\n			<td style=\"margin: 0px; padding: 0px; vertical-align: top;\">14-73 nmol/L</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(99, 102, 106); font-family: arial, sans-serif; font-size: 16px;\">Turn Around Time: 5 Days</p>\r\n\r\n<p style=\"margin: 0px 0px 1em; padding: 0px; color: rgb(99, 102, 106); font-family: arial, sans-serif; font-size: 16px;\">Test Code:30740</p>\r\n','simple','1','2018-05-09 19:40:07','2021-01-16 05:21:57',199.0,49.0,'Sex,Hormone,Binding,Globulin,SHBG',0),(179,'Adrenocorticotropic Hormone (ACTH)','adrenocorticotropic-hormone-acth','211','<p>Adrenocorticotropic hormone (ACTH) is a&nbsp;hormone&nbsp;that stimulates the production of&nbsp;cortisol, produced by the pituitary gland. Cortisol is a steroid hormone made by the&nbsp;adrenal glands&nbsp;that is important for regulating glucose, protein, and lipid&nbsp;metabolism, suppressing the&nbsp;immune system&#39;s response, and helping to maintain blood pressure. This test measures the amount of ACTH in the blood.</p>\r\n\r\n<p>ACTH is useful in differentiating between primary and secondary adrenocortical hypo- and hyper function disorder, such as:</p>\r\n\r\n<p>Addison &rsquo;s disease</p>\r\n\r\n<p>Crushing&rsquo;s Syndrome</p>\r\n\r\n<p>Adrenal Carcinoma</p>\r\n\r\n<p>Ectopic ACTH Syndrome</p>\r\n\r\n<p>Nodular Hyperplasma</p>\r\n','<p><span style=\"color: rgba(0, 0, 0, 0.87); font-family: Akkurat, sans-serif; font-size: medium;\">Preferred Speciman: Plasma</span></p>\r\n\r\n<p><label class=\"ng-scope\" ng-if=\"testDetails.PatientPreparation &amp;&amp; !keysPresent.patientPreparation\" style=\"font-size: medium; color: rgba(0, 0, 0, 0.87); font-family: Akkurat, sans-serif;\">Patient Preparation:&nbsp;</label></p>\r\n\r\n<div class=\"qd-test-center__test-det