px;\">Patient should not clench fist during collection, as muscular exertion often increases venous ammonia levels.&nbsp;</span></h2>\r\n\r\n	<h2 class=\"h2-subhead ng-scope\" ng-if=\"testDetails.Methodology\" style=\"font-size: 16px; margin: 0px; color: rgba(0, 0, 0, 0.87); font-family: Akkurat, sans-serif;\"><span style=\"font-size: 14px;\">Patient should avoid smoking prior to phlebotomy since smoking increases plasma ammonia levels.</span></h2>\r\n	</li>\r\n</ul>\r\n</div>\r\n','simple','1','2019-08-24 15:47:49','2021-01-16 05:21:57',149.0,89.0,'kidney , Liver, Ammonia, cardiac',0),(183,'Vitamin B7 Biotin ','vitamin-b7-biotin','391 ','<p>Biotin&nbsp;is a water-soluble B-vitamin that helps your body convert food into energy. It is especially important during pregnancy and breastfeeding. In addition,&nbsp;biotin&nbsp;is important for the health of your hair, skin and nails.</p>\r\n\r\n<p>Biotin helps regulate your&nbsp;LDL (bad) cholesterol&nbsp;and blood sugar. Biotin is also necessary to produce keratin, a protein that promotes strong nails and hair.</p>\r\n\r\n<p>Biotin is a water-soluble vitamin. That means it&rsquo;s not stored in your body for long. Your body doesn&rsquo;t naturally produce it, either. However, the bacteria in your gut can produce biotin. These bacteria, also called intestinal flora, have a healthy impact on your health.</p>\r\n','<h2 class=\"h2-subhead ng-scope\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 16px; margin: 0px; color: rgba(0, 0, 0, 0.87); font-family: Akkurat, sans-serif;\">Reference Range(s)</h2>\r\n\r\n<div class=\"qd-test-center__test-detail-container--content ng-binding ng-scope\" ng-bind-html=\"testDetails.ReferenceRange\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 14px; margin-top: 8px; margin-bottom: 26px; line-height: 1.3em; font-family: Akkurat, sans-serif;\">\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"border-collapse: collapse; border-spacing: 0px;\" summary=\"\" width