poprotein-associated phospholipase A2 (Lp-PLA) is an enzymatic, specific marker of atherosclerosis-related vascular inflammation.&nbsp;Lp-PLA&nbsp;accumulates in atherosclerotic plaques and is believed to contribute to plaque development and rupture by cleaving oxidized phospholipids, which produces pro-inflammatory molecules and oxidized fatty acids.</p>\r\n\r\n<p>Increased Lp-PLA2&nbsp;activity has been linked to increased risk for: (first&nbsp;and recurrent&nbsp;coronary events) adverse prognosis after acute coronary syndrome) stroke) cardiovascular disease associated with metabolic syndrome&nbsp;and) peripheral arterial disease.</p>\r\n\r\n<p>&nbsp;</p>\r\n','<ul style=\"box-sizing: border-box; margin-top: 45px; margin-bottom: 0px; padding-right: 0px; padding-left: 0px; font-family: Raleway, Arial, sans-serif; font-size: 14px; transition: all 0.3s ease 0s !important;\">\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\">\r\n	<h2 class=\"h2-subhead ng-scope\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 16px; margin: 0px; color: rgba(0, 0, 0, 0.87); font-family: Akkurat, sans-serif;\">Reference Range(s)</h2>\r\n\r\n	<div class=\"qd-test-center__test-detail-container--content ng-binding ng-scope\" ng-bind-html=\"testDetails.ReferenceRange\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 14px; margin-top: 8px; margin-bottom: 26px; line-height: 1.3em; font-family: Akkurat, sans-serif;\">\r\n	<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"border-collapse: collapse; border-spacing: 0px;\" summary=\"\" width=\"250\">\r\n		<tbody>\r\n			<tr>\r\n				<td>Females</td>\r\n				<td>50-133 nmol/min/mL</td>\r\n			</tr>\r\n			<tr>\r\n				<td>Males</td>\r\n				<td>70-153 nmol/min/mL</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</div>\r\n	</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !imp