o organ transplantation, CMV infection can be fatal.</p>\r\n\r\n<p>CMV spreads from person to person through body fluids, such as blood, saliva, urine, semen and breast milk. There&#39;s no cure for the virus. However, medications can help treat newborns and people with weak immune systems.</p>\r\n','<ul style=\"box-sizing: border-box; margin-top: 45px; margin-bottom: 0px; padding-right: 0px; padding-left: 0px; font-family: Raleway, Arial, sans-serif; font-size: 14px; transition: all 0.3s ease 0s !important;\">\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\">\r\n	<h2 class=\"h2-subhead ng-scope\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 16px; margin: 0px; color: rgba(0, 0, 0, 0.87); font-family: Akkurat, sans-serif;\">Reference Range(s)</h2>\r\n\r\n	<div class=\"qd-test-center__test-detail-container--content ng-binding ng-scope\" ng-bind-html=\"testDetails.ReferenceRange\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 14px; margin-top: 8px; margin-bottom: 26px; line-height: 1.3em; font-family: Akkurat, sans-serif;\">\r\n	<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"border-collapse: collapse; border-spacing: 0px;\" summary=\"\" width=\"200\">\r\n		<tbody>\r\n			<tr>\r\n				<td><span style=\"font-weight: 700; font-family: sans-serif !important;\">U/mL</span></td>\r\n				<td><span style=\"font-weight: 700; font-family: sans-serif !important;\">Interpretation</span></td>\r\n			</tr>\r\n			<tr>\r\n				<td>&lt;0.60</td>\r\n				<td>Negative</td>\r\n			</tr>\r\n			<tr>\r\n				<td>0.60-0.69</td>\r\n				<td>Equivocal</td>\r\n			</tr>\r\n			<tr>\r\n				<td>&ge;0.70</td>\r\n				<td>Positive</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	A positive result indicates that the patient has antibody to CMV. It does not differentiate between an active or past infection.</div>\r\n	</li>\r\n	<li style=\"box-sizing: