e','1','2019-09-01 15:09:41','2021-01-16 05:21:57',567.0,399.0,'Epstein-Barr-Virus, Viral, quest diagnostics, test direct, new century labs',0),(192,'Lyme Disease Ehrlichia chaffeensis Tick-Borne Infection (IgG, IgM) ','lyme-disease-ehrlichia-chaffeensis-tick-borne-infection-igg-igm','34271 ','<p>Human Monocytic Ehrlichiosis (HME) is a tick-borne infection caused by Ehrlichia chaffeensis. Infections range in severity from asymptomatic to life-threatening, especially in patients who are immunocompromised.</p>\r\n\r\n<p>Ehrlichia chaffeensis&nbsp;is an obligate intracellular, Gram-negative species of Rickettsiales bacteria. It is a zoonotic pathogen transmitted to humans by the lone star tick (Amblyomma americanum). It is the causative agent of human monocytic ehrlichiosis.</p>\r\n\r\n<p>In general, Tick bites are known to cause Lyme disease, but they can also transmit a condition called&nbsp;ehrlichiosis.&nbsp;Ehrlichiosis&nbsp;is a bacterial illness that causes flu-like symptoms that include fever and aches. It can cause very&nbsp;serious&nbsp;complications if left untreated.&nbsp;</p>\r\n','<ul style=\"box-sizing: border-box; margin-top: 45px; margin-bottom: 0px; padding-right: 0px; padding-left: 0px; font-family: Raleway, Arial, sans-serif; font-size: 14px; transition: all 0.3s ease 0s !important;\">\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\">\r\n	<h2 class=\"h2-subhead ng-scope\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 16px; margin: 0px; color: rgba(0, 0, 0, 0.87); font-family: Akkurat, sans-serif;\">Reference Range(s)</h2>\r\n\r\n	<div class=\"qd-test-center__test-detail-container--content ng-binding ng-scope\" ng-bind-html=\"testDetails.ReferenceRange\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 14px; margin-top: 8px; margin-bottom: 26px; line-height: 1.3em; font-family: Akkurat, sans-serif;\">\r\n	<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"border-collapse: collapse; border-spacing: 0px;\" summary=\"\" width=\"200\">\r\n		<tbody>\r\n			<tr>\r\n				<td><span style=\"font-weight: 700; font-family: sans-serif !important;\"><em>E. chaffeensis</em>&nbsp;IgG</span></td>\r\n				<td>&lt;1:64</td>\r\n			</tr>\r\n			<tr>\r\n				<td><span style=\"font-weight: 700; font-family: sans-serif !important;\"><em>E. chaffeensis</em>&nbsp;IgM</span></td>\r\n				<td>&lt;1:20</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</div>\r\n	</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Fasting Required:</span>&nbsp;No</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Preferred Specimen:</span>&nbsp;Serum</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Turnaround Time:</span>&nbsp;3 Days</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Test Code:</span>&nbsp;34271</li>\r\n</ul>\r\n','simple','1','2019-09-01 22:36:31','2021-01-16 05:21:57',395.0,249.0,'Tick, Lyme disease, Ehrlichia chaffeensis, new century labs, quest direct, quest diagnostics',0),(193,'Iodine Random Urine','iodine-random-urine','16601','<p>Iodine is a trace mineral, it&#39;s present in certain vegetables and seafood and is essential for normal thyroid functioning. It&#39;s often added to salt to prevent iodine deficiency.</p>\r\n\r\n<p>Iodine plays a vital role in thyroid health. Your&nbsp;thyroid gland, which is located at the base of the front of your neck, helps regulate hormone production. These hormones control your metabolism, heart health, and more.</p>\r\n','<ul style=\"box-sizing: border-box; margin-top: 45px; margin-bottom: 0px; padding-right: 0px; padding-left: 0px; font-family: Raleway, Arial, sans-serif; font-size: 14px; transition: all 0.3s ease 0s !important;\">\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\">\r\n	<h2 class=\"h2-subhead ng-scope\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 16px; margin: 0px; color: rgba(0, 0, 0, 0.87); font-family: Akkurat, sans-serif;\">Reference Range(s)</h2>\r\n\r\n	<div class=\"qd-test-center__test-detail-container--content ng-binding ng-scope\" ng-bind-html=\"testDetails.ReferenceRange\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 14px; margin-top: 8px; margin-bottom: 26px; line-height: 1.3em; font-family: Akkurat, sans-serif;\">34-523 mcg/L</div>\r\n	</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Fasting Required:</span>&nbsp;No</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Pre