em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Preferred Specimen:</span>&nbsp;Plasma</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Turnaround Time:</span>&nbsp;4 Days</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Test Code:</span>&nbsp;11188</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"font-family: Akkurat, sans-serif; font-size: 14px;\">Dietary supplements containing biotin may interfere in assays and may skew results to be either falsely high or falsely low. For patients receiving the recommended daily doses of biotin, draw samples at least 8 hours following the last biotin supplementation. For patients on mega-doses of biotin supplements, draw samples at least 72 hours following the last biotin supplementation.</span></li>\r\n</ul>\r\n','simple','1','2019-09-02 13:14:03','2021-01-16 05:21:57',289.0,199.0,'Order blood tests online, blood tests, direct-to-consumer, blood test results, lipid panel, NTproBNP, congested heart failure, new century labs, quest diagnostics, quest direct ',0),(195,'Parathyroid Hormone Intact and Calcium','parathyroid-hormone-intact-and-calcium','8837','<p>This test is useful in making the diagnosis of primary hyperparathyroidism, and secondary hyperparathyroidism and a differential diagnosis of hypercalcemia.</p>\r\n\r\n<p>Parathyroid hormone (PTH) helps the body maintain stable levels of&nbsp;calcium&nbsp;in the blood.</p>\r\n\r\n<p>PTH directly promotes the release of calcium from bones into the bloodstream.</p>\r\n\r\n<p>It directly acts on the kidneys to reduce the elimination of calcium in the urine while promoting the elimination of phosphorus in the urine.</p>\r\n\r\n<p>The indirect effect stimulates the kidneys to convert vitamin D from the inactive to the active form, which in turn increases the absorption of calcium from food in the intestines.</p>\r\n\r\n<p>&nbsp;</p>\r\n','<h2 class=\"h2-subhead ng-scope\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 16px; margin: 0px; color: rgba(0, 0, 0, 0.87); font-family: Akkurat, sans-serif;\">Reference Range(s)</h2>\r\n\r\n<div class=\"qd-test-center__test-detail-container--content ng-binding ng-scope\" ng-bind-html=\"testDetails.ReferenceRange\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 14px; margin-top: 8px; margin-bottom: 26px; line-height: 1.3em; font-family: Akkurat, sans-serif;\"><span style=\"font-weight: 700; font-family: sans-serif !important;\">Calcium</span>\r\n\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" height=\"135\" style=\"border-collapse: collapse; border-spacing: 0px;\" summary=\"\" width=\"275\">\r\n	<tbody>\r\n		<tr>\r\n			<td><span style=\"font-weight: 700; font-family: sans-serif !important;\">Age</span></td>\r\n			<td><span style=\"font-weight: 700; font-family: sans-serif !important;\">Male (mg/dL)</span></td>\r\n			<td><span style=\"font-weight: 700; font-family: sans-serif !important;\">Female (mg/dL)</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&lt;1 Month</td>\r\n			<td>8.4-10.6</td>\r\n			<td>8.4-10.6</td>\r\n		</tr>\r\n		<tr>\r\n			<td>1-11 Months</td>\r\n			<td>8.7-10.5</td>\r\n			<td>8.7-10.5</td>\r\n		</tr>\r\n		<tr>\r\n			<td>1-3 Years</td>\r\n			<td>8.5-10.6</td>\r\n			<td>8.5-10.6</td>\r\n		</tr>\r\n		<tr>\r\n			<td>4-19 Years</td>\r\n			<td>8.9-10.4</td>\r\n			<td>8.9-10.4</td>\r\n		</tr>\r\n		<tr>\r\n			