td colspan=\"14\">&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp; 4-6 Years</td>\r\n			<td colspan=\"14\">14.8-32.9</td>\r\n			<td>mcg/mL</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp; 7-8 Years</td>\r\n			<td colspan=\"14\">16.3-30.7</td>\r\n			<td>mcg/mL</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp; 9-10 Years</td>\r\n			<td colspan=\"14\">15.8-27.4</td>\r\n			<td>mcg/mL</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp; 11 Years</td>\r\n			<td colspan=\"14\">15.5-27.4</td>\r\n			<td>mcg/mL</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp; 12 Years</td>\r\n			<td colspan=\"14\">14.8-26.2</td>\r\n			<td>mcg/mL</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp; 13 Years</td>\r\n			<td colspan=\"14\">13.8-25.2</td>\r\n			<td>mcg/mL</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp; 14 Years</td>\r\n			<td colspan=\"14\">12.2-25.2</td>\r\n			<td>mcg/mL</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp; 15 Years</td>\r\n			<td colspan=\"14\">10.8-23.8</td>\r\n			<td>mcg/mL</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp; 16 Years</td>\r\n			<td colspan=\"14\">10.0-23.8</td>\r\n			<td>mcg/mL</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp; 17 Years</td>\r\n			<td colspan=\"14\">8.5-23.1</td>\r\n			<td>mcg/mL</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n\r\n<ul style=\"box-sizing: border-box; margin-top: 45px; margin-bottom: 0px; padding-right: 0px; padding-left: 0px; font-family: Raleway, Arial, sans-serif; font-size: 14px; transition: all 0.3s ease 0s !important;\">\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Fasting Required:</span>&nbsp;No</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Preferred Specimen:</span>&nbsp;Serum</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Turnaround Time:</span>&nbsp;3 Days</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Test Code:</span>&nbsp;870</li>\r\n</ul>\r\n','simple','1','2019-09-02 14:11:27','2021-01-16 05:21:58',290.0,199.0,'870, TBG, Thyroxine-binding globulin, new century labs, thyroid, quest diagnostics, quest direct',0),(197,'Transferrin','transferrin','891','<p style=\"background:white\"><span style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\ncolor:#231F20\">Transferrin is the main&nbsp;protein&nbsp;in the blood that binds to iron and transports it throughout the body. A transferrin test directly measures the level in the blood. Alternatively, transferrin may be measured indirectly (or converted by calculation) so that its level is expressed as the amount of iron it is capable of binding. This is called the total iron binding capacity (TIBC).</span></p>\r\n\r\n<p style=\"background:white\"><span style=\"color: rgb(35, 31, 32); font-family: Arial, sans-serif; font-size: 11pt;\">Iron is an essential nutrient that, among other functions, is necessary for the production of healthy&nbsp;red blood cells (RBCs).&nbsp;It is a critical part of&nbsp;hemoglobin, the protein in RBCs that binds oxygen in the lungs and releases oxygen as blood circulates to other parts of the body. The body cannot produce iron and must absorb it from the foods we eat or from supplements.</span></p>\r\n\r\n<p style=\"background:white;box-sizing: inherit;text-rendering: optimizelegibility;\r\nmargin:1rem;font-variant-ligatures: normal;font-variant-caps: normal;\r\norphans: 2;text-align:start;widows: 2;-webkit-text-stroke-width: 0px;\r\ntext-decoration-style: initial;text-decoration-color: initial;word-spacing:\r\n0px\"><span style=\"font-size:11.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;color:#231F20\"><o:p></o:p></span></p>\r\n','<h2 class=\"h2-subhead ng-scope\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 16px; margin: 0px; color: rgba(0, 0, 0, 0.87); font-family: Akkurat, sans-serif;\">Reference Range(s)</h2>\r\n\r\n<div class=\"qd-test-center__test-detail-container--content ng-binding ng-scope\" ng-bind-html=\"testDetails.ReferenceRange\" ng-if=\"testDetails.ReferenceRange\" style=\"font-size: 14px; margin-top: 8px; margin-bottom: 26px; line-height: 1.3em; font-family: Akkurat, sans-serif;\">188-341 mg/dL</div>\r\n\r\n<ul style=\"box-sizing: border-box; margin-top: 45px; margin-bottom: 0px; padding-right: 0px; padding-left: 0px; font-family: Raleway, Arial, sans-serif; font-size: 14px; transition: all 0.3s ease 0s !important;\">\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Fasting Required:</span>&nbsp;No</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Preferred Specimen:</span>&nbsp;Serum</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Turnaround Time:</span>&nbsp;2</li>\r\n	<li style=\"box-sizing: border-box; transition: all 0.3s ease 0s !important; display: block; list-style-type: none; padding: 5px; color: rgb(82, 81, 82); font-size: 1.2em;\"><span style=\"box-sizing: border-box; font-weight: 700; transition: all 0.3s ease 0s !important;\">Test Code:</span>&nbsp;891</li>\r\n</ul>\r\n','simple','1','2019-09-02 14:20:50','2021-01-16 05:21:58',150.0,87.0,'Order blood tests online, blood tests, direct-to-consumer, blood test results, Transferrin, Iron, TICB, 891',0),(198,'Vitamin D 25-Hydroxy (D2,D3)','vitamin-d-25-hydroxy-d2d3','92888','<p>Vitamin D comes from two sources:&nbsp;endogenous, which is produced in the skin on exposure to sunlight, and&nbsp;exogenous, which is ingested in foods and supplements. The chemical structures of the types of vitamin D are slightly different, and they are named vitamin D<sub>2</sub>&nbsp;(ergocalciferol, which comes from plants) and vitamin D<sub>3</sub>&nbsp;(cholecalciferol, which comes from animals). The D<sub>2</sub>&nbsp;form is found in fortified foods and in most vitamin preparations and supplements. Vitamin D<sub>3</sub>&nbsp;is the form produced in the body and is also used in some supplements. Vitamin D<sub>2</sub>&nbsp;and D<sub>3</sub>are equally effective when they are converted by the liver and the kidney into the active form, 1,25-dihydroxyvitamin D.</p>\r\n','<p><label class=\"ng-scope\" ng-if=\"testDetails.Includes\" style=\"font-size: medium; color: rgba(0, 0, 0, 0.87); font-family: Akkurat, sans-serif;\">Includes</label></p>\r\n\r\n<div class=\"qd-test-center__test-detail-container--content ng-binding ng-scope\" ng-bind-html=\"testDetails.Includes\" ng-if=\"testDetails.Includes\" style=\"font-size: 14px; margin-top: 8px; margin-bottom: 26px; line-height: 1.3em; font-family: Akkurat, sans-serif;\">Vitamin D, 25-OH, Total; Vitamin D, 25-OH,